('113eadda-5879-533f-c3f6-4fe464b795b7', '   Пока варианты ', '2012-03-16 00:00:00', '2012-06-22 16:28:42', '1', '1', '   Пока варианты не очень понравились, далеко от моря, общаются еще с кем то, в конце апреля будут плотнее заниматься вопросом, когда няня приедет. \r\n\r\n', 0, '1'),
('12056b68-05e7-1a40-f865-4fe464d81a1e', 'Варианты нравят', '2011-06-15 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Варианты нравятся,   можно Кампоамор, можно около Торревьехи, но не саму Торревьеху .   сейчас  в процессе продажи дома в России. \r\nУ сына -Дмитрия есть недвижимость в Кесаде,его интересует ВНЖ,его контакты:dmitryvishtaluyk, 81034634555707,Дмитрий будет в Испании до 15 июля.Можно договориться о встрече.', 0, '1'),
('123de73e-9a53-6aff-3d38-4fe464c4a165', 'Добрый день, Евг', '2012-04-12 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Добрый день, Евгения!\r\n\r\nПросмотрела все ваши предложения, понравилось только http://www.costaiberia.ru/ru/property/53/\r\nболее-менее http://www.costaiberia.ru/ru/property/52/ \r\nвроде хорошее место, но нет фото кроме общего вида зданий http://www.costaiberia.ru/ru/property/641/\r\nсимпатичные апартаменты, но непонятно, есть ли инфраструктура http://www.costaiberia.ru/ru/property/161/\r\n\r\nХотелось бы напомнить наши требования:\r\nНовострой (первичка, вторичку даже не рассматриваем), кондоминиум с 2-3 этажной застройкой, стиль модерн\r\nи хай-тек как архитектуре, так и в меблировке (ванная и кухня). Площадь от 80кв.м. с террасой от 20кв.м., 2 спальни,\r\n2 ванные комнаты, лучше не первый этаж\r\n\r\nНапример (нашли сами на вашем сайте) - http://www.costaiberia.ru/ru/property/121/ или\r\nhttp://www.costaiberia.ru/ru/property/534/\r\nв крайнем случае такое http://www.costaiberia.ru/ru/property/560/\r\nесть ли застройки подобного плана в коста дел соль\r\n', 0, '1'),
