('138263c5-9c8e-8c9a-f3d6-4fe464fed115', '"Планы насчет ', '2011-06-15 00:00:00', '2012-06-22 16:28:38', '1', '1', '"Планы насчет Испании переменились, на данный момент не планируем смотреть и покупать недвижимость"', 0, '1'),
('13e4cc42-c732-018d-bf1e-4fe4645fcc73', '"Я напишу Марг', '2012-04-12 00:00:00', '2012-06-22 16:28:42', '1', '1', '"Я напишу Маргарите завтра. Вероятно, получится что то посмотреть в мае.\r\nОна по-русски понимает? или на каком языке писать лучше?" ', 0, '1'),
