('1529f856-5e9a-9543-829d-4fe464052eb0', '"Здравствуйте', '2012-04-10 00:00:00', '2012-06-22 16:28:42', '1', '1', '"Здравствуйте Евгения. Квартира на этой странице мне понравилась и по цене она приемлема для меня. \r\nЯ еще точно не знаю по поводу даты своей поездки, это еще зависит от моих друзей в Испании.  Я дам Вам знать. Если  у вас появятся еще какие-нибудь варианты, скиньте мне пожалуйста. Мне бы хотелось "влезть" вместе с налогами и всеми сборами в 320000евро (на 2 спальни).\r\nА в Барселоне у вас русскоговорящие риэлторы?"', 0, '1'),
('15a91e5a-83e2-a58d-77c2-4fe4642dd9e5', 'Не отвечает уже ', '2011-06-15 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Не отвечает уже больше месяца.', 0, '1'),
('16e41fa0-5544-97b9-9fcc-4fe4644c8d01', ' Пока решают фин', '2011-06-24 00:00:00', '2012-06-22 16:28:38', '1', '1', ' Пока решают финансовые вопросы. Рассматривают не только испанию. Только собирают информацию,возможно,поедут зимой.', 0, '1'),
('173cba66-38fc-aeaa-2209-4fe46458901c', 'Серьезно настро', '2011-11-02 00:00:00', '2012-06-22 16:28:39', '1', '1', 'Серьезно настроена, просила писать и звонить, встречалась в Москве с Антонио.', 0, '1'),
('1764aa4f-bb34-2eca-a48e-4fe464f74503', 'Да, В принципе ло', '2012-04-12 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Да, В принципе лот 543, аппартаменты в комплексе "Пуэрто Рико". Но это на первый взгляд. Вообще очень много лишней информации.\r\nТ.Е.: Меня интересуют варианты с 2 - 3 спальнями, в тихом, ЗЕЛЕНОМ районе, с шаговой доступностью до цивилизации, не в первой линии, с видом на море или первый этаж с куском земли, желательно рядом с парком, до моря(пляжа) пешком в прелах 15 -20 минут. Конечно предпочтение новым домам (урбанизациям), но это не должна быть "стройка в пустыне с чахлыми деревцами". Рассматривается и вторичное жилье.\r\nПожалуйста, не надо меня заваливать ненужной информацией!!!!\r\nЦель моей поездки: с 7 по 14 мая посмотреть несколько городов от Росеса до Лорет де Мар и сделать выбор. Место должно быть интересным не только летом, но и круглый год.\r\nС уважением,\r\nН.Д.', 0, '1'),
('17f907b2-596b-2eb0-4908-4fe464677a8d', 'Кроме Испании ра', '2011-06-17 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Кроме Испании рассматривает еще италию и францию.Может быть, поедет ближе к сентябрю.', 0, '1'),
('19210fbe-89b8-42ef-e94a-4fe4642ecb04', 'Евгения, да, я по', '2012-04-16 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Евгения, да, я получила варианты от Анны. Некоторые мне понравились. Мне бы, конечно, стоило уточнить свои пожелания: мне нужна та недвижимость, на которую дается максимальное финансирование и которая гарантированно может быть сдана в аренду. Если будут такие варианты, присылайте. Буду благодарна. \r\nС уважением, \r\nНаталья\r\n', 0, '1'),
