('1b39de08-3b7b-6c80-1a85-4fe464859158', ' "День добрый!\r', '2012-04-10 00:00:00', '2012-06-22 16:28:42', '1', '1', ' "День добрый!\r\nСпасибо за письмо. Извините, что не отвечаю. Заболел поэтому на незнакомые звонки не беру трубку. В четверг буду полностью на связи.\r\nК сожалению ничего на почту не приходило. Может быть повторите письмо.\r\nМожет все таки ошибка в написании адреса? Еще раз напоминал, что первые латинские буквы V V а не W."\r\n\r\nЖду от Маргариты варианты для Вадима.', 0, '1'),
