('29928f92-1dba-7f3c-715a-4fe4648acdd7', 'Отправляла   вар', '2012-04-18 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Отправляла   варианты  по покупке и по аренде на время поездки.\r\n>\r\n> Стоимость за 2 недели 650 евро + 80 евро за уборку.\r\nлоты  244 и  245\r\n\r\n"Евгения, большое спасибо за предоставленную информацию. Я с вами еще свяжусь. С уважением , Иван Васильевич"\r\n\r\nЯ им написала, что буду в отпуске и если будут звонить в офис, то пусть спрашивают Ирину Балову.', 0, '1'),
('29bf43da-5f29-d458-8d7e-4fe4642c0566', 'Se visitado la promocion. les ', '2011-05-18 00:00:00', '2012-06-22 16:28:14', '1', '1', 'Se visitado la promocion. les an gustado la vivienda en la Torre II 10ª-A, o en la Torre I la 4ª BC (dos de un dormitorio unidas). Se les envio los planos de ambas.', 0, '1'),
