('2ae33da2-76ef-a370-ce43-4fe46407d438', 'Ездил 18-25 июня. О', '2011-06-29 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Ездил 18-25 июня. Откладывает поездку на осень или  до след. 2012 года . Идет продажа земельного  участка здесь в России. Пожелания по покупке скорректировались: интересно к северу от Аликанте,юг не нравится, только если негусто заселенный пригород, от моря до 200м, бюджет 140-150 тыс. ', 0, '1'),
