('2cec40e7-ec0a-e7ba-a163-4fe464bff285', 'Добрый день, Анн', '2012-04-07 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Добрый день, Анна!\r\n\r\nПросмотрели варианты,спасибо за подборку.Будем просматривать дальше и отбирать.\r\nПонравилась\r\nБунгало в Playa Flamenca\r\nБунгало в La Zenia\r\nБунгало в Aguas Nuevas\r\nАпартaмент в Playa del Cura\r\n', 0, '1'),
('2d13280f-9eec-2095-f6bb-4fe464d350b5', '" Я сейчас в Ка', '2011-06-29 00:00:00', '2012-06-22 16:28:38', '1', '1', '" Я сейчас в Казахстане продаю свою недвижимость, возможно  я тут задержусь  на  все лето.Так что по поводу просмотров пока не скоро".', 0, '1'),
('2d5782f0-cbbd-a92c-8f2d-4fe4644f662e', 'Le gusta a la cliente el compl', '2011-03-16 00:00:00', '2012-06-22 16:28:14', '1', '1', 'Le gusta a la cliente el complejo con muchos servicios extra: gimnasio, spa, minigolf, 2 piscinas y . Tambien el estilo y acabados de 1ª calidad. Importante cercania al mar.', 0, '1'),
('2e413ec4-f082-3b85-1e32-4fe464eefb5a', 'необходим больш', '2011-03-21 00:00:00', '2012-06-22 16:28:14', '1', '1', 'необходим большой участок 12-15 соток', 0, '1'),
('2e4c0527-ee5b-33fa-2997-4fe46467fd0b', 'Добрый день, Евг', '2012-04-26 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Добрый день, Евгения!\r\n\r\nСпасибо за предоставленную информацию. \r\nХочу ввести Вас в наше понимание сути покупки недвижимости в Испании.\r\n\r\nМы рассматриваем вариант покупки апартаментов/квартиры в Барселоне, либо апартаментов/таунхауса/дома на Costa Brava в пределах 150 км от Барселоны.\r\n\r\nПо квартире в Барселоне приоритеты следующие\r\n\r\n- близость известных достопримечательностей (Рамбла, Готический квартал, Саграда фамилия и тд)\r\n- доступность метро\r\n\r\nПо Costa Brava\r\n- большое количество "зелени"\r\n- близость моря (не более 30 мин на автомобиле)\r\n\r\nОбщие критерии следующие\r\nПервичный фонд / вторичное жильё - большого значения для нас не имеет.\r\nТакже не имеет принципиального значения коичество спален.\r\n\r\nЧто называется что больше понравится, то и купим.)\r\n\r\nЕвгения, напоминаю Вам что в июле в течение трёх недель мы будем в Испании.\r\nНесколько дней мы будем в Барселоне, а потом в Calogne, что севернее Lloret de Mar.\r\nСоответственного готовы посмотреть варианты предложенные Вами.\r\nИз присланного Вами больше всего к нашим критериям подходит квартиры в Poble nou.\r\n\r\nСпасибо!\r\n\r\nС уважением,\r\n\r\nСергей.\r\n', 0, '1'),
('2e795ccc-338a-7923-bd4e-4fe4641c209b', '1. Требуется конс', '2011-07-01 00:00:00', '2012-06-22 16:28:38', '1', '1', '1. Требуется консульстация юриста.\r\nСобирается открыть совместную российско-испанскую фирму на территории Испании. Производство растворимого цикория. В Испании выращивать сырье, потом его вывозить в Россию, т.к. тут уже налажено производство.\r\nКонсультация нужна по налогообложению при вывозе сырья за границу. Данная консультация должна быть оказана по телефону и предоставлена бумага за подписью юриста по интересующим его вопросам. Будет ждать звонка нашего юриста из Испании.\r\n\r\n2. Владелец собственности в испании. Собирается покупать еще одну квартиру, на которую уже оформлен кредит до 2032 г. Эта квартира будет оформляться на его сына. В Испанию ехать не хочет, хочет оформить тут доверенность и чтобы все сделали за него.\r\nНужен четкий ответ по последовательности действий и стоимости наших услуг.', 0, '1'),
