('36d0c08f-2f80-1fea-21fa-4fe464f1f097', 'Марина думает по', '2012-05-11 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Марина думает поехать в июне к своей знакомой на коста дорада, но хотела бы приехать на бланку на пару дней.\r\nДоговорились созвониться через пару недель.\r\nОна не против встретиться и посмотреть объекты.', 0, '1'),
('37bec548-7bda-a908-6776-4fe464d8266c', 'не понравился.    ', '2011-04-25 00:00:00', '2012-06-22 16:28:14', '1', '1', 'не понравился.          изменились предпочтения. Прошу Вас подобрать виллу на участке земли от з соток в Дении, Хавее, Алтее или Кальпе. Желательно новую, с красивым видом из окон. Растояние до моря не принципиально. Бюджет 200 тыс. Очень желательно отопление. ', 0, '1'),
