('385da5ab-aa36-4dca-f9c7-4fe46463dcb3', 'Его заявка по жи', '2012-05-11 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Его заявка по жилью.\r\n1.	г.Барселона и ее окрестности (окрестн.  радиусом не более 20-30 км.)- побережье не интересует.Интересует район  Эйшампле или в верхняя часть города, или в соседних районах - Сан Герваси и Педральбес, или районы для постоянного проживания,  не нужна пешая доступность до моря.\r\n\r\n 2.Необходим дом. квартира из  3-х и более комнат (для ПМЖ).\r\nПарковочное  место.\r\n\r\n3. Семья из 6 чел.:\r\n- взрослые 56, 57 ,80 лет\r\n- дети 5, 7 и 16 лет\r\n\r\n4. Интересует рядом :\r\n Необходимо в близи : супермаркеты, торговые центры, садики, учебные заведения - английская  школа , хорошие коммуникации, где спокойно и безопасно.\r\n\r\n\r\n5. Рассматриваем покупку в ипотеку. Оформление  на  меня 41  год.\r\n\r\n6. Вылет для покупки жилья 01.06.12 г.:\r\n- необходима  помощь в размещении \r\n- встрече и сопровождении\r\n- поиск  банка  для получения ипотеки\r\n- в дальнейшем помощь в получении ВНЖ.\r\n7. Бюджет 400 000 евро.\r\n', 0, '1'),
('38b139fc-679c-8c56-8d25-4fe4648b7a38', 'Варианты нравят', '2011-06-17 00:00:00', '2012-06-22 16:28:14', '1', '1', 'Варианты нравятся,   можно Кампоамор, можно около Торревьехи, но не саму Торревьеху .   сейчас  в процессе продажи дома. \r\nУ сына -Дмитрия есть недвижимость в Кесаде,его интересует ВНЖ,его контакты:dmitryvishtaluyk, 81034634555707,Дмитрий будет в Испании до 15 июля.Можно договориться о встрече.', 0, '1'),
