('3b1b11cc-d8b6-f6b4-5e8b-4fe4642b9e9b', 'В первую очередь', '2011-11-03 00:00:00', '2012-06-22 16:28:40', '1', '1', 'В первую очередь рассматривают Лазурку. о Майорке говорили тоже.\r\nОн просил прислать по Коста Браве в сторону Франции.Я ему отправляла варианты из базы, не заинтересовали. \r\nАнатолий сказал, что жене нужно обязательно 1 линия!!!,\r\n участок 15-20 соток, вилла 150-250 кв.м., З спальни. Саму Барсу не надо. Можно еще Коста де Мар. Для отдыха, спокойное место. \r\nПопрошу Инну Толмачеву прислать варианты.\r\nОбщаемся с Анатолием хорошо.', 0, '1'),
