('3f623617-8584-efd7-39f5-4fe464ac8721', 'Наконец дозвони', '2012-05-14 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Наконец дозвонилась до Ольги.\r\nОна была в отъезде, собирается ехать летом(конец июня-июль).', 0, '1'),
('3f9c6b40-4d4a-a0b3-97c2-4fe46481576c', 'Добрый вечер Сем', '2011-11-02 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Добрый вечер Семен,\r\n\r\n Пишу вам по просьбе моей коллеги из Санкт Петербурга- Евгении.\r\n Женя передала мне, что вас интересует вид на жительство в Испании при том, что вы являетесь резидентом Чехии.\r\nМогу вам рассказать в общих чертах способы и процесс, и если у вас появятся дополнительные вопросы- буду рада помочь.\r\n\r\nВид на жительство может быть как с правом на осуществление трудовой деятельности, так и без.\r\nПервый вариант подразумевает открытие бизнеса на территории Испании с созданием рабочих мест и экономическими вливаниями в экономику Испании (налоги и пр.). Это более затратный способ, однако он даст вам возможность работать.\r\nВторой способ подразумевает под собой вашу возможность проживать на территории Испании без необходимости работать, что естественно нужно подтвердить наличием стабильного экономического положения.  Хотелось бы уточнить, что и в этом случае вы имеете право быть учредителем юридического лица, но без возможности осуществлять рабочую деятельность. \r\n\r\nЕсть еще один способ- только в том случае, если вы имеете пятилетнюю резиденцию Чехии.\r\n\r\nПодача всех документов при первом и втором варианте производится  в Консульстве Испании на территории Чехии или России (все будет зависить от ситуации, которую нужно будет изучить)\r\n\r\nПодача документов в третьем варианте происходит на территории той области, резидентом который вы намереваетесь стать (т.е. там, где у вас собственность).\r\n\r\nОчень буду надеяться, что моя информация хоть немного вам помогла, и на дальнейшее наше сотрудничество.\r\n\r\nПожалуйста, не сомневайтсь, связывайтесь с нами или нашими сотрудниками в офисе Санкт Петербурга по любым, интересующим вас вопросам.\r\n \r\nВсего самого доброго.\r\n С уважением\r\n', 0, '1'),
('3fd66273-7cf3-1e60-1ccc-4fe4643c0efc', 'В данный момент ', '2011-04-25 00:00:00', '2012-06-22 16:28:14', '1', '1', 'В данный момент планы изменились, сейчас пока  не планируют покупку недвижимости в Испании. ', 0, '1'),
('410611c8-9126-2c72-e09c-4fe46410fe94', 'покупка и аренда', '2011-06-17 00:00:00', '2012-06-22 16:28:14', '1', '1', 'покупка и аренда уже не актуальны', 0, '1'),
('41163929-4e9b-9347-0982-4fe46496daa7', '  Варианты апарт', '2011-07-18 00:00:00', '2012-06-22 16:28:38', '1', '1', '  Варианты апартаментов и апартотелей ,которые мы  предложили Константину, ему не подошли. В итоге он с семьей поедет по горящей путевке в Грецию, поэтому с ним вопрос по аренде закрыт. ', 0, '1'),
('4125be84-eef2-8414-02fa-4fe464a5bdf5', 'Пришлите, пожалу', '2012-05-14 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Пришлите, пожалуйста, новые варианты для Сергея.\r\n\r\nОн пока еще доп. информации не запрашивал, но лучше бы ему прислать еще варианты.', 0, '1'),
('42013998-4923-a6f4-f74c-4fe464cddcd6', 'покупка пока отк', '2011-03-22 00:00:00', '2012-06-22 16:28:14', '1', '1', 'покупка пока откладывается, хотят арендовать с 14 июля на 3 недели, аликанте, торревьеха, до 1км до моря', 0, '1'),
('426a4565-459d-82ec-1c0e-4fe46425ffc2', 'Elena Klimova\r\nResidencia sin ', '2011-07-19 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Elena Klimova\r\nResidencia sin realisar actividades laborales\r\n\r\nЕлена владеет недвижимостью в городе под Жироной. Записала сына в муниципальную школу по адресу прописки, учеба начинается этой осенью.\r\nЕе основной интерес - ВНЖ без права на работу для нее и для ее маленького сына (9 лет ему, кажется). Но так как учеба у ребенка начинается осенью, ее интересует, возможно ли для начала к осени получить студенческую резиденцию.\r\n\r\nЕлена в ближайшее время ожидает звонка нашего юриста из Испании, чтобы получить первичную консульстацию, что ей делать и сколько будут стоить наши услуги.\r\n\r\nСправку о несудимости она уже заказала, ждет ее получения.', 0, '1'),
('42f8af43-cd78-9a5a-6d9e-4fe4644ae8d8', 'Испанию больше н', '2011-06-17 00:00:00', '2012-06-22 16:28:14', '1', '1', 'Испанию больше не рассматривает. Интересна Болгария и Словения.', 0, '1'),
('431b628f-d5bc-20fb-048c-4fe4642f11f4', 'Мужу варианты не', '2012-04-12 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Мужу варианты не понравились, Екатерина посмотрит сама.', 0, '1'),
('43a25ad7-1038-b027-7b65-4fe464aa93ed', 'Просмотрели уча', '2011-07-19 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Просмотрели участки в Монтесинос,также в Бениссе 451,452,453,454. Жена уехала в Россиию до 9 августа, после ее приезда возобновляем просмотр. ', 0, '1'),
('43dae65a-eb78-8750-cbed-4fe46448d4d4', '!!!Владимир после', '2011-11-15 00:00:00', '2012-06-22 16:28:40', '1', '1', '!!!Владимир после выставки был на встрече в офисе:\r\nОбласть поиска-от Картахены до Аликанте\r\nИнтересует транспассо,купить действующий бизнес на арендных площадях, 30 тыс. евро,скорее всего по бюджету это будет кафе. Он врач-ортопед,он бы там работал, можно подумать о виде на жительство с правом на работу и рабочим контрактом.Про ВНЖ попросила Аню Бабошкину ему написать.\r\nЕхать думает в январе.\r\nПришлите, пожалуйста, возможные  варианты по покупке бизнеса!!!Он очень ждет!\r\n\r\nP.S. Уже есть недвижимость рядом с Торревьехой,купил с «Globus». Мне на выставке сказал, что еще задумывается о приобретении еще одного объекта,может для дочери. Андрею Владимировичу об этом не упоминал.', 0, '1'),
('43dc7fb1-adee-b3cd-aef1-4fe46480519f', 'Думает ехать с с', '2011-04-07 00:00:00', '2012-06-22 16:28:14', '1', '1', 'Думает ехать с середины июня по середину июля, арендовать таунхаус Шарипова. кроме аренды покупка тоже интересует.', 0, '1'),
('44792ea5-cb5d-675c-d327-4fe46446e746', 'Не могла разгова', '2012-05-14 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Не могла разговаривать, была в роуминге, просила позвонить через месяц. \r\n', 0, '1'),
