('44d46be0-c07c-5ca2-5849-4fe46448ca4e', 'la familia grande (Residencia)', '2011-07-21 00:00:00', '2012-06-22 16:28:38', '1', '1', 'la familia grande (Residencia):\r\nAvdeev Yury, su esposa Yuliia y 5 niños (7 años, 5,5 años, 4 años, 2,5 años y 1 año). \r\nTres hijos mayores van estudiar en la escuela en septiembre. Vivirán en el apartamento arrendado (el alquiler a largo plazo). \r\n', 0, '1'),
('45a933a5-1b17-494f-33b7-4fe464fc59d6', 'Ездил 12-17 июня.\r\n&q', '2011-06-20 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Ездил 12-17 июня.\r\n"Эта поездка еще раз подтвердила правильность нашей линии и поэтому ее можно оценить как успешную. Поездка, думаю, должна состояться в начале осени, если конечно до этого не будет сделано реальное предложение."', 0, '1');
