('4691f413-7c0a-2218-273b-4fe464ceffd6', '"Евгения, добр', '2011-08-01 00:00:00', '2012-06-22 16:28:38', '1', '1', '"Евгения, добрый день!\r\nКак обстоят дела с продажей моего дома? Я хочу активизироваться в этом направлении."\r\n', 0, '1'),
('46c026d1-f9af-a64a-0f6a-4fe464d6d598', 'Анна, добрый ден', '2012-05-15 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Анна, добрый день!\r\nПисьмо Ваше получила, предложение смотрю, предложение хорошее.\r\nЯ сейчас во Франции, занимаюсь вопросами документов.\r\nЕще не планировала как буду возвращаться в Москву, будет ли время посетить Испанию.\r\nОбязательно Вам напишу, если получится организовать визит для просмотров.\r\nС уважением, Ирина Двинина\r\n', 0, '1'),
