('495e6f82-e771-4fb4-fe0a-4fe464fef442', 'Здравствуйте, Ел', '2011-08-03 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Здравствуйте, Елена!\r\n\r\nРада слышать, что Вы спланировали поездку в Испанию. Сразу скажу, что встречу Вас в аэропорту, а также могу предложить место для проживания проживание (если Вы конечно еще самостоятельно не решили этот вопрос).\r\n\r\nС первоначальном взносом в размере 25.000 евро Вы можете рассчитывать на недвижимость в ценовой категории до 100.000 евро.\r\n\r\nС уважением,\r\nJurga Cvetkova\r\nDpto. Venta \r\n', 0, '1'),
