('4c23244b-f4dd-4dab-19e0-4fe4646c3cce', '"Евгения, здра', '2011-08-04 00:00:00', '2012-06-22 16:28:38', '1', '1', '"Евгения, здравствуйте.\r\nСпасибо за присылаемые Вами письма. \r\nБыл в отпуске полтора месяца, поэтому на звонки ответить не мог. \r\nВарианты недвижимости получаю, изучаю, и продолжаю думать над покупкой, новых вопросов не возникло, пока еще не дозрел окончательно.\r\nС наилучшими пожеланиями, Матвеев Константин."  \r\n', 0, '1'),
