('4d72708a-c998-3d21-4915-4fe4643b3279', 'С апреля не отве', '2012-05-16 00:00:00', '2012-06-22 16:28:42', '1', '1', 'С апреля не отвечает. ', 0, '1'),
('4e2ab833-96d3-7c17-b366-4fe4640b4a2f', 'Светлана пришла ', '2011-08-17 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Светлана пришла к нам сделать визу.\r\n2-10 сентября улетает в Барселону. Можно присылать ей наши варианты недвижимости.\r\nНедвижимость не в самой Барселоне, а рядом, 2 спальни,рядом с морем, бюджет примерно 200 тыс.\r\nПо типу пока точно не определилась,надо отправлять апартаменты и таунхаусы.\r\nТакже можно отправить варианты и по коста бланка.', 0, '1'),
('4e525b4f-6c57-ab9c-7261-4fe464dc093a', '  Елене нужно име', '2011-11-07 00:00:00', '2012-06-22 16:28:40', '1', '1', '  Елене нужно именно в бюджете от 60 до 70 тыс евро,2 спальни.Пришлите,пожалуйста,еще варианты кроме базы!!\r\n  1-3 декабря будет в Торревьехе, согласна и с нами посмотреть, но сначала хочет еще варианты увидеть. ', 0, '1'),
