('544c6b37-40df-f03d-5471-4fe464488410', '"Евгения, добр', '2011-11-07 00:00:00', '2012-06-22 16:28:40', '1', '1', '"Евгения, добрый день ! \r\nВаши предложения получил. Большое спасибо. Всё очень понятно идоступно. Хотел спросить у Вас будетели Вы на выставке в скк ? Если да, сообщите я к вам подойду. С уважением , Владимир."', 0, '1'),
('551683f8-98b5-13dd-f673-4fe464d84c7c', 'Анна, добрый ден', '2012-05-28 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Анна, добрый день!\r\nМы с Вами общались на выставке недвижимости. Позже Вы прислали несколько объектов,некоторые из них понравились\r\n \r\nДуплекс en Punta Prima (Торревьеха - Коста Бланка)\r\nЛот: 000138 - ЦЕНА: 169.000 119.500 €\r\n Апартaмент en Guardamar (Гуардамар Дель Сегура - Коста Бланка)\r\nЛот: 000139 - ЦЕНА: 137.900 €\r\nБунгало en La Mata (Торревьеха - Коста Бланка)\r\nЛот: 000253 - ЦЕНА: 143.000 €\r\n Апартaмент en La Mata (Торревьеха - Коста Бланка)\r\nЛот: 000495 - ЦЕНА: 119.000 €\r\nособенно последний, из-за цены и близости к морю.\r\nпланируем поехать в Испанию в начале июля.\r\nПодскажите оказываете ли вы визовую поддержку для москвичей, как с вашей компанией связаться в Испании,сколько по времени занимает процесс просмотра объектов, самостоятельно бронировать гостиницу или через вас (если да, то сколько стоит).Аэропорт в Испании Аликанте или возможен другой вариант.\r\nБуду рада, если быстро ответите.\r\nС уважением , Юлия.\r\n', 0, '1'),
('552ff819-8f01-b364-511b-4fe464738b1b', 'собирается поле', '2011-04-07 00:00:00', '2012-06-22 16:28:14', '1', '1', 'собирается полететь в Испанию  посмотреть варианты с 18 июня на неделю. \r\nБюджет 100-120 тыс. 1-2 спальни, 1-2 линия от моря, апартаменты, таунхаус, бунгало. В первую очередь хотят смотреть север Коста Бланка, но и на юге тоже могут посмотреть.\r\nуже сами нашли аренду в Кальпе на время просмотра.\r\n', 0, '1'),
