('5b5dd29e-91bf-b086-5dd8-4fe464892aa6', 'Ирина, я облазил', '2011-04-06 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Ирина, я облазила всё возможное и не возможное ища что–то подходящее для Ореста, но к сожалению до 100.000 евро в этих городах ничего нет, цены от 170.000...\r\nЗа  60.000 можем предложить в маленьких городках Аликанте, но ни как в Севильи, Толедо и Кордоба.\r\n\r\nС уважением,\r\nЮрга', 0, '1'),
