('6047bbe7-c3b5-8476-3334-4fe46403ab4a', 'Михаилу понрави', '2011-09-27 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Михаилу понравился вариант по Барселоне:\r\n Апартаменты в здании Порта Норд.\r\n> Жилой дом в строительстве, расположенный по соседству с кварталом Лес\r\n> Кортс в Хоспиталете.\r\n> Современный Проект застройки ,подчеркивающий важную часть северного\r\n> фасада здания и четкость линий.\r\n> Поблизости расположен стадион Камп Ноу.\r\n> Жилая площадь квартиры составляет 62м2и состоит из 2 спален с\r\n> встроенными шкафами, 1 ванная комната, светлая гостиная, кухня\r\n> оборудованная электроприборами, терраса.\r\n> Цена: € 255 000\r\n\r\n"Добрый день\r\n Буду в Барселоне в Ноябре.\r\nКвартира в новом доме заинтересовала.\r\nЕсли будут подобные варианты - можно будет в ноябре посмотреть."\r\n\r\nПока еще не известны точные даты его поездки, он готов рассмотреть наши варианты.\r\n\r\n', 0, '1'),
