('75d5aa0b-9962-c460-93de-4fe4648981ba', 'Добрый день!\r\n\r\nКл', '2011-10-06 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Добрый день!\r\n\r\nКлиент с московской выставки Олег Вениаминович(он кстати генерал) решил поехать 8 октября в Бенидорм на неделю,если у него будет время, он посмотрит недвижимость, но, может, и не получится вырваться. Пожелания: 1 спальня, квартира, 70 тыс евро,15-20 минут пешком до моря.\r\nУ него есть телефоны Юрги и Ани.\r\nЕго телефон 7 926 320 45 96.\r\n', 0, '1');
