('7871e670-fa44-a9ca-a0e6-4fe464c00576', 'Как планировало', '2011-11-14 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Как планировалось 19,20 ноября не получится поехать в Испанию. Теперь созваниваемся 5,6 декабря. Владимир Степанович сказал, что в промежутке до 15 декабря полетит.', 0, '1'),
