('79630400-ea22-7d0c-34bf-4fe4649a7fea', 'Какие то продажи', '2011-06-15 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Какие то продажи в России  притормозились, но, возможно, ближе к осени поедут.', 0, '1'),
