('7a085788-db75-d367-8b3e-4fe464dbd8c0', 'Estan dudando entre tres vivie', '2011-05-25 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Estan dudando entre tres viviendas. Se le recomendo Atico en La Caleta Ref.331. Pendiente de enviarles propuestas de locales comerciales en Torevieja y Benidorm 1ª linea. Superficie hasta 100m2. lo estan consultando con su hijo. Seguramente que hagan otro vieje de inspeccion un poco mas largo. Esta visita fue muy corta, y les da la pena que se fueron tan pronto.', 0, '1'),
