('80df1d81-63e0-b959-ff93-4fe4642393e5', 'Кроме вариантов ', '2011-11-17 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Кроме вариантов из базы отправила еще три предложения по Торревьехе не из базы (69,72,74 тыс )', 0, '1'),
('8127c7a9-35f5-d361-a53f-4fe464586b11', 'Ваши ипотечные п', '2011-04-09 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Ваши ипотечные платежи будут проходить через рассчетный счет 0081 0542 11 0001300537 в SabadellSolbank 454,49 евро ежемесячно в последних числах каждого месяца. Электричество, вода и кондоминимум также будут проходить через этот счет. Так как в данный момент Вы не пользуютесь водой ни светом, это будут минимальные суммы – 10 или 15 евро раз в два месяца. \r\nСтоимость кондоминимума составляет 45 евро в месяц, оплата будет производится поквартально с Вашего счета. \r\n', 0, '1'),
('83611c7d-9efa-c5ce-48d7-4fe464f4f8d0', 'Пожалуйста, приш', '2011-11-17 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Пожалуйста, пришлите, варианты отелей.', 0, '1'),
('83e24ea3-61fa-e5ae-4460-4fe464839189', 'Llamada 25/05/2011\r\n22/06/2011', '2011-05-25 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Llamada 25/05/2011\r\n22/06/2011 viene familia a pasar las vacaciones. Tiene apartamentos alquilados en Aldea del Mar. Vladimir con su amogo vendra aproximadamente para 3 de agosto. Y en estas fechas vamos a ver las propiedades para la venta. Me comprometido llamarle antes de 20 de junio.', 0, '1'),
('85b1e648-a04a-1147-56bf-4fe464fbbd2a', 'Пока Иван не пре', '2011-11-17 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Пока Иван не предпринимает активных действий до поездки весной 2012, собрал инфо , на связи.', 0, '1'),
