('882dec94-b5e3-6f29-24ae-4fe46439007d', 'Адрес Елены: \r\ncalle', '2011-11-18 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Адрес Елены: \r\ncalle NUNILON, portal 6, 1ºA, res. El Bosque, Alameda del Mar, 03189 Orihuela Costa, provincia Alicante ', 0, '1'),
('89b49012-d34b-c678-3e02-4fe464c143e0', '!!Разговаривала ', '2011-11-18 00:00:00', '2012-06-22 16:28:40', '1', '1', '!!Разговаривала с Зоей:\r\nОна будет 4 декабря на 10 дней в Аликанте, жить где-то в центре. Готова посмотреть недвижимость.\r\nБюджет поменялся-теперь до 100 тыс.Хочет смотреть на север от Аликанте, но лучше ближе к Валенсии. Главное, чтобы рядом была ж/д станция.\r\nЛлорет де мар уже не смотрит.\r\nВо время поездки будет на связи по сотовому, но потом может написать и скайп .\r\nЖдет от нас вариантов.\r\nCможем ли мы ей что -то показать примерно в её бюджете?', 0, '1'),
('8aa80c95-21a6-7d01-39d0-4fe46425b842', 'Отложил покупку ', '2011-06-08 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Отложил покупку до  лета 2012г.', 0, '1'),
('8b112f07-6952-1340-41fa-4fe4648f74d8', 'Jurga. Le he llamado al Sr.Vit', '2011-06-03 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Jurga. Le he llamado al Sr.Vitaliy. Viene a Saluo dia 11 de junio para pasar vacaciones 1 mes. Le ofrecido bajar a Costa Blanca para una semana al final de su viaje. Pendiente de enviar ofertas de alojamiento: hotel 5*, u otro (villa de Roman Kulikov). Hemos quedado que apartir del día 13 de junio le llamo y organizamos los detalles de su visita.', 0, '1'),
('8b6cd141-4abe-80a2-81ea-4fe4644aac90', 'Галина купила би', '2011-12-02 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Галина купила билеты на февраль, обещала сбросить инфо по рейсу. Буду звонить ей в понедельник.', 0, '1'),
