('8d383b4f-fd09-a99d-f800-4fe46478bf44', 'Рассматривают а', '2011-06-15 00:00:00', '2012-06-22 16:28:14', '1', '1', 'Рассматривают апартаменты и таунхаусы, но еще не пришли к общему мнению  по поводу типа недвижимости, пока ехать не собираются.Алле больше нравятся таунхаусы.', 0, '1'),
