('8f125163-6588-4fd9-39d5-4fe464d9007b', 'Se le envio 7 ofertas de inmue', '2011-06-03 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Se le envio 7 ofertas de inmuebles, maximo acercadas a su peticion. Tambien una carta de saludo. ', 0, '1'),
