('8ff35501-6e2c-da96-8796-4fe4645af587', 'не отвечает', '2011-06-10 00:00:00', '2012-06-22 16:28:14', '1', '1', 'не отвечает', 0, '1'),
('90f9f05d-19df-d199-d54a-4fe464d4be4c', 'Людмила Петровн', '2011-10-07 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Людмила Петровна и Владимир Александрович приезжают с 31 октября по 7 ноября , они уже забронировали себе апартаменты в отеле в Торревьехе где - то ближе к Ла Мате.\r\nЛюдмила пришлет мне точную информацию по рейсу.\r\nНастроены они серьезно,надеются, что поездка завершится покупкой.\r\n ', 0, '1'),
('916e4e40-281c-d144-e726-4fe4645cdf3d', 'бюджет поменялс', '2011-04-26 00:00:00', '2012-06-22 16:28:14', '1', '1', 'бюджет поменялся-теперь до 63тыс евро. можно и подороже. Только апартаменты (1-2 спальни), дом или таунхаус уже не рассматривают. Определился с побережьями-бланка,дорада,соль.', 0, '1'),
('92880e46-68ca-951f-6fc3-4fe46487eef6', 'Пока думают с му', '2011-10-07 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Пока думают с мужем, стоит или нет вкладывать деньги в исп. недвижимость , м.б. поедут в начале января.', 0, '1'),
('92edfccf-ff0b-a51b-4418-4fe4640f7755', 'Склоняется к Кос', '2011-06-24 00:00:00', '2012-06-22 16:28:14', '1', '1', 'Склоняется к Коста Бланка. Думает ехать в августе,но пока точные даты не известны из-за ребенка.', 0, '1'),
('93ec23da-65f4-73ac-998e-4fe46460c159', 'Скажите, пожалуй', '2011-12-06 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Скажите, пожалуйста, есть ли какая то информация для Алексея Олеговича? ', 0, '1'),
('9430bd32-063d-c349-6749-4fe464887ecd', 'больше месяца не', '2011-06-17 00:00:00', '2012-06-22 16:28:14', '1', '1', 'больше месяца не отвечает', 0, '1'),
('9578002c-c34f-f95c-a94a-4fe4641fe5dc', 'В больнице,пока ', '2011-10-07 00:00:00', '2012-06-22 16:28:38', '1', '1', 'В больнице,пока реабилитируется после операции,недели через 3 вернется к рассмотрению вопросов по недвижимости.', 0, '1'),
('959ebfa1-a2e0-e282-ae69-4fe464610e43', 'Собирался в Барс', '2011-06-24 00:00:00', '2012-06-22 16:28:14', '1', '1', 'Собирался в Барселону в первой декаде июля,но оказалось, что у жены закончилась виза, сейчас оформляют документы на визу.Будем на связи.', 0, '1'),
('95bc16d8-081e-a8ce-370f-4fe4648cf6ab', 'Намерение покуп', '2011-12-06 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Намерение покупать есть, настроен хорошо.\r\nНо сейчас улетают в Америку, вернутся в середине января.\r\nЕхать в Испанию для просмотров думают или на мартовские каникулы или на майские. Шамиль склоняется к мартовским.\r\nБудем на связи, вернемся более предметно к разговору в январе. ', 0, '1'),
('96df689d-0eb9-fb09-d15d-4fe464cb21d5', 'думает ехать в а', '2011-06-24 00:00:00', '2012-06-22 16:28:14', '1', '1', 'думает ехать в августе, созваниваемся 4 июля.', 0, '1'),
('97c1d4f4-7dbf-1e40-16b9-4fe4642ceef2', 'Людмила собирал', '2011-12-07 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Людмила собиралась ехать в феврале-марте, но сын решил жениться в июле, и теперь не известно, когда получится поехать.', 0, '1'),
('98222ca3-2721-6312-c510-4fe464b73f24', 'Покупать сейчас ', '2011-10-07 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Покупать сейчас не собирается в  Испании, просто интересовался пока. \r\nу него есть недвижимость в Турции.', 0, '1'),
('9830731b-202a-7d76-381e-4fe464464f6e', 'По указ. тел Миха', '2011-06-03 00:00:00', '2012-06-22 16:28:14', '1', '1', 'По указ. тел Михаила нет, по почте не отвечает', 0, '1'),
('99532f93-7ef3-ba10-4d3a-4fe464889266', 'Видел, но с други', '2011-11-03 00:00:00', '2012-06-22 16:28:14', '1', '1', 'Видел, но с другими. ', 0, '1'),
('9a03e6ce-da59-8e67-a4a3-4fe464298871', 'Евгения, спасибо', '2011-12-08 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Евгения, спасибо.\r\nНо, к сожалению, мне пришлось отложить данный проект.\r\nВремя возобновления пока не могу спрогнозировать, т.к. есть ряд субъективных причин, которые меня ограничивают\r\n\r\nС уважением, Ковалев Михаил.\r\n', 0, '1'),
