('9cd90de4-f4fe-db0f-7baf-4fe4648c40a0', 'Уже месяц не отв', '2011-06-29 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Уже месяц не отвечает. Недвижимость не для себя ,а для сестры с мужем. Муж хочет более сельскую местность и склоняется больше к хорватии, а жена к испании и место городское. ', 0, '1'),
('9cf95b95-d8f8-23d1-6241-4fe46459092a', 'Евгения за грани', '2011-10-07 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Евгения за границей сейчас,варианты получили.Она передаст Алексею о возможности встречи с Антонио.', 0, '1'),
('9d9c3241-cd7b-3a2a-e5dd-4fe464e03a9f', 'Le gusta, pero quiere algo mas', '2012-02-12 00:00:00', '2012-06-22 16:28:14', '1', '1', 'Le gusta, pero quiere algo mas cerca al mar. Le interesa la ubicaion exacta. Le he enviado ubicacion en google maps. ', 0, '1'),
('9ec47dbf-d0f4-8587-e649-4fe464b6b8bf', 'nravitsya vidy', '2012-05-16 00:00:00', '2012-06-22 16:28:14', '1', '1', 'nravitsya vidy', 0, '1'),
('9fd038e2-3390-c120-f2a6-4fe4648dd1fe', 'Буду ждать вариа', '2012-01-10 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Буду ждать варианты, чтобы прислать ему в сравнении в  Торревьехе и Аликанте.\r\nЕсли сложно будет подобрать варианты именно в бюджете 150, то можно чуть выйти за рамки.', 0, '1'),
