('9ff667a9-9fd9-ffca-8185-4fe46423a37d', 'He llamado a Sra. Natalia. Me ', '2011-06-14 00:00:00', '2012-06-22 16:28:37', '1', '1', 'He llamado a Sra. Natalia. Me confirmo que viene el día 9 ssw julio, le tengo que llamar este dia. VA trabajar solo con nuestra empresa. Quiere comprar apartamento an 1ª linea de 2 dormitorios. Precio aprox.200.000€. Jurga', 0, '1'),
