('a59e803a-577b-8116-4169-4fe464d26cf8', 'Привет, Анна!\r\n\r\nЭ', '2011-10-19 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Привет, Анна!\r\n\r\nЭто одна клиентка с московской выставки. Она хочет переехать жить в Испанию, в течении пол года. Хочет купить жилье, оформить вид на жительство и учредить фирму тут. Ей в первую очередь важно: фирма и ВНЖ, а параллельно жилье. Ее зовут Ирина (forina59@hotmail.com), tel. +7 905 584 82 79. Я ей уже давала твой эл.адрес, она еще с тобой не связалась? Ты свяжись, скажи что ты коллега Юрги. Она хочет общую информацию по налогообложение в Испании, как учредить фирму и т.д., и хочет начинать оформлять ВНЖ.\r\nВсе, потом скажешь, ок?\r\nJurga Cvetkova\r\nDpto. Venta \r\n', 0, '1'),
('a5d08cbf-2e42-872a-22ec-4fe464a7266f', 'Елена Орлова и Д', '2011-10-11 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Елена Орлова и Дмитрий были сегодня на встрече с Антонио. \r\nОни думают поехать в ноябре, я им смотрела билеты.\r\nПо покупке:\r\n1)дуплекс,150 кв.м., 300-400 тыс евро. Пришлите, пожалуйста, такие варианты!\r\n2)квартира с гарантированной сдачей в аренду, 100 тыс. евро (отправлю те же варианты, что и Чабаненко)\r\nОни также думают кроме Коста Бланка посетить Коста дель Соль, там посмотреть.', 0, '1'),
('a8239548-b816-fc1a-6ec9-4fe464a9c47a', 'Александр Федор', '2012-01-30 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Александр Федорович Марков еще раз общался с А.В. \r\nОни с женой уже точно определились, что это будет Испания. Он хочет ехать в конце февраля-начале марта.\r\nОбязательно нужен объект с гарантированной сдачей, 100-150 тыс. , ликвидность через 15-20 лет.\r\nОн ждет от нас варианты.\r\n', 0, '1'),
('aa300139-6ecc-4ef6-1683-4fe464379799', 'Интересны вариа', '2012-04-16 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Интересны варианты в Рохалес и Релью.  \r\nТакже интересно- построен ли в Кумбре дель соль, какое расположение на карте. \r\nНужно  на карте расположение: Ла марина(южнее Дении)\r\nВозможна ли ипотека на все эти варианты 80 %?   ', 0, '1'),
('ab70454e-5cd1-05aa-1808-4fe464cefbda', 'Евгения , добрый ', '2012-02-03 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Евгения , добрый день!! Спасибо за информацию.Из всего списка хотелось бы посмотреть на месте объекты по лотам: 000174,000175, 000183,000184,000185,000469,000007,00056.Итого 8 . Еще посмотрев сайт luxuf.ru нашли 5 интересных для нас объектов , могли бы вы их взять для взаимодействия -след номера объектов: 30;320 и 28( расстояние до моря);72;166(есть ли пентхаус?)Спасибо.\r\n', 0, '1'),
('abf6bd73-9e73-8005-0f9b-4fe46469e651', 'Здравствуйте Ув', '2011-10-18 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Здравствуйте Уважаемые Владимир Иванович и Лидия Михайловна!\r\n\r\nКак и обещала отправляю Вам актуальные цены на квартиры в здании Gemelos 26.\r\nТакже  Вы просили помочь разобраться с контрактами, которые Вы подписали с застройщиком и фирмой Леанга. Для этого мы договорились, что Вы мне отправите копии договоров, что бы наш адвокат мог их проанализировать до нашей встречи. \r\nЖду ответа. С уважением,\r\n\r\nJurga Cvetkova\r\nDpto. Venta \r\n', 0, '1'),
