('c3e89aa0-7f31-105d-0ab2-4fe4646ec4b0', 'Прислать по ллор', '2012-03-05 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Прислать по ллорету!\r\n сказал, что написал ответ-хочет ллорет, как дача. Думает поехать в июне,  бланку тоже посмотреть.', 0, '1'),
('c487a09c-8021-9169-bb10-4fe46423b1e9', ' Супруга Николая', '2011-05-30 00:00:00', '2012-06-22 16:28:37', '1', '1', ' Супруга Николая забеременела, вопрос покупки пока отложили.', 0, '1'),
('c4cb2936-8134-2cf5-f41e-4fe464160ff8', 'АННА ОТПРАВИЛА 21', '2011-10-21 00:00:00', '2012-06-22 16:28:38', '1', '1', 'АННА ОТПРАВИЛА 21/10: 8,10,31,83,91,92,97,138,142,156,162,256,310,311,317,400-402,517,526-528.\r\n', 0, '1'),
('c537d035-a24d-9b41-dff0-4fe4642b53e1', 'Некоторые вариа', '2012-03-05 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Некоторые варианты понравились, но ехать в конце лета тока, сам сказал, что нас имеют в виду, будет с нами общаться. ', 0, '1'),
