('c673760d-ab91-e62d-eb55-4fe464c9a9ae', 'Понимает, что на', '2012-03-05 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Понимает, что надо ехать смотреть, просил прислать варианты по проживанию на вторую половину июля на 2 недели. Вообще бы надо с 1 спальней, но можно и с 2, зависит от цены, надо подешевле.', 0, '1'),
