('c7d6c478-9f65-b0c9-37c0-4fe46428af51', 'Рассматривают а', '2011-07-07 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Рассматривают апартаменты и таунхаусы, но еще не пришли к общему мнению  по поводу типа недвижимости, пока ехать не собираются.Алле больше нравятся таунхаусы. \r\nПока приостановили вопрос с недвижимостью до осени.', 0, '1'),
('c7e6b833-c509-b173-6162-4fe46431b784', 'Сергею отправил', '2011-10-21 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Сергею отправила еще пару вариантов по тосса и ллорету(что и для Дмитрия Черепнева)', 0, '1'),
('c80ae2d6-694b-1139-865a-4fe4644b3aae', 'Zhenya: 29,31,117,165,287,325,', '2012-02-28 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Zhenya: 29,31,117,165,287,325,326,333,358,401,433,480,517,532.\r\n', 0, '1'),
('c8e523b2-0fc2-8cdb-edbf-4fe464d91c3c', ' Здравствуйте,Юр', '2011-10-24 00:00:00', '2012-06-22 16:28:38', '1', '1', ' Здравствуйте,Юрга!\r\nПолучил Ваши варианты недвижимости ,большое спасибо.\r\nКомплексы все очень достойные,но все равно их надо смотреть на месте.Мы как только соберемся в Испанию ,я с Вами обязательно свяжусь.Извените что не сразу ответил.Будут хорошие варианты,присылайте,чем ближе к морю тем лучше.\r\nС ув. Юрий и Люба!\r\n\r\n19 октября 2011 г. 18:06 пользователь Jurga Cvetkova <jurga@nbagroup.es> написал:\r\n \r\n', 0, '1'),
('c918420a-723b-442d-29af-4fe464eef63d', 'Все время не отв', '2011-06-20 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Все время не отвечает по почте и телефону.', 0, '1'),
('c9f9aa64-728c-1d45-bb81-4fe4641d6ac7', 'Думает ехать в а', '2011-07-07 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Думает ехать в августе,созваниваемся 15 июля.', 0, '1'),
('cae443cc-085b-2366-522c-4fe464a467e9', 'Анна отправила 24', '2011-10-24 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Анна отправила 24/10: costa del sol - 151,153,161,350,353,354,357. c. blanca - 5,6,9,14,44,50,53,54,121,201,254,257,290,318,329,423,496-498,528,530.\r\n', 0, '1'),
('cb1f78b0-dc52-e5dd-a6f9-4fe464a0c845', '295,27,396,296,316,547\r\n', '2012-02-28 00:00:00', '2012-06-22 16:28:40', '1', '1', '295,27,396,296,316,547\r\n', 0, '1'),
('cb6e7112-7533-d177-3133-4fe464a3089d', 'Склоняется к Кос', '2011-06-24 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Склоняется к Коста Бланка. Думает ехать в августе,но пока точные даты не известны из-за ребенка.', 0, '1'),
('cbfdc2be-0fef-2fc0-2f62-4fe464c0b75b', '"Добрый вечер,', '2012-03-07 00:00:00', '2012-06-22 16:28:40', '1', '1', '"Добрый вечер, Евгения!\r\nПриятно читать комплименты, тем более,  что они соответствуют действительности. Я знаю,  чего я хочу и имею четкий план действий - в течение этого лета я выбираю город на Коста Брава,  а затем в течение года -полутора покупаю виллу или дом. То есть сейчас смотреть варианты пристально имеет мало смысла. Важно только общее понимание,  что я могу получить за свои деньги - здесь я укрепился во мнении,  что что -то устраивающее найти можно. Так что,  спасибо за информацию,  но сейчас смотреть конкретные варианты мне рано.\r\nС уважением, Алексей."\r\n\r\n"Ошибся - конечно же Коста Бланка от Дении до Аликанте. Будем ждать лета."', 0, '1'),
('cc27a083-db4a-c244-b9e7-4fe4647080ea', 'Анна отправила: 2', '2011-10-24 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Анна отправила: 24/10 -  29,30,211,278,325,356,400,417,419,435,519. \r\n', 0, '1'),
('cc8b21d8-bbff-0931-9f9a-4fe4645ee283', 'Евгения:\r\nПожалу', '2011-03-25 00:00:00', '2012-06-22 16:28:36', '1', '1', 'Евгения:\r\nПожалуйста, внесите в базу данных информацию по данному клиенту. Объекты, которые ему отправлялись, комментарии и др. Данные по перелёту я уже  внесла. Спасибо.', 0, '1'),
('cce19357-eced-d44d-8b55-4fe464bc56bd', 'Уже больше месяц', '2011-06-27 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Уже больше месяца не возможно дозвониться.', 0, '1'),
('cd3b2bfd-e0a1-6791-a635-4fe4640a14c8', 'ЕДЕТ С 7 ПО 14 АПРЕ', '2012-03-11 00:00:00', '2012-06-22 16:28:40', '1', '1', 'ЕДЕТ С 7 ПО 14 АПРЕЛЯ, РАБОТАЕТ С АБСОЛЮТ ДО 9 АПРЕЛЯ, С 10  - С НАМИ. ', 0, '1'),
