('cdd3c4e3-256c-afae-0a3d-4fe4646475b8', '"Мы выбрали св', '2011-06-07 00:00:00', '2012-06-22 16:28:37', '1', '1', '"Мы выбрали свой вариант проживания и проезда (через родственников друзей ), к которым все вместе поедем в сентябре, возможно на машине.  Когда уточнится дата я Вам сообщу. Далее согласуем место встречи в обозначеном Вами районе." По недвижимости просит отправлять недорогие варианты, 50 тыс. "Один из вариантов переезда: 1 этап - купить на время  жилье с основной целью начать процедуру ПМЖ. Последним этапом продавать основную недвижимость. ВНЖ- основная цель." ', 0, '1'),
('ce544ee7-78cb-f78d-2112-4fe464776da2', 'Анна отправила 24', '2011-10-24 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Анна отправила 24/10: 5,8,10,45,50,54,87,92,104,121,242,269,290,318,336,402,411,423,446,498,502,507,512.\r\n', 0, '1'),
('ce5c4836-2c44-2b10-dbcf-4fe464d6e05f', 'Марина в итоге к', '2012-03-13 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Марина в итоге купила себе сама билеты. Едет с 26 апреля по 10 мая.\r\n\r\nПо проживанию наши апартаменты ей дорого как ни крути, гостиница тоже.Будет сама че-нибудь еще искать.\r\n\r\nЯ жду от неё данные по рейсу!)', 0, '1'),
('cf623759-5f59-8803-7bbc-4fe464b59dc4', 'Анна отправила 24', '2011-10-24 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Анна отправила 24/10 - 7,16,89,97,119,138,255,400,495,526,531. \r\n', 0, '1'),
