('d08e0351-0931-89ce-a21f-4fe464e17a82', 'В августе едет в ', '2011-06-17 00:00:00', '2012-06-22 16:28:38', '1', '1', 'В августе едет в лондон, в испанию - уже осенью.Варианты нравятся.', 0, '1'),
('d1350ecf-155a-06d9-298e-4fe464a3d3f6', 'Хочет ехать на н', '2012-03-14 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Хочет ехать на неделю в испанию, а затем на неделю в португалию.', 0, '1'),
