('d19d9aa5-c8e0-6065-9bb4-4fe464ca0442', 'Пока все еще нах', '2011-06-28 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Пока все еще находится в процессе продажи(как только продаст что то в россии, готов ехать в испанию смотреть).', 0, '1');
INSERT INTO `cosib_messages` (`id`, `name`, `date_entered`, `date_modified`, `modified_user_id`, `created_by`, `description`, `deleted`, `assigned_user_id`) VALUES
('d2845faa-ee98-22cf-523f-4fe464fed293', 'Интересуют  вилл', '2011-06-15 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Интересуют  виллы подороже, земельные участки тоже может рассмотреть,поехать сможет ближе к осени.', 0, '1'),
('d2b7b50e-201b-4ed4-a139-4fe4644fde68', 'Аня прислала вар', '2012-03-14 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Аня прислала варианты, а в какталоге типа они же дороже. (стр 16 номера 03 и 02)', 0, '1'),
('d34056c8-f35a-0cc7-dd19-4fe464f9f352', 'вообще думает в ', '2011-10-24 00:00:00', '2012-06-22 16:28:38', '1', '1', 'вообще думает в отрезке с 10 по 15 ноября поехать по путевке, но может рассмотреть наши варианты билетов и проживания.', 0, '1'),
('d3e144a6-e66d-1a70-ce8d-4fe4647ed7aa', 'Рассматривает  Г', '2011-06-21 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Рассматривает  Германию также, скоро уезжает туда ,просила связаться в сентябре.  Испания -вторично, но м.б. все же вернется к Испании. ', 0, '1'),
('d4792143-a018-bfa6-3d5b-4fe4641cb29d', '                        Доб', '2012-03-15 00:00:00', '2012-06-22 16:28:40', '1', '1', '                        Добрый день, Евгения,\r\n понял, спасибо, возможно передвинем поездку на 12-13 мая туда,  обратно  26-27 мая.\r\n', 0, '1'),
('d4d42f36-fd14-5280-2432-4fe4644ad184', 'В первую очередь', '2011-06-24 00:00:00', '2012-06-22 16:28:37', '1', '1', 'В первую очередь рассматривает Турцию,также Черногорию,Хорватию, но пока  не сбрасывает Испанию с счетов как вариант.', 0, '1'),
('d5d34d20-7a43-fb7e-3338-4fe4646e1f18', 'Это учитель года', '2011-06-28 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Это учитель года ЯНАО 2010, которой был вручен сертификат от PROCOSTA на поездку в Испанию. Мы должны обеспечить ей трансфер из/в аэропорт, предоставить ей апартаменты для проживания и компенсировать затраты на ее перелет. Перелет членов семьи не компенсируется.\r\nОна едет с дочерью и родителями. Всего их 4 человека.', 0, '1'),
('d5f0e486-fad1-d5dc-e930-4fe46450076b', 'анализирует сит', '2012-03-15 00:00:00', '2012-06-22 16:28:40', '1', '1', 'анализирует ситуацию на рынке, записались на какие-то  аукционы, если что , свяжется', 0, '1'),
('d62168ec-2b92-4fad-9ce5-4fe464dc1c7e', 'пока точно не оп', '2011-10-24 00:00:00', '2012-06-22 16:28:38', '1', '1', 'пока точно не определился,но думает поехать после 10 ноября может на месяц,возможно не только на бланку, хочет сначала что то снять, посмотреть, попозже определится с планами', 0, '1'),
('d6cf883f-26a2-5d58-f720-4fe464d63ddb', 'Через полгода за', '2011-04-11 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Через полгода займутся покупкой, пока финансы не позволяют.', 0, '1'),
('d78bd9d1-f57f-1506-0551-4fe4643b1004', 'Александр уже не', '2012-03-15 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Александр уже не рассматривает Браву, так как  понимает, что по бюджету лучше Бланка подходит.\r\nнужен объект с мебелью, в самом аликанте не хочет, что то в округе в 30-40 км можно.', 0, '1'),
('d7cf0cf3-363c-dda1-f4f5-4fe4646c12a9', 'Может быть, не по', '2011-05-30 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Может быть, не получится поехать в сентябре, так как  не известно, что получится с отпуском.', 0, '1'),
('d8c53c0d-63ac-42d5-8405-4fe4646a8484', 'Продает что то в ', '2011-05-27 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Продает что то в Петербурге, от этого зависит, пока только собирает информацию, прямо сейчас покупать не собирается.', 0, '1'),
('d8e808e4-568e-5d8e-30e3-4fe4642464bc', 'Пока думают, на с', '2012-04-11 00:00:00', '2012-06-22 16:28:42', '1', '1', 'Пока думают, на связи, саму Торревьеху не хотят, лучше Кальпе, Альтея, Ориуэла, будут изучать места,можно присылать  что-нибудь. \r\n\r\nПришлите, пожалуйста, для них возможные новые варианты.', 0, '1'),
('d9a2681d-8773-20f2-c70f-4fe46427223c', 'Отложили поездк', '2012-03-20 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Отложили поездку до лета, сам просил присылать что-нибудь. Понимает, что надо ехать смотреть.', 0, '1'),
('d9dafacd-f158-9c57-e194-4fe464b08d25', 'Пока точно не из', '2011-06-15 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Пока точно не известно, когда получится поехать,может быть, в отпуск по путевке в августе или сентябре.', 0, '1'),
('db17ab4e-7ee9-a9cb-72f5-4fe4642f2423', 'ANNA: \r\nЗдравствуйт', '2012-03-20 00:00:00', '2012-06-22 16:28:40', '1', '1', 'ANNA: \r\nЗдравствуйте!\r\nСмотрю ваш сайт каждый день вариантов много из тех что понравились 000138, 000424, 000601, но немного не вписываемся в бюджет, кредитоваться не хочется, думаем на время отложить покупку, Вы нас не забывайте т.к мы настроены на покупку.\r\n', 0, '1'),
('db89fdf8-062e-de61-5808-4fe464d74f71', 'Сможет поехать в', '2011-06-28 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Сможет поехать весной 2012г', 0, '1'),
('dc0aa8e8-aaaf-2ea5-e68f-4fe464ffe684', 'Добрый день, Анн', '2012-03-20 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Добрый день, Анна. Отправляю Вам наши пожелания по недвижимости. Нас интересует вторичная залоговая недвижимость от банков в районе, ограниченном  улицами от Морионе до Роэтген, от  Диего Рамирез Пастор до пляжей, площадью от 60 м2, обязательно с 2-мя спальнями,  ценой до 55 000 евро., с ипотекой 70%. Если у Вас имеются подобные варианты, будем рады их рассмотреть. Если возникнут вопросы, задавайте, ответим по возможности полно.  На выставке я рассказывал Вам наши примерные пожелания, но к сожалению, получил от Вас, совершенно не подходящие по наши условия, предложения. Прошу Вас не отнимать ни своего, ни моего времени, присылая иные, отличные от вышеуказанных условий, предложения. Также напоминаю Вам, что мы планируем поездку в Испанию в начале мая, и поэтому ни билеты, ни визы нам не нужны - эти проблеммы мы решили. \r\nС уважением Михаил.\r\n', 0, '1'),
('dcad5372-4c24-2ae8-aa66-4fe4645b4bf4', 'после 1 ноября пр', '2011-10-24 00:00:00', '2012-06-22 16:28:38', '1', '1', 'после 1 ноября приедет в москву', 0, '1'),
('dce6a29b-8236-ab6d-7526-4fe464930883', 'Сначала отклады', '2011-06-13 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Сначала откладывали вопрос до осени, но теперь Светлана попросила посмотреть варианты недвижимости в  Сарагоса-Барселона-Валенсия. Особенно интересует Валенсия. Желаемый бюджет все также до 100 тыс', 0, '1'),
('dcfd1ee5-fd6f-fdf1-2d4d-4fe464ee093b', 'Добрый день, Анн', '2012-03-12 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Добрый день, Анна!\r\n Апартaмент en Las Marinas (Дения - Коста Бланка) - это аппартаменты в отеле?\r\nЗаинтересовали:\r\nАпартaмент en Cala de Finestrat (Бенидорм - Коста Бланка)\r\nАпартaмент en Playa Poniente (Бенидорм - Коста Бланка)\r\nАпартaмент en Gran Via (Аликанте - Коста Бланка)\r\nАпартaмент en Puerto Alicante (Аликанте - Коста Бланка)\r\n', 0, '1'),
('dd96514d-b7e8-2c7f-ada0-4fe4648bbd4d', 'Оплата ипотечно', '2011-10-20 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Оплата ипотечного кредита будет производиться 1 числа каждого месяца по 464,79 евро (ежемесячно). \r\nПервая оплата пройдет 1 декабря этого года, сумма первой оплаты составит 690 евро (так как захватывает 1,5 месяца, то есть с момента подписи – 18 октября до 30 ноября). Эта сумма только первой оплаты, остальные по 464,79 евро. \r\nс уважением, Анна. ', 0, '1'),
('de97da49-ecd9-f0b5-b452-4fe464ee0202', 'Анна отправила 25', '2011-10-25 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Анна отправила 25/10: 126,203,229,232,235,236,239,240.\r\n', 0, '1'),
