('e0626d79-39a5-fa5a-88bb-4fe464b8cebf', 'Решили отложить ', '2011-10-26 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Решили отложить вопрос до весны, интерес есть. Дети учат в Москве испанский, Галина думает, чтобы на лето их отправлять в Испанию.', 0, '1'),
