('e1b81380-ac89-716c-abb1-4fe464a79ba4', 'Вчера отправила ', '2012-03-23 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Вчера отправила некоторые варианты коммерч. недвижимости   от партнеров по Барсе.\r\nРоман ответил: "Добрый день. Посмотрел объекты. Вопрос следующий, а возможен ли кредит под комерческую недвижимость, и если да, то какое соотношение своих денег к заемным?"\r\n\r\nЖду от партнеров ответ.:\r\n"Евгения, если на объект уже есть кредит, то можно получить до 80%. Если же нет, - то сейчас ситуация с новыми кредитами немного сложная, но возможно получить до 50%. "\r\n\r\nРоман: "Ну вот первый из вашего списка, где арендатор Grupo Pirelli, там какая ситуация? И еще. Какие ставки по кредитам под комерческую недвижимость?"', 0, '1'),
