('e1fd2429-06f1-bc92-0391-4fe464d11031', '"Евгения спас', '2011-10-26 00:00:00', '2012-06-22 16:28:38', '1', '1', '"Евгения спасибо за ответ! К сожалению не было возможности сразу Вам ответить. Из всех вариантов мне ближе вот этот (лот 287) - критерии:\r\n- близко к морю\r\n- 2 спальни\r\n- обозначенная мною стоимость\r\nнедостатки:\r\n-непонятный пляж\r\n- мало зелени\r\n- год постройки?\r\nЕсли будут предложения с аналогичными параметрами - пожалуйста пишите"\r\n\r\nОтправила ей 29,30,517,521\r\n', 0, '1'),
