('e4c6c5a0-3198-6a21-24bc-4fe464509cdc', 'Сейчас в процесс', '2011-06-10 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Сейчас в процессе продажи квартиры в России, от этого зависит. Только осенью скорее всего смогут поехать. Надо 2 спальни с раздельными кроватями.Николай-сын.Муж-инвалид,поэтому важно наличие или возможность постройки пандусов.', 0, '1'),
