('e5cb9ab3-6a93-3cb1-6d1c-4fe464141416', 'Теперь и Бланку ', '2012-03-23 00:00:00', '2012-06-22 16:28:40', '1', '1', 'Теперь и Бланку тоже рассматривают!\r\n\r\nТаунхаус в урбанизации, 3 спальни, возможно с мебелью, вид на море, традиционная инфраструктура, общий бассейн, 1 линия, гараж, 300-350 тыс.\r\n\r\nОтправила варианты. ', 0, '1'),
('e6c7bec0-2297-fcb3-1cb6-4fe464339e8d', 'Здравствуйте, Ва', '2011-10-27 00:00:00', '2012-06-22 16:28:38', '1', '1', 'Здравствуйте, Валерий!\r\n\r\nМы с Вами общались вчера по телефону и я пообещала выслать Вам список документов нужных для оформления ипотечного кредита. В первую очередь, для открытия банковского счета, Вам с собой нужно привезти документ подтверждающий Ваши доходы (это может быть выписка из банка и удостоверение пенсионера или  же государственная справка, в которой указывается общая годовая сумма выплаты пенсии). \r\nЕсли Вы хотите оформить кредит, Вам будет нужна та же справка о получаемой пенсии, выписки из банковских счетов и налоговые деклараций (что эквивалентно утверждению, налога на прибыль в вашей стране). Если у Вас есть совершеннолетние дети, они могут быть гарантом в оформление кредита.\r\n\r\nС уважением,\r\nJurga Cvetkova\r\nDpto. Venta ', 0, '1'),
('e8ad2135-dbe7-9e25-005d-4fe4642de051', 'обстоятельства ', '2011-10-27 00:00:00', '2012-06-22 16:28:38', '1', '1', 'обстоятельства изменились, не актуально сейчас', 0, '1'),
