('ea9a3680-541c-6a60-2ad3-4fe4648ae4ab', 'Хочет открыть  м', '2011-06-16 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Хочет открыть  малый бизнес, связанный с автомобильной тематикой(например, небольшой автосервис или заправка или мойка).бюджет 100-150тыс, но может быть и до 200тыс. По жилой недвижимости интересны недорогие предложения. Изначально  обсуждали, что не раньше  июня сын поедет в испанию на неделю.Но сейчас пока определенности по датам нет, так как у дочери какие-то  проблемы.    ', 0, '1'),
