('edd84460-f9d5-aab4-107f-4fe464d99852', 'Муж -за испанию, ', '2011-06-23 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Муж -за испанию, она -за францию, сейчас идут продажи в России,  от этого зависит. хотят ехать смотреть и испанию и францию,пока точно не известно,когда сможет поехать.', 0, '1'),
('ee1f32eb-6190-de7e-a49b-4fe4640e5f4c', 'Анатолий Павлов', '2012-03-26 00:00:00', '2012-06-22 16:28:41', '1', '1', 'Анатолий Павлович в Мск встречался с Антонио и АВ.\r\n\r\nСам Анатолий сможет поехать посмотреть недвижимость примерно через пару месяцев, так как свои дела, что то тут продает.\r\n\r\nКроме того, у него есть директор, который хочет снять дом в районе соленых озер с 6 или 7 или 8 или даже 9 спальнями с 20 июля по 20 сентября.\r\nВ семье 2 взрослых, 2 детей(17 и 15 лет). Спален надо побольше, так как планируется приезд родственников.\r\nПришлите, пожалуйста, варианты по аренде. Может, виллу Антонио?\r\n', 0, '1'),
