('ef8d7538-91c3-1d2d-ba30-4fe4640029d6', 'Будет с 29 апреля ', '2012-03-27 00:00:00', '2012-06-22 16:28:41', '1', '1', 'Будет с 29 апреля по 10 мая в Испании с большой компанией, они поедут от Барсы до маоаге на машине. Просил сбросить контакты коллег, возможно получится встретиться, он согласен.', 0, '1'),
