('f252b3bf-03be-0a4e-e185-4fe4646902af', 'Из-за каких-то  б', '2011-05-30 00:00:00', '2012-06-22 16:28:37', '1', '1', 'Из-за каких-то  больших расходов летом не поедут, осенью уже ребенок в школу идет, поэтому не известно,когда смогут поехать.', 0, '1'),
('f2bab7d6-38c6-8632-3d4f-4fe4641c656a', 'Кроме вариантов ', '2012-04-04 00:00:00', '2012-06-22 16:28:41', '1', '1', 'Кроме вариантов по Бланке Анатолию отправлялся давно еще вариант по Кастельдефельс за 163. \r\nПоехать сможет в июне-июле, меньше  тяготеет к Бланке, все-таки больше хочется от Барсы до Салоу.', 0, '1'),
