('106edb6b-52f9-de97-de6c-4fe464190e08', 'd08e0351-0931-89ce-a21f-4fe464e17a82', '2012-02-02 00:00:00', 'Периодически звоню ему,начиная с НГ, пока не берет трубку, хотя до НГ говорил, что вопрос покупки переносится на начало следующего года.', 0, '1'),
