('1212c7da-73d1-cb08-ab69-4fe464269589', '10369bc0-9c22-dc1e-4b2f-4fe46458dbb8', '2011-11-11 00:00:00', 'Добрый вечер, Евгения, варианты получил, но не рассматривал. Планирую поездку в мае, июне. Присылайте варианты в это время.\r\n \r\nСпасибо,\r\nСергей.\r\n', 0, '1'),
