('161a1018-62ad-aec2-5685-4fe464d09b98', '14e7bbfe-98c4-02c1-1d16-4fe46493a447', '2011-11-07 00:00:00', 'Товарищ Евгения, с которым они хотят покупать, сейчас на даче, если идти на встречу в офис, то вдвоем сразу, созвонимся через неделю.', 0, '1'),
