('16c17803-ca6c-b7aa-c775-4fe464330da9', '1529f856-5e9a-9543-829d-4fe464052eb0', '2012-05-22 00:00:00', 'Евгения, привет!\r\n\r\nЯ связалась с клиенткой Мариной Перуанской, она сказала, что по приезду сама мне наберет. Так что будем ждать.\r\n\r\nС уважением,\r\n\r\nРита\r\n', 0, '1'),
('171912be-df79-90f5-1fcc-4fe464b171be', '1529f856-5e9a-9543-829d-4fe464052eb0', '2012-06-20 00:00:00', 'Рита написала-" с мариной созванивались и вели переписку, в последнем письме она написала , что уже определилась к сожалению."', 0, '1'),
('185df591-2f37-78a9-a5cd-4fe464f7e742', '173cba66-38fc-aeaa-2209-4fe46458901c', '2011-11-18 00:00:00', 'Галина настроена серьезно, в конце января -феврале хочет поехать.\r\nОна очень увлечена Испанией, свободно говорит по-испански, всегда мечтала об Испании, преподавала в университете историю испанского языка.\r\nОчень хорошо общаемся с ней.', 0, '1'),
('187e3b15-2ebd-ebbf-79a9-4fe464a0e022', '1764aa4f-bb34-2eca-a48e-4fe464f74503', '2012-04-19 00:00:00', 'Жилой комплекс в Tossa del Mar может быть интересен, но надо смотреть на месте все в комплексе.\r\nВ Tossa del Mar буду с 12  по 14 утро.\r\nН.Д.\r\n\r\n\r\nУ Николая и Маргариты есть контакты друг друга. Вообще он будет 7-14 мая на Брава. ', 0, '1'),
('189f006d-bf5e-dccd-dc23-4fe464a9e20b', 'f2cb52de-a595-215c-f8c1-4fe464084f74', '2012-01-24 00:00:00', 'Андрей так и не отвечает на звонки.Ему отправлены два варианта домов, которые Аня присылала для Виталия Александровича.', 0, '1'),
('18cb98d4-03ec-0a92-e344-4fe46486a42b', '1764aa4f-bb34-2eca-a48e-4fe464f74503', '2012-05-14 00:00:00', 'Ответ Риты из Барселоны: \r\n\r\n"с 7-14 - это был Николай Дмириевич, мы с ним разговаривали, но как-то он не очень заинтересованным показался, обещал перезвонить (потому что варианты ему были предложены), чтобы опредилиться, смотрим ли что, но пропал."', 0, '1'),
