('2023704a-3eba-12a3-64b3-4fe464ea16be', '1ed61f48-f3c0-4237-292d-4fe464cdb112', '2012-05-25 00:00:00', 'Было не очень удобно разговаривать, но сказала, что купили билеты на 25 или 26 сентября.\r\nБудем на связи.', 0, '1'),
('205f3105-bf92-69b6-31f3-4fe46437eb4a', '1ee3a110-b744-9564-9ed1-4fe4640c83a1', '2011-08-28 00:00:00', 'Добрый день!\r\n\r\nНе могли бы Вы прислать более подробную информацию по данным объектам?\r\n\r\nСпасибо.\r\n\r\nOn Aug 26, 2011, at 10:55 AM, Jurga Cvetkova wrote:', 0, '1'),
('2071e4cb-e0f1-52e6-6c0c-4fe464933f69', '1ed61f48-f3c0-4237-292d-4fe464cdb112', '2012-06-07 00:00:00', 'Надежда Васильевна поедет с мужем 27 сентября по 11 октября.\r\nМожно предложить ей варианты по проживанию на время поездки.\r\nСкажите, пожалуйста, какие варианты будут свободны и в какую цену?', 0, '1'),
('20cd20da-a225-9dc8-5478-4fe46456c0d5', '1ed61f48-f3c0-4237-292d-4fe464cdb112', '2012-06-08 00:00:00', 'Надежде были отправлены варианты по проживанию za 50€ v den: 68,172,244,245,246, 652,706.\r\nНадежда планирует приехать 27 сент по 11 окт.', 0, '1'),
('20de7932-3487-7735-1359-4fe4643919de', '1ee3a110-b744-9564-9ed1-4fe4640c83a1', '2011-08-29 00:00:00', 'Здравствуйте, Ув. Александр!\r\nОчень приятно получить от Вас письмо. Напоминаю, что кампания по НДС распространяется абсолютно на всю новую недвижимость. Если я не ошибаюсь Вас интересует 2-х спальные апартаменты в пешей доступности от пляжа. Назовите, пожалуйста, какие еще характеристики жилья важны для Вас, и я отправлю наиболее подходящие Вам предложения.\r\n\r\nПодробная информация по объектам, предоставленным в предыдущем письме:\r\nКомплекс SUNLAKE II. http://www.costaiberia.ru/ru/property/8/\r\n    Новое жильё\r\n    СПАЛЬНИ: 3\r\n    Ванные: 2\r\n    Площадь: 74 M²\r\n    Общая площадь: 102 M²\r\n    Участок: 65 M²\r\n    Расстояние до моря: 2000 m.\r\n    Расстояние от коммерческого района: 400 m.\r\n    Предустановка системы кондиционирования\r\n    Общий бассейн\r\n    Подвал\r\nЖивописные виды на солёное озеро.  В спокойном районе. В 5 минутах пешком имеется вся необходимая для жизни инфраструктура (супермаркеты, аптеки, рестораны, солоны красоты), развитый городской транспорт, рядом начальная и средняя школы. Идеально для проведения семейного отпуска и постоянного проживания. ЦЕНА: 145.000 €\r\n\r\nКомплекс «Гуардамар Хилл Ресорт» в Гуардамар Дель Сегура - Коста Бланка http://www.costaiberia.ru/ru/property/4/\r\nЦЕНА: от 161.000€ ,\r\nЦЕНА 2-х спальных апартаментов от 240.000 €, скидка 10%.\r\n    Новое жильё\r\n    СПАЛЬНИ: 2\r\n    Ванные: 2\r\n    Общая площадь: 94 M²\r\n    Балкон: 17.7 M²\r\n    Расстояние до моря: 750 m.\r\n    Расстояние от коммерческого района: 750 m.\r\n    Бытовая техника\r\n    Кондиционер\r\n    Общий бассейн\r\n    Гараж\r\n    Сигнализация\r\n    Вид на море\r\n    Вид на горы\r\nКомплекс расположен в Гуардамар, в привилегированной зоне с прекрасными видами на море, имеет протяженную сосновую территорию, которой придан статус охраняемой зоны.\r\nЖилой комплекс, чтобы наслаждаться спокойствием, при этом, не отказывая себе ни в каких удобствах и используя огромные возможности для отдыха, расположенные в самой зоне.\r\nПросторные общественные зоны с бассейнами, джакузи, площадкой для паддла, детским парком, зелеными зонами.\r\nЖильё по самому высокому уровню, обеспеченные домашним электронным управлением, ванными и душами с гидромассажем, отделкой высокого качества, … Все продумано до последней детали.\r\n\r\nКомплекс «OASIS GOLF» в Виямартин (Ориуэла Коста) http://www.costaiberia.ru/ru/property/10/\r\nЦЕНА: 136.000 €\r\n    Новое жильё\r\n    СПАЛЬНИ: 3\r\n    Ванные: 2\r\n    Общая площадь: 97,41 M²\r\n    Участок: 83,25 M²\r\n    Расстояние до моря: 3700 m.\r\n    Расстояние от коммерческого района: 1500 m.\r\n    Бытовая техника\r\n    Кондиционер\r\n    Балкон\r\n    Солярий\r\n    Сад\r\n    Частный бассейн\r\n    Вид на море\r\nКомплекс Oasis Golf расположен на побережье Коста Бланка. Есть рай, созданный для вас, с потрясающим видом на море. Квартиры самого высокого качества, доступности и удобства, как для гольфа в Villamartin и розничных магазинов. Специальное предложение состоит из 91 домов с 3 спальнями и 2 ванными комнатами построен с комфортом и качеством, общий бассейн и зеленые зоны в Ориуэла Коста всего в 5 минутах от поля для гольфа Villamartin, с легким доступом к пляжу со всеми службами, школами, клиники, супермаркеты и т.д.\r\n\r\nСмежный дом Мурано рядом с гольф поле в стиле Hi-Tech в престижном районе Кампоамор\r\nhttp://www.costaiberia.ru/ru/property/83/\r\nЦЕНА: 129.000 €\r\nНовое жильё\r\nСПАЛЬНИ: 2\r\nВанные: 2\r\nПлощадь: 79.25 M²\r\nОбщая площадь: 90 M²\r\nРасстояние до моря: 3000 m.\r\nРасстояние от коммерческого района: 100 m.\r\nПредустановка системы кондиционирования\r\nТерраса\r\nСолярий\r\nСад\r\nОбщий бассейн\r\nГараж\r\n2-х и 3-х спальные таунхаусы, зал, 2 ванные, сад, частная парковка, солярий,  предустановка системы кондиционирования, высокое качество постройки, рядом с несколькими гольф клубами и коммерческими центрами. Зелёные общие зоны с бассейном. В нескольких минутах от пляжа Кабо Роиг, Ла Зения и Кампоамор, в 25 минутах от аэропорта Мурсии и в 55 минутах от Аликанте.\r\n\r\nС уважением,\r\nЮрга Цветкова.\r\n+34 638 742 501', 0, '1'),
('211d0139-0c99-8228-4214-4fe464d455e1', 'f2cb52de-a595-215c-f8c1-4fe464084f74', '2012-06-20 00:00:00', 'Anna otpravila novye varianty: 682,737,739,740,741.', 0, '1'),
