('31fa679a-9eda-0377-9b2f-4fe4645813f7', '3097f2fa-7c1a-3223-4c14-4fe4640e1351', '2011-07-22 00:00:00', '•	Conoce también Cataluña, y le ha gustado mucho también.\r\n•	Quiere una vivienda en algún lugar cerca de la ciudad de Barcelona. La idea principal es la inversión, y el alquiler de la vivienda.\r\n•	Ha pensado que sería buena idea alquilarla a estudiante, por ello puede estar cerca de la Universidad de Barcelona u otro lugar.\r\n•	Han decidido ir en Octubre a Barcelona. \r\n•	Tienen  el dinero procedente de sus negocios:\r\no	Tiene un negocio de Veterinaria.\r\no	Tiene negocios de alquiler de viviendas.\r\n•	Conoce el mundo inmobiliario, y sabe que para comprar hay que hacerlo despacio, buscando la oportunidad, la opción que seguro siempre aparece, porque alguien necesita vender algo bueno.\r\n•	Tiene una propiedad en Bulgaria, y conoce este mercado de vacaciones, y no lo quiere, porque los alquileres son solo posibles en los dos meses de vacaciones. El quiere alquilar la mayor parte del año, y por ello que sea a estudiantes universitarios en grandes Universidades.\r\n•	Tiene 40.000 €, disponibles para invertir ya, y el resto del precio desearía pagarlos con préstamo.\r\n•	Está en conversaciones con el Ayuntamiento de Moscú, que le va a comprar un edificio y por este va a recibir 2 millones de euros, que desea invertir.\r\no	Pide que preparemos un proyecto para invertir este dinero, cuando lo reciba.\r\no	Si sucede sucederá en un año, es decir, para la primavera de 2012. \r\n \r\n•	Hemos hablado que quizás haya otras Universidades, como Alicante, en el que sea interesante invertir.\r\n•	Desconfía de Moscú y de Rusia, y quiere invertir fuera del País para asegurar el futuro de la familia.\r\n', 0, '1'),
