('38718b9a-727c-5c19-f879-4fe464a85e51', '282d5dc4-26aa-84de-e28c-4fe4647f3789', '2011-11-09 00:00:00', 'Пришлите,пожалуйста, варианты новых квартир для Жени.Буду очень ждать!\r\n\r\n"Евгения,здравствуйте!\r\nя посмотрела все варианты,которые вы выслали СЕГОДНЯ.честно,ничего не привлекло внимание.если будут еще варианты,пожалуйста,скидывайте!уточню свой запрос,меня интересует первичный рынок,квартиры с 1 спальней цена 50 000-80 000.если вы предлагаете также вторичное жилье,интересуют дома от 2000 года постройки.Совсем старые дома,как в сегодняшних предложениях и квартиры,требующие ремонта-не рассматриваются.также могу рассмотреть варианты и в др.городах не только в Торревьехе. заранее спасибо!"\r\n\r\n\r\n', 0, '1'),
('38bccde3-b31f-6302-a515-4fe464697a64', '282d5dc4-26aa-84de-e28c-4fe4647f3789', '2011-12-02 00:00:00', 'Евгения имела в виду, что хочет квартиру на  первичном рынке с 1 спальней цена 50 000-80 000. А уж если отправлять ей  вторичное жилье, то только квартиры в домах  от 2000 года постройки!\r\nГоворит, что найти билеты и поехать не сложно,хочет получить какие то варианты,которые её зацепят и заинтересуют.\r\nЯ ей объясняю, что во-первых ,рынок очень "живой",какие то варианты,которые ей понравятся, могут быть проданы к моменту её приезда,а какие то появятся, во -вторых, что вариантов на самом деле больше, чем на сайтах и в базах, и к моменту приезда мы подбираем еще больше для просмотра.', 0, '1'),
