('3ace0aba-7900-d3ae-b27c-4fe464386c4b', '28960a20-d3bc-1166-98f5-4fe464d707b5', '2011-08-22 00:00:00', 'Дочка Александра Петрушевского живет в Барселоне,сейчас она где-то отдыхает и вернется 5 сентября. Она может рассмотреть наши варианты недвижимости.Их интересует двуспальная квартира ,центр,200 тыс. евро. Александр сегодня или завтра собирается придти к нам в офис. \r\nСкажите, пожалуйста, чьи контактные данные по Барселоне можно дать Александру? У меня есть только телефон Рикардо,но Ольга говорила, что он по Бланесу больше.\r\n\r\n', 0, '1'),
('3ace52d2-ddc1-1676-40e0-4fe4649c96f0', '282d5dc4-26aa-84de-e28c-4fe4647f3789', '2012-06-19 00:00:00', 'Все также пока не известно, родители пока в раздумьях, ехать не думают в ближайшее время, но с евгенией на связи.', 0, '1'),
('3b400ebd-7c66-144e-574b-4fe464808a6f', 'f2bab7d6-38c6-8632-3d4f-4fe4641c656a', '2012-06-15 00:00:00', 'Пока Анатолий хочет накопить денег. АВ говорит, что будет покупать на Бланке, на Барсу денег нет.\r\nНадо продолжать общаться с Анатолием, присылать ему варианты  по Коста Бланка.', 0, '1'),
('3bf73ebb-948d-90db-a1fd-4fe464717b53', '3b1b11cc-d8b6-f6b4-5e8b-4fe4642b9e9b', '2011-11-15 00:00:00', 'Инна созванивалась с Анатолием, отправила ему виллы на первой линии.', 0, '1'),
('3c4312a2-ca4e-dc14-e88c-4fe464859e96', '3b1b11cc-d8b6-f6b4-5e8b-4fe4642b9e9b', '2011-11-17 00:00:00', 'Анатолий в Москве, будет на неделе с 21 ноября.', 0, '1'),
('3c56f9ea-a5ac-8be6-05a8-4fe46483451f', '3b25fca2-62d7-842c-aee5-4fe464037fce', '2011-07-25 00:00:00', 'АННА Отправила: 325,7,426,287,225,216,118,24,224,139,390,6,103,387,399,197,49,466,253,294,206,425,198,280,292,162,220,288,221,12,392,197,169,386,219,68,182. Анна ', 0, '1'),
('3c87b315-cc10-5a1d-f5ba-4fe464187246', '3b1b11cc-d8b6-f6b4-5e8b-4fe4642b9e9b', '2011-12-09 00:00:00', 'Отправила запрос Анатолия новым партнерам по Коста Браве.\r\nАнатолий ждет новых предложений,общается как всегда хорошо, пока рассматривают варианты, жене они нравятся, но понимают, что надо смотреть на месте,скорее всего это будет весна.\r\nСейчас уезжают на рождество в Германию, потом на лыжах кататься.\r\nМожет,все-таки зайдет как-нибудь в офис, если получится, зазываю его еще с выставки.', 0, '1'),
('3cc3191f-f754-acd5-a7e8-4fe464480ee4', '3b25fca2-62d7-842c-aee5-4fe464037fce', '2011-11-09 00:00:00', 'АННА: ПОЛУЧИЛА ПИСЬМО ОТ МИХАИЛА: \r\nДобрый день Анна.Я был в Вашем офисе летом.Мне интересны апартменты  в Playa Flamenca (Ориуэла Коста - Коста Бланка).Хотелось бы знать,есть ли они в наличии, и если есть,возможно ли взять их в ипотеку,предварительно оплатив 30% от стоимости ?Если это возможно,то как оплатить их?Я готов приехать в декабре.Спасибо.Михаил.\r\nОТВЕТИЛА МИХАИЛУ ПРО ИПОТЕКУ И ПРО ОБЪЕКТ. НА СВЯЗИ. ', 0, '1'),
('3cd6c2f5-8db4-b344-e2f4-4fe464be9da9', '3b1b11cc-d8b6-f6b4-5e8b-4fe4642b9e9b', '2011-12-13 00:00:00', 'Отправила Анатолию несколько вариантов от Варвары.\r\nОна обещала прислать еще.', 0, '1'),
('3d1dd9c4-41bc-036f-ef49-4fe464adc65d', '3b1b11cc-d8b6-f6b4-5e8b-4fe4642b9e9b', '2011-12-15 00:00:00', 'Уважаемый Анатолий!\r\nМеня зовут Юрга, я являюсь сотрудником компании Costaiberia. До этого Вы уже общались с моими коллегами Евгенией и Инной. Нам в продажу только что поступил дом, который думаю мог бы Вас заинтересовать. \r\nОписание:\r\nДом находится в городе  Ситжез, который  является модным курортом на восточном побережье Испании. Город расположен в Каталонии, в самом развитом регионе страны и является популярным, престижным местом отдыха и проживания не только каталонцев, испанцев, но и иностранцев из всех развитых стран мира ( англичане, голландцы,  итальянцы, немцы,французы т.д.).  Ситжес расположен в  в 35 км от Барселоны, 20 км от аэропорта. \r\nДом в хорошем состоянии, находится на первой линии моря, в 2-х минутах ходьбы до пляжа. Не смотря на приближенное расположение порта с ресторанами, диско клубами, барами, зона очень тихая и спокойная (лишь пение соловьев может разбудить ранним утром). Через 15 минут прогулки по побережью мы приближаемся к историческому центру города, дорога которого вымощена белым камнем, вдоль нее посажены  экзотические деревья и цветы. Недалеко от дома расположены супермаркеты, детские сады, школы, спорт центры (футбольный клуб, клуб теннис,  клуб верховой езды,  тренажерные залы, бассейны, гольф-поле), так же школа  по обучению танцам, музыке, игре на различных муз. инструментах, театр , т.д.   Дом находится в ухоженной, модернизированной  привилегированной зоне для проживания. Дом имеет 2 этажа, 2 зала, камин , 3 спальни, 1  просторную кухню, 2 ванных комнаты,3 террасы, 2 выхода: главный и   второстепенный  выходящий  на бассейн и пляж,1 гараж с подвалом.\r\nСтоимость дома:  860.000 €\r\n\r\nНадеюсь Вам понравиться, в ожидании Ваших комментариев.\r\nС уважением, Юрга Цветкова.\r\n', 0, '1'),
('3d2ad6c8-26f6-e194-748f-4fe464c5e22d', '3b25fca2-62d7-842c-aee5-4fe464037fce', '2011-11-10 00:00:00', 'АННА: \r\nНаписала письмо объясняя, какие док-ты нужны на ипотеку. \r\nСозванилась и разговаривали по скайпу. Думает о ВНЖ. Нужно сделать визу, собирается приехать в декабре. ', 0, '1'),
('3d8c32f9-5d96-1b2d-e7be-4fe46475b6c2', '3b1b11cc-d8b6-f6b4-5e8b-4fe4642b9e9b', '2011-12-15 00:00:00', 'Женя: я отправила Анатолию виллу в копию, поставила тебя. Сделай себе презентацию этого дома, чтобы предлогать другим VIP клиентам.', 0, '1'),
('3d9e0c22-3cd5-85d3-364a-4fe46453df2a', '3b25fca2-62d7-842c-aee5-4fe464037fce', '2011-11-11 00:00:00', 'Михаил будет делать визу в Москве или нужно ему позвонить и предложить нашу помощь?', 0, '1'),
('3dff40ea-0453-268d-6619-4fe464387a3a', '3b25fca2-62d7-842c-aee5-4fe464037fce', '2011-11-15 00:00:00', 'Михаил полетит 17-24 декабря, жить будет в гостинице в Торревьехе, он точно не помнил названия. Не знает пока про встречу в аэропорту, может, надо будет его встретить, а, может, возьмет машину. Визу ему на этой неделе сделают в Москве.\r\nЯ его попросила Ане на почту скинуть инфо по рейсу. ', 0, '1'),
('3e01350b-2458-ca59-7bc2-4fe46407f999', '3b1b11cc-d8b6-f6b4-5e8b-4fe4642b9e9b', '2011-12-16 00:00:00', 'Добрый вечер Юрга.\r\nПолучил от Вас очень интересное предложение.\r\nБольшое спасибо за желание помочь нам в выборе недвижимости.\r\nК сожелению при передачи информации произошла ошибка и я не могу посмотреть фотографии.\r\nПрошу повторно послать фотографии, причём не все сразу, а по одной.\r\nЖелаю удачи и ещё раз большое спасибо.\r\nАнатолий.\r\n', 0, '1'),
('3e3c06dc-8f8b-1ca7-ee64-4fe46466700a', '28fd0c04-1b94-31fc-52cb-4fe464152d04', '2011-11-10 00:00:00', 'АННА ОТПРАВИЛА: 26,531,545,547,548.', 0, '1'),
('3e52ab45-fb1f-217e-7423-4fe4641d36ad', '3b1b11cc-d8b6-f6b4-5e8b-4fe4642b9e9b', '2011-12-19 00:00:00', 'Добрый вечер Юрга!\r\nПосмотрел фотографии, которые Вы прислали повторно по одной.\r\nДля нас это слишком скромно. На каком побережье Испании находится\r\nэтот городок? Нас интересуют виллы на Майорке и как исключение Косто Браво.\r\nЖелаю удачи.\r\nАнатолий.\r\n', 0, '1'),
('3e5e8b13-2dbc-0b2f-9f75-4fe4640ad564', '3b25fca2-62d7-842c-aee5-4fe464037fce', '2011-11-21 00:00:00', 'Здравствуйте, уважаемый Михаил!\r\n\r\nЭто Евгения из Петербурга ( коллега Ани Дерюшевой из Испании). Мы с Вами общались на прошлой неделе.\r\nХочу попросить Вас отправить Анне информацию по Вашему рейсу в Испанию .\r\n', 0, '1'),
('3ea50bc7-c3a7-c556-45d6-4fe4643430fb', '3b1b11cc-d8b6-f6b4-5e8b-4fe4642b9e9b', '2011-12-27 00:00:00', '"Евгения!\r\nБольшое спасибо за интересные предложения и высокий профессионализм с которым они поданы. Мы с удовольствием их изучим, но на выходные улетаю в Вену, а потом\r\nво Францию.Жду от Вас новых вариантов. Особенно впечатляет второй вариант.\r\nЖелаю Вам весело встретить Новый год и Рождество.\r\nАнатолий." \r\n', 0, '1'),
('3ef4191d-20b1-8164-8b35-4fe4643bb1fe', '3b1b11cc-d8b6-f6b4-5e8b-4fe4642b9e9b', '2012-02-02 00:00:00', 'Может быть, есть варианты по Майорке для Анатолия?', 0, '1'),
('3f097699-6768-692e-b854-4fe4641bb144', '3e3d816c-d06b-3812-db20-4fe464be0f2c', '2012-05-12 00:00:00', 'Наконец удалось дозвониться, очень давно телефон был не доступен.\r\nСейчас не до покупки недвижимости. Сказала, что есть какие то другие проблемы по жизни.', 0, '1'),
('3f45893a-f6b4-e229-64ae-4fe464fe544d', '3b1b11cc-d8b6-f6b4-5e8b-4fe4642b9e9b', '2012-02-09 00:00:00', 'Дозвонилась-он в Альпах, на лыжах катается, приедет и созвонимся.', 0, '1'),
('402810c1-46c9-3880-a75e-4fe464982b6d', '3ee31774-d626-fe1a-7a1c-4fe464e971e0', '2011-07-15 00:00:00', 'reunión en el despacho, revisión de correspondencia del banco. Se le acompaña al banco. Queda pendiente cerrar las cuentas en Caja Murcia. ', 0, '1'),
