INSERT INTO `cosib_messages_answers` (`id`, `id_m`, `date_entered`, `description`, `deleted`, `assigned_user_id`) VALUES
('408c45ed-541a-7dd5-c66f-4fe4649658d9', '3f9c6b40-4d4a-a0b3-97c2-4fe46481576c', '2011-11-08 00:00:00', 'Варианты не  заинтересовали,отправила новые,бюджет 250 тыс., поедет наверно весной,ответ Ани про переоформление ВНЖ не устроил, надо больше конкретики и алгоритм действий. ', 0, '1'),
('408db811-fdb8-5d5a-6d55-4fe464ac4a53', '3ee31774-d626-fe1a-7a1c-4fe464e971e0', '2011-10-21 00:00:00', ' Добрый день Ирина, \r\nВ очередной раз после разговоров с банком, они мне сказали, что Ваша интернет-карточка уже активирована, Вы должны заходить на сайт с номером пользователя Вашего нового пасспорта, который начинается с 64N.....и обязательно вводите букву N! PIN остается тем же самым, который Вам выдали на руки. Сегодня на электронный адрес Вашего супруга Романа банк лично вышлет движения по счету.  В банке мне сообщили, что на Вашем счету 4.000 евро, подробные движения, повторяю сегодня будут в Вашем электронном ящике. \r\nЕсли у Вас возникнут какие- либо вопросы,  пришлите, я переведу с испанского на русский язык движения по счету. \r\nС уважением,Aнна Дерюшева.  \r\n\r\nДобрый день,Анна. Карта активна , все работает.Спасибо. С Ув. Ирина. 21 октября 2011', 0, '1'),
('40a680c8-3aab-25ea-e116-4fe464b7fb8c', '3f623617-8584-efd7-39f5-4fe464ac8721', '2012-06-06 00:00:00', 'Пока возможные даты поездки не известны.', 0, '1'),
('40d0d18f-c70f-4fb1-4c17-4fe464b357d2', '3f9c6b40-4d4a-a0b3-97c2-4fe46481576c', '2011-11-09 00:00:00', 'Евгения,добрый день \r\nСпасибо за информацию, таунхаусы на три спальни Нравятся, апартаменты нет.\r\nОчень важно окружение(природа) наличие зелени,виды. Хорошо бы к каждому варианту\r\nфото окружения. Так же интересны отдельные домики в урбанизации,\r\nЗаранее благодарю, \r\n\r\nBest regards, Semen Titov\r\n', 0, '1'),
('40e4762d-842d-3c50-5fb0-4fe4641af8e6', '3f623617-8584-efd7-39f5-4fe464ac8721', '2012-06-13 00:00:00', 'Ситуация поменялась- летом не едет. Может, будет рассматривать другую страну, но на связи, может быть, осенью решит вернуться к испании.', 0, '1'),
('4128fc66-ef51-186c-6d6f-4fe464967eaf', '3f9c6b40-4d4a-a0b3-97c2-4fe46481576c', '2011-11-16 00:00:00', 'Анна отправила: 5,10,14,16,17,25,31,38,45,50,66,83,92,97,119,138,156,201,213,253,254,257,269,311,317,318,336,337,340,342,344,401,402,411,423,424,495,498,507,526,535,539,548,552.', 0, '1'),
