('41aa0c3f-9cfe-62c4-d2ee-4fe464f5893a', '28960a20-d3bc-1166-98f5-4fe464d707b5', '2011-09-20 00:00:00', 'Александру Сергеевичу отправлена презентация по объектам недвижимости в Барселоне, которые мне присылала Анна.', 0, '1'),
('41e763c5-c50d-8a5c-1982-4fe464ed3d99', '3f9c6b40-4d4a-a0b3-97c2-4fe46481576c', '2011-12-06 00:00:00', 'Отправила Семену фото окружения некоторых объектов, он ответил:\r\n\r\nЕвгения,спасибо за информацию.\r\nМы ее осмыслим и свяжемся с Вами\r\n\r\nBest regards, Semen Titov\r\n', 0, '1'),
