('44eb0775-fcc0-209a-f281-4fe464a2e6ed', '43dae65a-eb78-8750-cbed-4fe46448d4d4', '2011-12-06 00:00:00', 'А когда получится прислать варианты транспассо для Владимира?\r\nОн ждет и изначально говорил о поездке в январе. Пришлите, пожалуйста, варианты для него.\r\n', 0, '1'),
('4533f09f-e28c-cd0e-2872-4fe46443406e', '43dae65a-eb78-8750-cbed-4fe46448d4d4', '2011-12-12 00:00:00', 'Мне сегодня уже сам позвонил Владимир (vio-58@mail.ru),  которого интересует транспассо (бар, ресторанчик)\r\n\r\nОн 2 января с женой летит в Барселону, а потом на машине примерно 4 января выезжает на Коста Бланку, пробудет в Испании до 9 января.\r\nКогда можно будет получить инфо по ресторану Зюзиных?\r\nМы сможем Владимиру еще что то показать кроме этого ресторана, еще какие- то варианты???\r\nОн ждет от меня известий!\r\n\r\nТакже его интересует ВНЖ, Аня Бабошкина должна с ним связаться по этому вопросу.\r\n', 0, '1'),
