('457ebbf6-8c89-cfc6-4cc2-4fe46403a538', '43dae65a-eb78-8750-cbed-4fe46448d4d4', '2011-12-13 00:00:00', 'Аня Бабошкина: Жень, я звонила,  он в шиномонтаже, он пришлет тебе почту в гмэйле и я с ним свяжусь. дело в том что на мэйл.ру не всегда письма джоходят. поэтому свяжусь с ним по гмэйлу и установлю контакт.', 0, '1'),
