('45caedb9-7d9d-2f29-1ef3-4fe464a50a6e', '43dae65a-eb78-8750-cbed-4fe46448d4d4', '2011-12-15 00:00:00', 'Думаю, что Владимир настроен серьезно, будет смотреть, надо ему подготовить для просмотра возможные варианты.\r\nПриедет на Бланку 4 января. Жить будет у себя в Плайя Фламенка.\r\nЕдинственное, он уедет обратно не 9 января, а 8 января!\r\nВы ему еще со своей стороны тоже позвоните потом.\r\n', 0, '1'),
('46228148-a143-4123-6581-4fe464ec1e01', '43dae65a-eb78-8750-cbed-4fe46448d4d4', '2011-12-16 00:00:00', 'Сейчас звонил Владимир, он хочет знать следующую информацию:\r\n-площадь помещения\r\n-размер арендной ставки\r\n-размер транспасо\r\n-расположение, что за населенный пункт ( Эльче, видимо, ему не очень подошел)\r\n', 0, '1'),
('46b158be-734d-c148-5d37-4fe464636fe9', '43dae65a-eb78-8750-cbed-4fe46448d4d4', '2012-01-20 00:00:00', 'Сейчас звонил Владимир по траспасо, сказал, что график был напряженный, поэтому не удалось с нами встретиться. Теперь он планирует приехать в мае.\r\nОн просил прислать варианты, я ему ничего не обещала, сказала, что все зависит от его намерений, мне надо с коллегами поговорить.', 0, '1'),
