('4811097d-e913-a764-f9c1-4fe464351484', '28960a20-d3bc-1166-98f5-4fe464d707b5', '2011-09-26 00:00:00', 'Письмо дочери Петрушевского-Аллы:\r\n"Здравствуйте,Евгения! Большое спасибо вам за информацию,видела,что квартиры новые,красивые.Вариант 8,где находится? Мы находимся в поиске по районам- Сан-Жерваси,Экшампл эскверда,Лес-Кортс,Сан-Галвани,может у вас что- то найдется. Хотелось бы посмотреть предложенные вами варианты 1,2,5,6. Вариант 7 в каком районе находится? Спасибо."\r\nПочта Аллы: allouchon@yandex.ru, телефон +34932009574\r\nБуду ждать контактные данные партнеров по Барселоне.\r\n', 0, '1'),
