('495f9e3c-2aac-f1c2-0f08-4fe464207721', '489b13fb-e5f6-9078-60db-4fe46465ee52', '2012-06-07 00:00:00', 'Анжелика думает поехать в сентябре на 10 дней.\r\nМожно прислать ей варианты аренды на время просмотров.Их будет от 2 до 5 человек.\r\nСкажите, пожалуйста, какие варианты примерно мы можем ей предложить?\r\nОна говорит, что если среди них будет ребенок, то поедут в начале сентября, а если нет, то можно и в конце. ', 0, '1'),
