('49e6c91d-90c2-da30-7043-4fe464bbd669', '489b13fb-e5f6-9078-60db-4fe46465ee52', '2012-06-20 00:00:00', 'Cозвонимся в середине июля!\r\n (у нее и мужа паспорта с визой есть, а родные еще только делают паспорта/ паспорта должны быть готовы по её словам в конце июля, но лучше позвонить заранее).\r\n понравился лот 68 для проживания. отправила  для аренды на время просмотров двуспальные, см базу.  Анжелика думает поехать в сентябре на 10 дней.\r\nИх будет от 2 до 5 человек.\r\nОна говорит, что если среди них будет ребенок, то поедут в начале сентября, а если нет, то можно и в конце.Также если она поедет вдвоем с мужем, то попросить наших  испанцев сделать стоимость проживания не 50, а 40 евро в день. Если же впятером поедут, то 50 евро в день нормально.', 0, '1'),
('4aa5aa2b-24e3-3681-5ead-4fe464a19399', '495e6f82-e771-4fb4-fe0a-4fe464fef442', '2011-08-03 00:00:00', 'Здравствуйте юрга,мы прилетаем в аликанте 2 октября машину и отель в торревьехе заказали ,меня беспокоит вопрос :можно ограничиться сначала суммой для залога и перечислить первый взнос из дома  и можно ли рассчитываться картой\r\nС уважением елена\r\nисходное сбщ\r\n\r\nЕлена, \r\n\r\nДумаю, что машина Вам не понадобиться, по крайней мере пока будем просматривать недвижимость, так как я Вас буду возить на автомобиле компании. Да, с карточкой Вы можете рассчитываться, даже заплатить залог. А сумму на первоначальный взнос сможете перечислить из России, после того как вернётесь из Испании. \r\nЕлена, так как Вы серьёзно настроены на покупку, советую Вам привезти из России все нужные документы для получения ипотечного кредита, так ускорим процесс оформления:\r\n1. Справка о доходах с места работы.\r\n2. Справка НДФЛ за 2011 год.\r\n3. Копия свидетельство о недвижимости.\r\n4. Кредитная история. По адресу:\r\nУл.Б. Никитская, д.24/1, стр.5\r\n125009-Москва\r\nТелефон: + 7(495) 221-7837\r\nЭл.почта: support@nbki.ru\r\n\r\nС уважением,', 0, '1'),
