('4b0793d8-18e0-3a71-8f2b-4fe4643b6228', '495e6f82-e771-4fb4-fe0a-4fe464fef442', '2011-09-26 00:00:00', 'Добрый день, Елена!\r\n\r\nКак у Вас дела? Надеюсь Ваши планы о поездке не изменились ? Если все остается в силе, то нам нужно определиться с Вашим проживанием...предпочитаете квартиру или гостиницу? \r\nА также, прошу написать мне номер рейса, которым Вы прилетите, что бы встретить Вас в аэропорту. И на всякий случай номер Вашего телефона.\r\n\r\nМой номер +34 638 742 501\r\n\r\nС уважением,', 0, '1'),
