('4b641be7-bd5b-f828-f8d6-4fe4641bdbb1', '495e6f82-e771-4fb4-fe0a-4fe464fef442', '2011-09-30 00:00:00', 'Добрый день, Юрга! мы приезжаем 2 октября, все гостиницы забронированы, с жильем\r\nпроблем нет, транспорт заказали. Что касается встречи. Я готова встретиться с Вами 6\r\nоктября. Честно говоря, уже нет большого желания приобретать квартиру в свете\r\nпоследних событий с евро в нашей стране. У нас на руках будет 23 тыс евро. Что можно\r\nприобрести с этой суммой?\r\n\r\nС уважением, Елена.\r\n\r\n\r\n29 сентября 2011, 16:27 от "Jurga Cvetkova" <jurga@nbagroup.es>:\r\n', 0, '1'),
('4bb15551-dd39-5e90-772d-4fe464323aa4', '495e6f82-e771-4fb4-fe0a-4fe464fef442', '2011-09-30 00:00:00', 'Добрый день, Юрга! 6-го числа мы будем в отеле Мангалан в Ла Манге. мой номер\r\nтелефона +79097100246\r\n\r\nС уважением, Елена.\r\n\r\n\r\n30 сентября 2011, 15:30 от "Jurga Cvetkova" <jurga@nbagroup.es>:\r\n \r\nДобрый день, Елена!\r\n \r\nОчень рада получить Ваше письмо. \r\nХочу Вас успокоить, что с 23.000 можно купить недвижимость примерной стоимостью до\r\n100.000 евро.\r\nКогда приедете, я Вам объясню реальные возможности, посмотрим недвижимость и если\r\nчто- то Вам понравиться примите решение. У нас есть ряд специальных предложений со\r\nскидками и удобной формой оплаты.\r\nШестого числа я буду готова к встрече с Вами. Но мне хотелось бы заранее с Вами\r\nсозвониться и обсудить детали нашей встречи. Так как пока что я не знаю не место\r\nВашего проживания, ни номера телефона, будьте добры сообщите мне Ваши координаты.\r\n \r\nМой номер телефона +34 638 742 501\r\nАдрес офиса компании Costaiberia в Торревьехе: Calle Orihuela, Nº 102, здание NBA.\r\n \r\nС уважением,\r\n \r\nJurga Cvetkova\r\nDpto. Venta \r\n', 0, '1'),
('4c227a9f-2268-2da0-ba5d-4fe464f42cdd', '4b4d72e6-c442-d94d-f1e1-4fe464f11d3e', '2012-06-07 00:00:00', 'У Михаила пока не получается поехать в июне, он говорит, что продает квартиру здесь, поэтому зависит от его сделки в России.', 0, '1'),
('4cb6181c-a234-e3d4-8277-4fe4646bf537', '4b886ee7-487d-85ab-27ce-4fe464aff959', '2011-11-07 00:00:00', 'У Виталия не получится подъехать на встречу в офис на неделе с 7 ноября, созваниваемся по поводу встречи после возвращения Андрея Владимировича из Испании.', 0, '1'),
('4cfb885d-d654-5afc-4f31-4fe464098183', '4b886ee7-487d-85ab-27ce-4fe464aff959', '2011-12-05 00:00:00', 'Еще в конце ноября договорились о встрече в офисе, но у Виталия не получилось прийти. Сегодня с ним говорили-до конца года у него точно не получится вырваться по работе, много дел в конце года. \r\nНо он нормально настроен на сотрудничество, будем на связи.\r\nЕхать думает весной,говорит, может жену отправит, может сам поедет.\r\nПришлите,пожалуйста, варианты для него.\r\nВо время новогодних праздников будет время спокойно рассмотреть варианты, можно ему периодически их присылать.', 0, '1'),
