('4f2ffa28-cffb-6efa-ba6c-4fe464ad4077', '4e2ab833-96d3-7c17-b366-4fe4640b4a2f', '2011-08-24 00:00:00', '                  Добрый день!\r\n\r\nКлиентка Светлана Сулимова (которая пришла к нам делать визу и заинтересовалась недвижимостью) полетит в Барселону 2 сентября на десять дней.\r\nОна согласна рассмотреть наши варианты недвижимости на Коста Брава.\r\nВообще идея приобретения возникла у Светланы,  когда она просматривала наш каталог. Пока она четко не представляет цель покупки, рассматривает для сдачи в аренду и на будущее, возможно, для себя.\r\nСветлана могла бы рассматривать дуплекс в каком- нибудь новом комплексе или квартиру в Барселоне или пригороде, можно вторичное жилье. Хорошо, если это будет по возможности близко к морю, но она рассматривает и в горах с видом на море.\r\nБюджет: Светлане все-таки  желательно 200тыс. евро; максимальный предел 300 тыс. Хочет без кредита.\r\nКонтактные данные Светланы: +79219078171, svetohka@live.ru\r\nПришлите, пожалуйста, контактные данные партнеров по Коста Брава, чьи телефоны можно передать Светлане для связи.\r\n', 0, '1'),
