('4f8e1535-6da6-48ef-b168-4fe4642e6f32', '4e525b4f-6c57-ab9c-7261-4fe464dc093a', '2011-11-07 00:00:00', ' \r\n\r\nЕвгения,\r\n\r\nКвартира в Торревьехе:\r\nEDIFICIO ARTEMISA\r\n2 спальни, 1 ванная комната, зал, кухня, большой балкон с видом на парк, общая площадь 68 M2, с мебелью, есть общий бассейн. Рядом с инфраструктурой, до пляжа 900 метров. \r\nЦена: 72.000 €\r\n\r\nС уважением,\r\n', 0, '1'),
('4fd1133c-dcdb-988f-8e9e-4fe464443907', '4e525b4f-6c57-ab9c-7261-4fe464dc093a', '2011-11-09 00:00:00', '"Добрый день, Евгения!\r\nПервый вариант с 2 спальнями заинтересовал.( Квартира в Торревьехе:\r\nEDIFICIO ARTEMISA\r\n2 спальни, 1 ванная комната, зал, кухня, большой балкон с видом на парк, общая площадь 68 M2, с мебелью, есть общий бассейн. Рядом с инфраструктурой, до пляжа 900 метров. \r\nЦена: 72.000 €)\r\nМожно будет его как-то посмотреть с 1 по 3 декабря? Мы как раз планируем быть в Торревьехе.Второй вариант хорош,но нам маловат, т.к. у нас 2 ребенка еще. Нам нужны 2 спальни+гостиная.Если будут еще варианты по нашим параметрам, высылайте. Заранее благодарна,с уважением,Лена."\r\n\r\nЕсли будут появляться подобные варианты, пришлите, пожалуйста!!\r\nОна готова с нами посмотреть, летит вдвоем с мужем, без детей. Она будет в Торревьехе 1-3 декабря.\r\n27 ноября они улетают в Барселону.\r\n', 0, '1'),
('4fd42bd6-0ce6-6dff-1756-4fe4646bfeff', '4e2ab833-96d3-7c17-b366-4fe4640b4a2f', '2011-09-05 00:00:00', 'Скажите,пожалуйста,возможно Вы в курсе, созванивались ли партнеры по Барселоне со Светланой Сулимовой?', 0, '1'),
('501bd467-fec1-60a7-a44f-4fe464cac723', '4e2ab833-96d3-7c17-b366-4fe4640b4a2f', '2011-09-05 00:00:00', 'Jurga:\r\nLos coloboradores de Barcelona (Inna) a llamado a Sra.Svetlana el sabado día 3, pero la clienta se mostro muy rabiosa y le dijo, que no tiene ganas de ver nada propiedades. \r\nLunes día 5, a la cliente llamo Anna para averiguar que lo que paso. Resulta que la clienta está interesada en ver propiedades, pero martes y miercoles ya las va ver con una agencia tercera. Anna interá organizar la sita entre Inna y clienta para el jueves día 8 de septiembre.', 0, '1'),
('501ddd5f-e761-e82d-50e7-4fe4646be254', '4e525b4f-6c57-ab9c-7261-4fe464dc093a', '2011-11-23 00:00:00', 'Елена приедет на машине из Барселоны в Аликанте вечером 28 ноября, готова утром 29ого начинать просмотры.\r\nC 28 ноября по 1 декабря будет жить в Аликанте, затем 1 декабря едет жить в Торревьеху до 3 декабря.\r\nСмотреть хочет юг Коста Бланки и Аликанте, говорит, что лимит по бюджету 60 тыс евро.\r\nТелефон для связи по смс российский, который указан в базе, но она купит и испанскую симку.\r\nМожно с ней если что связываться по смс начиная с 27ого.', 0, '1'),
('50624e58-b4f0-b444-8c49-4fe464753f69', '4e525b4f-6c57-ab9c-7261-4fe464dc093a', '2011-11-24 00:00:00', 'Анна: созванилась с Еленой, она сказала, что на эл. почту сбросит название отеля в Аликанте. Договорились о начале просмотра на 29 число. ', 0, '1'),
('50657f0d-fef5-3d6b-1aa5-4fe4645e485d', '4e2ab833-96d3-7c17-b366-4fe4640b4a2f', '2011-09-07 00:00:00', 'После нескольних разговоров наших партнеров в БСН со Светланой, выяснилось, что Светлана вообще и не думает о недвижимости, это ее друг - француз смотрит недвижимость с разными агенствами, а она его сопроваждает. Лично она не думает о покупке недвижимости. ', 0, '1'),
('50a0f885-e8bd-b00f-1d79-4fe464e4e036', '4e525b4f-6c57-ab9c-7261-4fe464dc093a', '2011-12-05 00:00:00', 'Ездили, но не купили. \r\nЕлена сказал, что только присматривались к зоне, к побережью, смотрели и с кем то другим тоже.', 0, '1'),
('51259e38-1cc4-06b4-439b-4fe464ca9162', '4e525b4f-6c57-ab9c-7261-4fe464dc093a', '2011-12-09 00:00:00', '15 декабря созваниваемся с Антоном ,мужем Елены, договариваемся о встрече в офисе по поводу ВНЖ.', 0, '1'),
('5161d694-3d8f-88b3-cbab-4fe4642b8c40', '4e525b4f-6c57-ab9c-7261-4fe464dc093a', '2011-12-15 00:00:00', 'Созваниваемся с Антоном завтра утром, скорее всего придут в обед на встречу по ВНЖ.', 0, '1'),
('51860c92-9032-0fdf-2189-4fe464f1e695', '28960a20-d3bc-1166-98f5-4fe464d707b5', '2011-10-12 00:00:00', 'Аня,добрый день!\r\nСкажи,пожалуйста, чем в итоге закончились просмотры дочери Аллы в Барселоне?', 0, '1'),
('51a19946-3999-68c5-3a06-4fe464c6dca4', '4e525b4f-6c57-ab9c-7261-4fe464dc093a', '2011-12-16 00:00:00', 'Антон (муж Елены) был на встрече с Андреем Владимировичем.\r\nБуду звонить ему в понедельник.\r\nА.В. сказал, что вроде он собирается еще раз поехать в феврале. \r\n', 0, '1'),
('51e38dc3-48b3-c4e7-d11d-4fe4643b1624', '4e525b4f-6c57-ab9c-7261-4fe464dc093a', '2011-12-19 00:00:00', 'Созвонились с Антоном, он говорил, что планирует поездку в Испанию во второй половине  февраля.\r\nПредложила поискать для него билеты.\r\n ', 0, '1'),
('51ec96c9-5fe9-3bdd-3108-4fe464382c76', '50e97277-cdc6-4a96-19b0-4fe464ec9655', '2012-05-22 00:00:00', 'Было не удобно разговаривать.', 0, '1'),
('5223fc89-5e07-c295-ea63-4fe4645d2737', '4e525b4f-6c57-ab9c-7261-4fe464dc093a', '2011-12-21 00:00:00', 'Отправляла Антону билеты, сегодня созванивались  с ним:\r\nОн сказал, что скоро уезжает кататься на лыжах сначала в Финляндию, потом еще куда-то, вернется 28 января, поэтому сейчас  заранее не знает, какие именно даты поездки в феврале будут ему удобны, и билеты сейчас заранее взять не получится.\r\nОн определится  примерно  в начале января.\r\nГоворит, что хочет поехать недели на две, и уже  решить в эту поездку вопросы с недвижимостью.\r\nЕсли будут появляться новые варианты, присылайте, пожалуйста.\r\n\r\nПо ВНЖ с ним общается Ира Балова.\r\n', 0, '1'),
('52285fa5-65f7-1002-b3e5-4fe46481c805', '50e97277-cdc6-4a96-19b0-4fe464ec9655', '2012-06-15 00:00:00', 'Anna: otpravila novye varianty - Benidorm, La Manga, Villajoyosa.', 0, '1'),
('5264be66-79c8-25a1-8883-4fe4644efb8c', '4e525b4f-6c57-ab9c-7261-4fe464dc093a', '2012-01-23 00:00:00', '"Спасибо, Женя,хороший вариант, по крайней мере, по фотографиям. А какой метраж комнат?\r\nС уважением, Лена."\r\n\r\n\r\n•         2 спальни\r\n•         Индивидуальная кухня\r\n•         Галерея (подсоб.помещение)\r\n•         Ванная комната\r\n•         Двор 15м2 (место для парковки авто)\r\n•         Общий бассейн\r\n•         От моря 1200 км\r\n•         Супермаркет, аптека и др. места обслуживания в пешей доступности.\r\n•         Цена 67.000€\r\n', 0, '1'),
