('52d91cfd-b439-62f7-40af-4fe464204a7f', '51de70b1-8264-3f8e-6f25-4fe4644fa8c4', '2011-09-13 00:00:00', 'Jurga: Enviado oferta de apartamento en Torrevieja. Precio 64.000€. He recibido una llamada telefonica, de Victor pidiendo más informacion: cituacion de la vivienda. Se le envio la situacion en google maps.', 0, '1'),
('52e37281-2f7e-32d4-0ad8-4fe464ad303d', '4e525b4f-6c57-ab9c-7261-4fe464dc093a', '2012-03-22 00:00:00', 'Созвонилась с Еленой и Антоном Кобцовыми:\r\nОни едут в Испанию летом, готовы совместно поработать с нами.\r\nИх едет две семьи:Кобцовы с детьми и их друзья с детьми.\r\nС 10 июня по 19 июня они будут на мар меноре, проживание уже решено.\r\n\r\nА затем нужно проживание, можем предложить им наши варианты(саму Торревьеху не очень хотят, лучше ла мату или пунта приму). \r\nИм нужны варианты проживания рядом друг с другом. 20 июня-1 июля Кобцовы; 20 июня -5 июля -их друзья. Каждой семье нужны апартаменты или бунгало с хорошим балконом или придомовой территорией, 2 спальни, кобцовым до моря можно до 1 км, а друзьям лучше 200-300 метров. Балкон или придомовая территория очень важный момент.\r\nОриентировочно по цене хотели бы уложиться в 300-350 евро за неделю.\r\n\r\n', 0, '1'),
('532c01d3-807f-913b-c359-4fe464b478f6', '4e525b4f-6c57-ab9c-7261-4fe464dc093a', '2012-03-28 00:00:00', 'Добрый день, Евгения, мы с Вами говорили по телефону. Вам что-нибудь попалось для нас в аренду? Напомню, нам с 20 до 30 июня, семье наших друзей 20 июня - 6 июля. Ищем жилье в аренду недалеко друг от друга и от моря. Пляж предпочтительно Ла Мата или Пунта Прима. Спасибо. С уважением. Лена ', 0, '1'),
