('54c1796a-d10b-cde1-85cc-4fe4648503b6', '53c0fc44-d7db-706e-0e5d-4fe4642beadd', '2011-08-27 00:00:00', 'Здравствуйте, Ув. Светлана!\r\nОчень приятно получить от Вас письмо. У нас есть множество предложений по новой недвижимости. Если я не ошибаюсь Вас интересует недвижимость стоимостью от 100.000 до 150.000 евро, 2-3 спальни. Скажите, пожалуйста, какое расстояние доступности к морю является максимальным для Вас, какие еще характеристики жилья важны Вам, и я отправлю Вам наиболее подходящие предложения.\r\nОбъекты, который предоставлены в предыдущем письме находятся в расстоянии от моря:\r\nКомплекс «SUNLAKE II» - 2000м\r\nКомплекс «GUARDAMAR HILLS» - 750м\r\nКомплекс «OASIS GOLF» - 3300 м\r\nКомплекс «EL BARRANCO» - 3400м\r\nС уважением,\r\nЮрга Цветкова.\r\n+34 628 742 501', 0, '1'),
