('5520167f-0797-590d-00d1-4fe4640aa542', '53c0fc44-d7db-706e-0e5d-4fe4642beadd', '2011-08-28 00:00:00', 'Здравствуйте, Юрга.\r\nЯ рассматриваю предложения до 1 км до моря.\r\nПока не сдала еще на права.\r\nНо собираюсь записаться на курсы по вождению в сентябре.\r\nС уважением\r\nСветлана', 0, '1'),
