('560d1110-ef8b-d520-795c-4fe46473d937', 'cc8b21d8-bbff-0931-9f9a-4fe4645ee283', '2011-07-04 00:00:00', 'Планируют поездку в Испанию с конца августа до конца сентября.Обещал на этой неделе сообщить точнее по датам.', 0, '1'),
('561b3458-3109-1d4e-e4b5-4fe464b97947', '53c0fc44-d7db-706e-0e5d-4fe4642beadd', '2011-09-13 00:00:00', '> Уважаемый клиент!\r\n> СРОЧНОЕ ПРЕДЛОЖЕНИЕ!\r\n> Квартира в центре Города Торревьеха, 2 спальни, зал, кухня в американском стиле и балкон. Квартира полностью меблирована, есть кондиционер. Расположена на 2-ом этаже, ориентация на юг.\r\n> Цена всего 64.000€!!!(Резерв только 3000 евро).\r\n> Если Вас заинтересовало это предложение, срочно связывайтесь J.\r\n> С уважением,\r\n> Jurga Cvetkova\r\nСпасибо за предложение, Юрга.\r\nСколько метров до моря от дома? Сколько метров квартира?\r\nСколько лет дому, куда выходят окна (улица, двор)?\r\nС уважением\r\nСветлана\r\n\r\nJurga: Добрый день, Светлана!\r\nОт квартиры до пляжа 950 метров. Все окна выходят на улицу. Дом построен в 1999 году.\r\nС уважением\r\n\r\nSvetlana: 14.09.11 ОЧЕНЬ ШУМНО БУДЕТ\r\n\r\n', 0, '1'),
