('56917e19-f350-abbb-e2be-4fe464467b73', '53c0fc44-d7db-706e-0e5d-4fe4642beadd', '2011-11-07 00:00:00', 'Здравствуйте Ув.Светлана!\r\n\r\nОтправляю Вам предложение, которое соответствует Вашему запросу:\r\nКвартира в Торревьехе. EDIFICIO ARTEMISA.\r\n2 спальни, 1 ванная комната, зал, кухня, большой балкон с видом на парк, общая площадь 68 м², с мебелью, есть общий бассейн. Рядом с инфраструктурой, до пляжа 900 метров. \r\nЦена: 72.000 €\r\n\r\nС уважением,\r\nJurga Cvetkova\r\nDpto. Venta ', 0, '1'),
('56adcf20-8791-6cfd-a066-4fe46444972b', 'cc8b21d8-bbff-0931-9f9a-4fe4645ee283', '2011-09-06 00:00:00', 'Владимир вернулся из поездки в Германию.\r\nИзначально мы обсуждали, что теперь он вместе с женой и сыном поедет в октябре, но ситуация изменилась: сейчас жена и маленький сын Владимира на месяц уехали в Турцию и Владимир говорит, что им(жене и ребенку)  будет тяжело поехать еще и в Испанию, поэтому пока не известно,когда смогут поехать на Коста Бланку.', 0, '1'),
('5703477c-01f6-759f-9f4a-4fe46469e831', '53c0fc44-d7db-706e-0e5d-4fe4642beadd', '2011-11-09 00:00:00', 'Здравствуйте, Юрга.\r\nСпасибо за предложение.\r\nС уважением \r\nСветлана\r\n\r\n07.11.2011, 17:05, "Jurga Cvetkova" <jurga@nbagroup.es>:\r\n> Здравствуйте Ув.Светлана!\r\n>\r\n> Отправляю Вам предложение, которое соответствует Вашему запросу.\r\n>\r\n> Квартира в Торревьехе:\r\n>\r\n> 2 спальни, 1 ванная комната, зал, кухня, большой балкон с видом на парк, общая площадь 68 м², с мебелью, есть общий бассейн. Рядом с инфраструктурой, до пляжа 900 метров.\r\n>\r\n> Цена: 72.000 €\r\n>\r\n> С уважением,\r\n>\r\n> Jurga Cvetkova\r\n> Dpto. Venta\r\n', 0, '1'),
('570ce319-80b1-722d-105d-4fe46496fb15', '564129b1-6c6c-f5ae-0747-4fe4647e75cc', '2012-06-04 00:00:00', 'Отправила ему пару вариантов участков по Валенсии, которые прислал Марио. \r\nЖду еще варианты, Марио обещал прислать.\r\n\r\n', 0, '1'),
('574fe7e8-e5cd-d87c-4e5f-4fe4644deb56', '564129b1-6c6c-f5ae-0747-4fe4647e75cc', '2012-06-19 00:00:00', 'Алексей сейчас в больнице, свяжемся на следующей неделе.\r\nЧто-то из отправленного понравилось. ', 0, '1'),
('576a013f-eb3c-36c3-274d-4fe46419f7a5', '28960a20-d3bc-1166-98f5-4fe464d707b5', '2011-11-15 00:00:00', 'Мне звонила Алла (дочь Петрушевского). Сказала, что сейчас занимается оформлением недвижимости, в итоге она покупает не с нами, так как Инна не предлагает того, что им надо в необходимых районах.', 0, '1'),
('57b7cb80-79e1-8822-d15d-4fe464cd091a', '56c8663f-c212-b68b-61dd-4fe464832d09', '2011-12-28 00:00:00', 'Jurga: enviado las referencias 167, 422, 433, 435, 478, 521.', 0, '1'),
('57f434db-18f2-e8e5-de8c-4fe4648ff9b1', '56c8663f-c212-b68b-61dd-4fe464832d09', '2012-01-01 00:00:00', 'Юрга, спасибо за информацию.Напишите кто Вы? Я знаю Марианну,но мы говорили об Аликанте и т.д.Ответьте мне. С уважением Лидия\r\n\r\nОт: Jurgita <jurginja@gmail.com>\r\nДата: 1 января 2012 г., 18:04:56 Центральноевропейское время\r\nКому: Копенкина Лидия <kopenkinaL@yandex.ru>\r\nТема: Ответ: Недвижимость в Испании\r\nЗдравствуйте Лидия!\r\n\r\nЯ работаю в компании Коста Иберия, в испанском офисе. Обычно Вы общаетесь с моей коллегой Евгенией, с питерского офиса.\r\n\r\nС уважением,\r\n\r\nЮрга. \r\n', 0, '1'),
('58231f2e-f08e-bacb-b212-4fe464d054fe', '57345280-d20e-0ac9-a070-4fe464d3a573', '2011-07-26 00:00:00', ' Теперь Ирина планирует приехать в октябре-ноябре.\r\n Она уже ездила смотрела, но с нашей компанией в тот раз не удалось встретиться.', 0, '1'),
('58402fee-8bbd-586e-8257-4fe464625396', '56c8663f-c212-b68b-61dd-4fe464832d09', '2012-02-15 00:00:00', 'Jurga: enviado 167,422,433,435,478,521.', 0, '1');
INSERT INTO `cosib_messages_answers` (`id`, `id_m`, `date_entered`, `description`, `deleted`, `assigned_user_id`) VALUES
('5879ff00-cfa2-14ce-1f60-4fe4645e55de', '56c8663f-c212-b68b-61dd-4fe464832d09', '2012-02-23 00:00:00', 'Здравствуйте ,Юрга. Спасибо за информацию.Извините,что не смогла ответить сразу.Прошу Вас если возможно,то скинуть информацию по Аликанте в таких же пределах.Спасибо. С уважением Лидия.\r\n\r\nJurga: enviado ', 0, '1'),
('58b6c77d-5cb8-0368-055c-4fe4645fc8f9', '56c8663f-c212-b68b-61dd-4fe464832d09', '2012-05-10 00:00:00', 'Договорились, что Лидия сообщит, когда купит билеты, её родственница этим занимается.\r\n\r\nЕй нужно: только Аликанте, 2 объекта(ей и знакомой), 2-3 спальни, 60-80 метров. Для сдачи в аренду. после 1980 г постройки.\r\n\r\nЛидия спрашивала- если она поедет без сына, но на него тоже собственность оформлять, доверенность от него на неё надо на испанский переводить или нет?\r\n\r\nАня Бабошкина ответила-обязательно. если она с нами покупает я тебе скажу потом что необходимо в доверенность включить, а вообще лучше в консульстве сразу на испанском оформить', 0, '1'),
('58f06308-f5a8-d1cf-ec6a-4fe46463a284', '56c8663f-c212-b68b-61dd-4fe464832d09', '2012-05-14 00:00:00', 'Лидия пока еще не купила билеты, обещала сообщить.', 0, '1'),
('59b31bea-b48c-59d1-0ba9-4fe4646cf450', '5865b313-c066-d77c-5fa9-4fe464a34ff3', '2011-06-15 00:00:00', 'Появились более важные финансовые вложения,отложили вопрос на неопр. срок, скорее ближе к осени вернутся к нему.', 0, '1'),
('5a11c3e9-a8a3-d9ef-b50e-4fe464e30955', '5865b313-c066-d77c-5fa9-4fe464a34ff3', '2011-11-21 00:00:00', 'Уже давно не отвечает на звонки.', 0, '1'),
('5ab6b663-82dd-4359-51a6-4fe4645b98c8', '59720138-9a91-d36d-43ac-4fe464c9a8c3', '2011-09-01 00:00:00', ' Алексею Рустамовичу необходимо по заинтересовавшему его объекту(лот 83)  планировку изнутри, фото рядом с домом,  фото бассейна.Также,какая инфраструктура и далеко ли она расположена. Ему это обязательно, чтобы получить по возможности полное представление.', 0, '1'),
('5c741ccd-a4d7-e094-79f8-4fe464962c82', '5b294619-c742-63aa-1fff-4fe4646d6aec', '2011-09-05 00:00:00', 'Добрый день!\r\nДумаю, что Вы уже в курсе,но тем не менее:\r\nВалерий Малышев с подругой жены прилетают 11 сентября и пробудут до 18сентября.\r\nПодругу жены интересует приобретение квартиры, аналогичной квартире Валерия,море недалеко, по бюджету в районе 100 тыс.евро. ', 0, '1'),
('5d5a50fe-cedd-070d-6966-4fe4641ae580', '5c5ca8d5-41d4-df15-0b9e-4fe464f5a9aa', '2011-04-07 00:00:00', 'Евгения, для Сергея и Ивана можете предложить следующая недвижимость: Лот 87 + 150 в Эл Расо (Гуардамар) Лот 95 + 188 +190 в Кампоаморе (Ориуэла Коста) Лот 34 +35 в Лос Балконес (Торревьеха) Лот 174 в кумбре дель Соль - там комплекс нового строительсва, есть в продаже более чем 2 варианта. Лот 90 Сиера Кртина (Бенидорм) - комплекс 13 вилл начало строительсва. Лот 14 в Кальпе - там комплекс нового строительсва, есть в продаже более чем 2 варианта. Лот 189 - Ла Мата (Торревьеха) - невероятно хорошая инвестиция, так как дом оценнён 1.200.000 евро', 0, '1'),
('5db6b084-6b94-c43d-da78-4fe464035a41', '5c5ca8d5-41d4-df15-0b9e-4fe464f5a9aa', '2011-04-13 00:00:00', 'Бюджет-до 500тыс,ипотека\r\nтолько Север Коста Бланки , 2 виллы ,желательно рядом, но можно и нет, 3 спальни, 2 ванны, 150-200кв.м. , вторичное или первичное,  1,5-2 км до моря, участок 7-12соток(обязательно), бассейн, сосны и зелень (обязательно).Виллы не в стиле модерн.\r\n   Буду ждать варианты недвижимости, расчет по налогам и содержанию на подобные объекты , хорошие варианты отелей на севере побережья для проживания на время поездки.\r\nСпасибо. \r\n', 0, '1'),
('5dda1258-a8c7-d4ba-ba10-4fe46412dd5e', '5ccb7892-28c9-9cf6-31f5-4fe464992d56', '2011-10-06 00:00:00', '"Женечка, извините меня, пожалуйста! Мы решили покупать недвижимость в Турции. Лена"', 0, '1'),
('5df29599-fd13-d25f-f0b7-4fe464a104e0', '5ca5e6e5-1c59-ab5c-647f-4fe464c988fc', '2011-11-15 00:00:00', 'Женя, позвони Надежде...может уже она вернулась из больницы.', 0, '1'),
('5e11a792-ad7d-7d91-739e-4fe4647acb21', '5c5ca8d5-41d4-df15-0b9e-4fe464f5a9aa', '2011-06-08 00:00:00', 'Пока по датам поездки не известно, т.к.  на работе очень  много дел.Возможно, получится после июля.  Задумываются также о кипре и барселоне.', 0, '1'),
('5e260721-4596-5f33-94a7-4fe464022c00', '28960a20-d3bc-1166-98f5-4fe464d707b5', '2011-11-16 00:00:00', 'Переписка с Аллой ( все это я узнавала у Ани Бабошкиной):\r\n\r\n-Добрый день, Алла!\r\n\r\nЭто Евгения из Петербурга.\r\nВы вчера звонили и интересовались, если маму ,например, на 5% поставить в собственность, дадут ли ей визу владельца или ей только по туристической визе можно будет ездить.\r\nМама также  будет считаться  собственником, поэтому должна получить визу на этих основаниях.\r\n\r\n-Большое спасибо, Евгения. Можно ли маму вписать нотариально,или должна участвовать в ипотеке?\r\n\r\n-На каждого  из собственников, если эта покупка происходит с помощью ипотеки, банк запрашивает документы. Поэтому мама  также будет фигурировать в ипотеке.', 0, '1'),
('5e5a2543-beba-1c22-98cc-4fe4646bd187', '5c5ca8d5-41d4-df15-0b9e-4fe464f5a9aa', '2011-08-01 00:00:00', '  Сергей Жаров и Иван Никитин пока не знают, когда смогут поехать в Испанию.\r\nТеперь они  не рассматривают побережье Коста Бланка. Их интересует именно Барселона.\r\nКроме того, они все так же продолжают думать и о Кипре.\r\n  Сами параметры недвижимости все те же: 2 виллы ,желательно рядом,  3 спальни, 2 ванны, 150-200кв.м.  с видом,  1,5-2 км от моря, участок 7-12соток(обяз), бассейн.До 500тыс.\r\nПришлите, пожалуйста, для них варианты вилл в Барселоне.', 0, '1'),
('5e64a5a5-04e0-584e-00a4-4fe464b2681f', '5ca5e6e5-1c59-ab5c-647f-4fe464c988fc', '2011-11-16 00:00:00', 'Поехать уже только после НГ, на связи, не протов помощи по поездке.', 0, '1'),
('5ee3ee3e-0c27-bcca-666c-4fe464f43638', '5ca5e6e5-1c59-ab5c-647f-4fe464c988fc', '2011-12-08 00:00:00', 'Не получилось в Москве встретиться с Антонио.Пока еще не посмотрела перелеты,кот. я отправляла.', 0, '1'),
('5ef5fd2a-98fe-a592-b88a-4fe4640c6e73', '5c5ca8d5-41d4-df15-0b9e-4fe464f5a9aa', '2011-09-01 00:00:00', 'Пришлите, пожалуйста, варианты для Сергея Жарова.', 0, '1'),
('5f4708a9-0a42-f040-f9a5-4fe464907a4e', '5c5ca8d5-41d4-df15-0b9e-4fe464f5a9aa', '2011-09-21 00:00:00', 'Пришлите, пожалуйста, варианты для Сергея Жарова.', 0, '1'),
('5f4e1641-ec07-1f12-9deb-4fe4647a9354', '5ca5e6e5-1c59-ab5c-647f-4fe464c988fc', '2011-12-26 00:00:00', 'Отправила перелеты еще раз, Надежда просила позвонить ей после НГ.', 0, '1'),
('5f976e73-100e-cec7-6e27-4fe464269f0a', '5c5ca8d5-41d4-df15-0b9e-4fe464f5a9aa', '2011-10-12 00:00:00', 'Пожалуйста, пришлите, варианты вилл в Барселоне для Сергея и Ивана.', 0, '1'),
('5fb55da4-d464-18f1-45e0-4fe46462c697', '5ca5e6e5-1c59-ab5c-647f-4fe464c988fc', '2012-01-18 00:00:00', 'Пока не известно, когда смогут поехать, так как много работы, и муж недавно упал, локоть повредил.', 0, '1'),
('5ff40ebf-32a9-e473-8c4f-4fe464180806', '5c5ca8d5-41d4-df15-0b9e-4fe464f5a9aa', '2011-10-16 00:00:00', 'Anna: Evgenia otpravte 523,524,525.', 0, '1'),
('6016b8a5-93ef-f411-173c-4fe46406393b', '5ca5e6e5-1c59-ab5c-647f-4fe464c988fc', '2012-03-22 00:00:00', 'Сможет поехать после 20 мая, так как сейчас по работе отчеты, на майские праздники в суету не хочет, а после др сестры 20 мая сможет.  отправила чартер 23-30 мая .', 0, '1'),
('607aa60c-3d1b-727c-2404-4fe464a25551', '5ca5e6e5-1c59-ab5c-647f-4fe464c988fc', '2012-03-28 00:00:00', 'Надежда все посмотрела, остаемся на связи!\r\nПо билетам будет решать ближе к поездке.\r\n', 0, '1'),
('611fe422-d8aa-ac60-ce01-4fe46434f036', '5ca5e6e5-1c59-ab5c-647f-4fe464c988fc', '2012-05-06 00:00:00', 'ANNA OTPRAVILA VARIANTY DO 100.000€ COSTA BLANCA.', 0, '1'),
('6187a166-5b5c-5a87-336e-4fe4641b054b', '5ca5e6e5-1c59-ab5c-647f-4fe464c988fc', '2012-05-10 00:00:00', 'Пока у Надежды не получится поехать в мае, все откладывается, проблемы с дачей, которую она хочет продавать, крыша провалилась у гаража. ', 0, '1'),
('62ab050d-e931-a194-4870-4fe464d6dc41', '617cf245-2c94-d747-3b5b-4fe46402d08a', '2011-09-29 00:00:00', 'Добрый день,  Евгения!\r\n\r\nКлиенту можем посоветовать приобрести квартиру в Торревьехе с максимальной близостью к море, так как это как раз и гарантирует успешную сдачу жилья в аренду. Рекомендую отправить Сергею недвижимость под номером лота: 7, 29, 287, 325, 434, 478, 480 и 515. Особенно рекомендую предложение номер 495 – то новое строительство с очень хорошими данными (район, близость к пляжу, к инфраструктуре и конечно высокое качество строительства).\r\n\r\nJurga', 0, '1'),
('631dd358-34e4-da2b-0f63-4fe464c36efa', '617cf245-2c94-d747-3b5b-4fe46402d08a', '2011-09-30 00:00:00', 'А Сергею что уже отправили варианты 7, 29, 287, 325, 434, 478, 480, 495 и 515?', 0, '1'),
('63218843-eb91-fa35-59c1-4fe46491f9ab', '61f764e6-226a-3718-bda8-4fe464e998cf', '2011-12-26 00:00:00', 'ехать пока не собирается, весной тоже не думает, позже.', 0, '1'),
('637f7ee5-3ac3-4b41-202b-4fe46473ef27', '617cf245-2c94-d747-3b5b-4fe46402d08a', '2011-09-30 00:00:00', 'Нет я не отправляла. вам посоветовала варианты :)', 0, '1'),
('63e54113-cf78-eb6f-b082-4fe4640c4600', '617cf245-2c94-d747-3b5b-4fe46402d08a', '2011-10-25 00:00:00', 'Дозвонилась до Сергея. У него умерла мама.Созваниваемся с ним через неделю.', 0, '1'),
('6467c064-4313-5ad2-85e8-4fe464834785', '617cf245-2c94-d747-3b5b-4fe46402d08a', '2011-12-16 00:00:00', 'Мы с Сергеем созванивались, он тогда сказал, что ничего не известно, он сам позвонит. Я ждала, он так и не звонил, недавно я попросила Андрея Владимировича ему со своей стороны позвонить. \r\nВ итоге- можно будет звонить Сергею в середине января, смотреть билеты на январь-февраль.', 0, '1'),
('64e258e1-7c6e-52ed-a36c-4fe4645949fe', '617cf245-2c94-d747-3b5b-4fe46402d08a', '2012-01-11 00:00:00', 'Я отправляла Сергею перелеты на февраль, он подумает и перезвонит на этой неделе.', 0, '1'),
('654c93d3-bf52-9a38-f690-4fe464e19cac', '617cf245-2c94-d747-3b5b-4fe46402d08a', '2012-01-19 00:00:00', 'Сергей приезжает с 3 по 10 февраля.\r\nПожелания по проживанию: как можно бюджетнее, желательно односпальневые апартаменты, но если таких нет, то двуспальневые недорогие. Если вдруг гостиница получится дешевле(вряд ли наверно?), то гостиницу.\r\n', 0, '1'),
('65ce496e-28cd-6e49-2cc8-4fe46464afea', '617cf245-2c94-d747-3b5b-4fe46402d08a', '2012-01-24 00:00:00', 'Сергею были отправлены варианты по аренде: квартира Малышева 200+50 евро\r\nквартира Гарусовой 250+50 евро', 0, '1'),
('662f6627-8dd9-acee-93d9-4fe464391c7f', '617cf245-2c94-d747-3b5b-4fe46402d08a', '2012-01-25 00:00:00', 'Сергей Маркович выбрал для проживания на время поездки квартиру Малышева, стоимость 200+50 евро.', 0, '1'),
('666de480-64b9-f883-4ec8-4fe464989c8f', '6522437d-05c2-7c66-cbe7-4fe464e6872a', '2011-11-11 00:00:00', '"Спасибо за предложение, уже все забронировали и билеты купили :)"\r\n\r\nПоедут в декабре. К сожалению, телефона нет, только по почте связь.Жду, когда ответят в какие даты и где остановятся.', 0, '1'),
('6690d43d-3619-5ffb-b27d-4fe4642e5ba1', '617cf245-2c94-d747-3b5b-4fe46402d08a', '2012-01-25 00:00:00', 'На 31 января на 10.00 Сергей и супруга идут в консульство Испании  для подписания доверенности на Антонио.\r\n\r\nЧабаненко: "В свою очкредь прошу, чтобы у этого адвоката были готовы к предъявлению нам своих  документов,  удостоверяющих его личность, право на адвокатскую деятельность, его принадлежность к Вашей организации, а также их копии для передачи мне." \r\n\r\n\r\n', 0, '1'),
