('70ae646d-3e87-63ab-2d88-4fe464da4464', '6ea47a82-60b9-d572-c9cd-4fe464e6fed7', '2011-11-15 00:00:00', 'Отправила Дмитрию список документов для ипотеки.\r\nОни летят до Барсы, а потом на машине в Валенсию. Затем,может, на машине или на поезде в Аликанте.(от встречи на ж/д вокзале отказался, встретят знакомые).  Про Валенсию он сам говорит, что ,наверно, там дороговато. Он хочет смотреть в Аликанте, хотя на выставке обсуждали и возможность посмотреть города-спутники рядом с Аликанте.Будем с ним на связи, общается хорошо, ближе к поездке отправлю координаты Юрги и Ани. \r\n\r\nСкажите, пожалуйста,если будет необходимо, мы сможем показать им недвижимость в Валенсии?\r\n\r\nПришлите.пожалуйста, еще варианты по Аликанте, так как варианты Сергея Чабаненко я уже Дмитрию отправляла. ', 0, '1'),
