('770946ef-f6e6-1585-9565-4fe46435d26b', '759a10e3-b9ef-eabd-0805-4fe46466e969', '2011-11-14 00:00:00', 'Привет Нина!\r\n\r\nПолучила твой запрос для клиентки Еленой Наймухиной. Есть в порядке 10-15 предложений, которых могу тебе отправить. Скажи каким образом тебе лучше, прямо ссылки на сайта, pdf без лого Коста Иберии или фото с описанием?Тем ни имения высылаю ссылку на сайт, где ты можешь посмотреть выбранные объекты.\r\nКрасные дни календаря: в январе 1-ое и 6-ое; в феврале таких нет.\r\nС нетерпением жду ответа. С ув., \r\nЮрга.\r\nRef.enviadas: 14,52,53,90,174,185,201,252,318,423,504,530,552.', 0, '1'),
