('77da4cf5-a09b-42fb-9195-4fe464139588', '759a10e3-b9ef-eabd-0805-4fe46466e969', '2011-12-15 00:00:00', 'Юрга, здравствуй! \r\nВсе клиентке переслала, она  в ответ спросила про Ллорет де Мар. \r\nСейчас ее телефон не в доступе, как только появится- выясню в чем дело.\r\n  У меня было несколько завершений сделок одновременно, поэтому я тебе быстро не ответила. Приношу извинения.\r\nНина\r\n', 0, '1'),
('77f7ebe9-77f1-3fb9-a1e5-4fe4645d245f', '722820dd-7f55-1b6c-f158-4fe4642c7862', '2011-07-13 00:00:00', '  Александр будет на Коста Бланка с 15 по 24 ноября. Затем уедет в Мадрид.\r\n  Александр ориентируется на бюджет 120 тыс евро., не обязательно дуплекс рядом с морем, можно минутах в 20-30 ходьбы от моря . Вообще идея Александра: у него есть банк в Бенидорме, где он думает, чтобы ему по знакомству оформили 80% кредита.  У Александра есть 20 тыс евро,  он хочет  вложить их как  первый взнос, а  остальную сумму - в кредит. А затраты на оформление он думал, чтобы мы ему оплатили,и в течение трех месяцев он бы нам отдал.\r\n  \r\n', 0, '1'),
('787b8dac-17c9-bff1-a822-4fe464f8c63a', '722820dd-7f55-1b6c-f158-4fe4642c7862', '2011-07-25 00:00:00', '"Евгения добрый день! Большое спасибо за внимание. Я все внимательно посмотрел и могу сказать что все варианты мне понравились. Надеюсь что они сохраняться до моего приезда в Испанию. Во всяком случае может и еще что-то появяться.\r\nЯ недавно слушал Евроньюс. Там сказали что  цены на недвижимость в Испании падают и еще упадут. Это для меня хорошо."\r\n', 0, '1'),
('79159a74-33f0-edf7-0512-4fe464c79996', '722820dd-7f55-1b6c-f158-4fe4642c7862', '2011-09-14 00:00:00', 'Юрга большое спасибо за внимание, но я не такой фанат футбола. А так  я 15 ноября буду в Бенидорме и к Вам обьязательно позвоню и приду. Думаю мы что-то решим с покупкой недвижимости.Так что до скорой встречи и знакомства. Антонио Наварро большой привет. С уважением Александр', 0, '1'),
