('79db3a01-b8e4-79ed-b514-4fe4648888ea', '7871e670-fa44-a9ca-a0e6-4fe464c00576', '2011-12-09 00:00:00', 'Владимир ездил с женой 8 декабря смотреть объекты.\r\nЕму показывали 4 варианта на Ла Манга, 2 в Кабо Роиг.\r\nЕму понравился один объект на ла манге, но хозяин просит 2 800 000, это конечно дорого.\r\nОни прошлым летом смотрели один дом, с похожими характеристиками, но старый. Тот стоит 950 тыс. ', 0, '1'),
('7b9e8e0b-cd33-f7aa-6836-4fe464099ddb', '7a085788-db75-d367-8b3e-4fe464dbd8c0', '2011-06-23 00:00:00', 'Lamada telefonica. No responde. Jurga', 0, '1'),
('7c107706-4ecd-a7ea-19df-4fe464f415cc', '7a085788-db75-d367-8b3e-4fe464dbd8c0', '2011-06-29 00:00:00', 'Договаривались созвониться сегодня, но Нина Ивановна не отвечает.', 0, '1'),
('7cb0f569-a8e8-a887-a0de-4fe464bc88a9', '7a085788-db75-d367-8b3e-4fe464dbd8c0', '2011-07-04 00:00:00', 'Нина Ивановна планирует приехать в июле,пока с датами точно не определились, обсуждают вместе с супругом.Созваниваемся завтра.Она думает смотреть на коста бланка и коста брава.', 0, '1'),
('7d359281-0811-0e7b-c6f8-4fe464845506', '7a085788-db75-d367-8b3e-4fe464dbd8c0', '2011-07-05 00:00:00', 'Нина Ивановна с мужем пока не определились с датами,но думают поехать после 16 июля. Хотят смотреть на Коста Брава в Барселоне, Ллорет дель Мар, Плайя де Аро,затем поехать на Коста Бланка посмотреть в Алтее и на юге Коста Бланка. \r\nСкажите, пожалуйста, есть ли какие-нибудь интересные предложения для Нины Ивановны на Коста дель Соль?Если есть, то они могут поехать и туда посмотреть.\r\nТакже, скажите,пожалуйста, можно ли будет арендовать машину подешевле,чтобы добраться с Коста Брава до Коста Бланка? ', 0, '1'),
('7dbd2d23-34b1-3f04-67b1-4fe464a94117', '7a085788-db75-d367-8b3e-4fe464dbd8c0', '2011-07-07 00:00:00', 'Jurga: Llamada a Nina Agaltseva, tiene previsto el viaje`para la fecha 20 de julio. Me confirmará cuando compre los billietes.', 0, '1'),
('7e6bb7ce-1d8d-d6ea-4ec3-4fe46420eecf', '7a085788-db75-d367-8b3e-4fe464dbd8c0', '2011-07-08 00:00:00', 'Нина Агальцова вместе с мужем Анатолием, сыном Владиславом и внуком Даниилом полетят в Испанию в середине июля. Пока билеты они еще не взяли, но ориентировочный график их поездки:15 июля прилетают на коста дель соль, будут в марбелье (возможно, остановятся у своего друга, а ,возможно , и нет, поэтому необходимо порекомендовать ей отель на берегу .)Вообще ей нравится там отель "Мелия",4звезды. Затем 19 июля они хотят ехать на коста бланка на машине, поэтому им необходимо будет взять машину в аренду на коста дель соль так, чтобы потом оставить её на коста бланка в аэропорту, например.На коста бланка необходимо или порекомендовать им отель на берегу или апартаменты с 2или 3 спальнями также на берегу моря.Недвижимость Нина Ивановна хочет смотреть и на коста дель соль и на коста бланка. Кроме того, Нина Ивановна просила узнать, во сколько обычно открываются кафе?обратно с коста бланка домой они планируют возвращаться 22 или 23 июля. Нина Ивановна будет ждать информацию сегодня.Пришлите мне, пожалуйста.', 0, '1'),
('7ecb0ff8-3c83-55ce-42fc-4fe464cf7cd5', '6c410a57-79b6-3bc9-1096-4fe464eff5e7', '2012-05-10 00:00:00', 'Посмотрит нов. варианты только 14 мая, так как его не было в москве. ', 0, '1'),
('7f08556c-ea5f-9d74-f1a1-4fe46494fe0d', '7a085788-db75-d367-8b3e-4fe464dbd8c0', '2011-07-12 00:00:00', 'У Нины Ивановны Агальцовой все определилось с поездкой: 17 июля -прибытие на Коста дель Соль,затем она хотела бы поехать на Коста Бланка 20 июля(но если не получится, то поедут 19 июля), 25 июля-возвращение в Россию. Она и её родные остановятся в отелях на Коста дель Соль и на Коста Бланка.  Нина Ивановна думает смотреть недвижимость на обоих этих побережьях. Контактные данные, которые можно передать партнерам на Коста дель Соль все те же: 8910 904 11 44,agaltsovani@mail.ru. Пожелания по покупке такие же как раньше:бюджет до 500 тыс., 2 спальни,кондоминимум,центр, а не окраина, не больше 5 минут до моря, или  таунхаус с участком 1й этаж  или апартаменты 1йэтаж с террасой  или последний с солярием ,или апартаменты с террасой, площадь 85-120кв.м. ', 0, '1'),
('7f83c1ba-7fbc-6621-bf90-4fe464b973aa', '7a085788-db75-d367-8b3e-4fe464dbd8c0', '2011-07-25 00:00:00', 'Es su visita Nina exsigido ver propiedades solo en Benidorm, pero al estar 3 días seguidos viendo Benidorm, se dio la cuenta, que no es citio donde le gustaria vivir.\r\nAl salir dejo claro que quiere propiedades con las siguientes caracteristicas:\r\nSi es un apartamento:\r\n- Zona San Juan de Alicante\r\n- Edificio en 1ª linea de la playa\r\n- 2-3 dormitorios, pero la superficie 120-130 m2\r\n- Terrasa amplia\r\n- No mas bajo que la 7ªplanta del edificio p/tener vistas al mar y no tener ruido de la calle\r\n- Cerca de todos los servicios (supermercado, farmacia etc.)\r\n- Playa de arena blanca\r\n- El copnplejo con piscina y jardines.\r\n- Precio hasta 650.000€\r\n\r\nSi es una villa:\r\n- Puede ser a max 10 min en coche de la ciudad grande (Alicante)\r\n- Casa con propia parcela\r\n- Vistas al mar\r\n- 2-3 dormitorios\r\n- Piscina propia, o posibiliadad de construir una.\r\n- Techo de la vivienda de min 2.60 m de alto.\r\n- Zona BBQ\r\n- Precio hasta 1.500.000€ ', 0, '1'),
('80027fa8-206a-c2ec-98b8-4fe4645cd4e8', '7a085788-db75-d367-8b3e-4fe464dbd8c0', '2011-08-15 00:00:00', 'Добрый день!\r\nЯ вообще не могу дозвониться до Нины Агальцовой уже давно.\r\nПосле последней поездки,как мне известно, Нина Ивановна готова была приехать и в третий раз в Испанию.\r\nСкажите,пожалуйста,она говорила,когда примерно думает поехать или нет?', 0, '1'),
