('836f3487-ebe5-19c8-ad73-4fe46482b7ef', '8127c7a9-35f5-d361-a53f-4fe464586b11', '2011-07-15 00:00:00', 'Reunión en despacho (11.00 - 12.40), entrega de las facturas, cuentas; se le acompaña al banco para recoger las tarjetas. Pendiente cerrar las cuentas en Caja Murcia. ', 0, '1'),
('84430ffa-b919-3135-c47e-4fe464476f8b', '6c410a57-79b6-3bc9-1096-4fe464eff5e7', '2012-05-15 00:00:00', 'Он согласен встретиться и посмотреть с нами тоже, понимает, что надо смотреть на месте, а не по фоткам.\r\nЕсть какой то вариант и от другого агентства, я просила его прислать. ', 0, '1'),
