('8581d7e8-352a-7165-9db2-4fe464cecf97', '83e24ea3-61fa-e5ae-4460-4fe464839189', '2011-06-20 00:00:00', 'Llamada  a las 9:55. La familia se va mañana a España. le ofrecedo que se queden con mi numero de tel. y que no duden en llamar cuando llegen. Sus propios planes no han cambiado, va venis 3 de agosto. Hasta ahi vamos hablar unas veces mas. Jurga', 0, '1'),
('85ceb4e9-ab8c-d64e-12b0-4fe4642a3f5b', '7984657a-4498-802f-5310-4fe46414ddef', '2011-10-07 00:00:00', 'Добрый день Анна,я сейчас в Германии.Буду в СПб 12 числа сразу Вас наберу. ', 0, '1'),
('85f78987-0577-1d21-aa15-4fe464198d39', '83e24ea3-61fa-e5ae-4460-4fe464839189', '2011-08-12 00:00:00', 'Volverá en otoño con amigo para decidirse sobre la compra. Le gusta Benidorm - la zona de la Playa Poniente. ', 0, '1'),
('864a3dff-d546-4184-ec75-4fe4642f798b', '7984657a-4498-802f-5310-4fe46414ddef', '2011-10-26 00:00:00', 'Константин приходил на встречу к Андрею Владимировичу.\r\n1.	Ищем в Ллорет де Мар и окрестным деревням\r\nТак же смотрим Алтея и округа, и несколько вариантов смотрим по югу Коста Бланки.\r\n2.	Что ищем: квартира + комерческая недвижимость. В общей сложности у них будет примерно 400 000 евро на руках. Точно не первая линия от моря, но и не слишком далеко. До 1 км. Для жилой недвижимости – закрытый частный комплекс. Не первый этаж (если это многоквартирный дом)\r\n3.	Собирается ехать с женой в отпуск где-то в середине января на 2 недели (числа с 14-15 января)\r\nИзначально на выставке он обозначал бюджет 200 тыс для квартиры( ну можно и немного  подороже ), \r\nпришлите, пожалуйста, варианты по Алтее!По югу я ему отправлю.', 0, '1'),
('86694d67-696e-9a93-0176-4fe464f3c0ba', '83e24ea3-61fa-e5ae-4460-4fe464839189', '2011-08-30 00:00:00', 'Друг Владимира -чиновник,ему трудно вырваться с работы,поэтому пока все зависло. Владимир говорит,что если жить пару месяцев в году, то примерно Ла Мата, а если жить постоянно,то Бенидорм.  Север больше нравится видами.', 0, '1'),
('86e92b28-2f0c-c562-6c1f-4fe4646ae87b', '83e24ea3-61fa-e5ae-4460-4fe464839189', '2011-09-14 00:00:00', 'Спасибо за информацию и предложение.\r\n\r\n14 сентября 2011, 18:13 от "Jurga Cvetkova" <jurga@nbagroup.es>:\r\n  \r\nУважаемый клиент!\r\nОтправляю расписание футбольных матчей Лиги Чемпионов УЭФА, которые будут проводится в Испании. Наша компания, предлагает посещение одного из матчей в качестве бонуса, в случае приобретения Вами недвижимости в Испании. Также, напоминаем, что Налог на Добавочную Стоимость до 31 декабря 2011г. на объекты новой постройки, снизан с 8% до 4% ! Не пропускайте возможность!\r\nhttp://www.costaiberia.ru/ru/item/44/-/\r\n \r\nС уважением,\r\nКомпания costaiberia.\r\n', 0, '1'),
('87037018-12d0-6b16-8b18-4fe4646e7b44', '7984657a-4498-802f-5310-4fe46414ddef', '2011-10-31 00:00:00', 'Anna otpravila: 5,6,14,44,50,54,144,186,204,210,252,254,257,280,285,318,402,423,495,498,530.', 0, '1'),
('8739c46d-98d2-02a4-42f9-4fe4646dff03', '85b1e648-a04a-1147-56bf-4fe464fbbd2a', '2012-01-13 00:00:00', 'Иван не собирается ехать весной. Скорее всего поедет летом( либо во Францию на границе с Испанией либо в Испанию на границе с Францией)\r\nНедвижимость хочет на границе с Францией.На Бланке не будет', 0, '1');
