('87675b28-1038-6d16-b6d4-4fe46407cd48', '83e24ea3-61fa-e5ae-4460-4fe464839189', '2011-12-12 00:00:00', 'Уважаемая Евгения, добрый день!\r\nпрошу Вас подобрать аренду в г. Бенидорм, район пляжа Леванте, до 500 метров от моря, рядом магазины и развитая инфраструктура, 2 спальни, оборудованый аппартамент, балкон или веранда, доступ интернет, лето 2012 года период ориентировочный 2 месяца.\r\n\r\nЗаранее вас благодарим за предложения,\r\nС Уважением,\r\nВладимир\r\n', 0, '1'),
('8777af13-75cf-341b-e3df-4fe464e1c794', '7984657a-4498-802f-5310-4fe46414ddef', '2011-11-01 00:00:00', 'Пришлите, пожалуйста, еще варианты для Константина по Алтее и Ллорет де Мару', 0, '1'),
