('87efb977-663c-4edb-3c67-4fe464c0913b', '7984657a-4498-802f-5310-4fe46414ddef', '2011-11-17 00:00:00', 'Пожалуйста, пришлите, планировки лотов 44,204,299,97,297. Константину они понравились. Он просит.\r\n\r\n\r\n', 0, '1'),
('87f61dc6-de94-adc2-b49e-4fe4643edc2e', '83e24ea3-61fa-e5ae-4460-4fe464839189', '2011-12-21 00:00:00', 'Привет еще раз!\r\nКогда будет какая то информация по аренде в Бенидорме, пришлите, пожалуйста.', 0, '1'),
('886bd55d-5a37-88fa-2d6b-4fe4645468ac', '83e24ea3-61fa-e5ae-4460-4fe464839189', '2011-12-28 00:00:00', '  Владимиру отправлены варианты по аренде в Бенидорме от наших партнеров:\r\n\r\nПримерные цены на июль и август на данные квартиры:\r\n2 недели:  950 – 1100 €\r\nПолный месяц:  1900-2100€\r\nhttp://catalogo.pisos.com/catalogo.asp?idcatalogoonline=204057788,263100\r\nhttp://catalogo.pisos.com/catalogo.asp?idcatalogoonline=208181898,263100\r\nhttp://catalogo.pisos.com/catalogo.asp?idcatalogoonline=209498276,263100\r\n\r\n    Можно вернуться к вопросу в начале марта 2012, так как сейчас пока еще нереально зарезервировать квартиру, потому что  до лета еще очень много времени. ', 0, '1'),
