('88e55229-7b55-9e60-a44c-4fe4642198bb', '83e24ea3-61fa-e5ae-4460-4fe464839189', '2012-01-24 00:00:00', '"Уважаемая Евгения, спасибо за варианты!\r\n просим Вас подобрать еще на пляже Леванте. Подскажите, а Паньенте там рядом магазины продуктовые и как развита инфраструктура? далеко ли до Леванте и прогулочной зоны? Ждем как односпальные там и двухспальные, тк родители заинтересовались еще, а они с одной спальней хотят) если можно что бы не далеко друг от друга как вы прислали.\r\nСпасибо!\r\nВладимир"\r\n', 0, '1'),
('88f3314b-edac-b8e4-953e-4fe4649846a1', '7984657a-4498-802f-5310-4fe46414ddef', '2011-12-12 00:00:00', 'Константин был в Германии по работе, сегодня сам позвонил.\r\nПоездка как планировалось в середине января чуть сдвигается, так как опять придется ехать в командировку.  \r\nЭто будет конец января или начало февраля на 2 недели. По билетам он решит сам.\r\nУ них продались квартиры, будут деньги.\r\nОстановиться хочет у друзей в Барселоне или Ллорет де Маре.\r\nОн же хочет приобретать и квартиру и помещение.\r\nСказал, что раньше 15ого января не понятны окончательные даты поездки.\r\nЯ его зову побывать и на Коста Бланка, пока он согласен. ', 0, '1'),
('89630931-18b1-467d-42e3-4fe464c40838', '6c410a57-79b6-3bc9-1096-4fe464eff5e7', '2012-05-22 00:00:00', 'Юрий будет смотреть еще с Astor Estate.Было плохо слышно, но вроде я верно расслышала.\r\nОн интересуется еще и ВНЖ. Отправила ему контакты Иры Баловой, Ани Бабошкиной и Ани Дерюшевой.\r\n\r\nОн как то отдыхал в Бланесе, но там дорого покупать.\r\nХочет посмотреть Торревьеху.', 0, '1'),
('8973d9e4-70c0-cb9b-4837-4fe464f00c51', '7984657a-4498-802f-5310-4fe46414ddef', '2012-01-18 00:00:00', 'Созваниваемся 24 января.Сейчас пока нет конкретики.', 0, '1'),
