('8d001835-eb85-77db-5e48-4fe464712aa3', '8b6cd141-4abe-80a2-81ea-4fe4644aac90', '2011-12-05 00:00:00', 'Галина отправила Ире Баловой на почту билеты. Я пришлю инфо попозже.\r\nОна приезжает 4-11 февраля, с ней будет еще второй человек.\r\nПо проживанию не знает, где бы хотела (отель или апартаменты),главное, не дорого.Она интересовалась, сколько  апартаменты будут стоить, я сказала примерно 200-300 евро.\r\n\r\nКуда её лучше поселить?\r\n', 0, '1'),
