('8e22801a-6119-0002-bb97-4fe4648f1152', '8b112f07-6952-1340-41fa-4fe4648f74d8', '2011-07-05 00:00:00', 'Здравствуйте Ув. Виталий!\r\n\r\nКак отдых? Я Вам почему-то по дозвониться не могу. Что Вы решили по поводу визита в Коста Бланку? Еще рассматриваете это место для приобретения жилья?\r\nЖду ответа\r\nС уважением,\r\nJurga Cvetkova\r\nDpto. Venta \r\n', 0, '1'),
