('8ee78da8-9b7a-0d03-489c-4fe46407b4ea', '8b6cd141-4abe-80a2-81ea-4fe4644aac90', '2012-01-10 00:00:00', 'Евгения, добрый день, спасибо за поздравления. И Вас с наступившим Новым годом и Рождеством!\r\nВечером мы с мужем обсудим эти варианты и ответим какие мы хотели бы посмотреть.\r\nПожелания наверное остались прежними, но мы с мужем подумали, что можно рассматривать и до 2 км. от моря если это будет хороший зеленый район и рядом магазины  (продуктовые).\r\nПо месторасположению (городу/местности) принципиальных ограничений нет – будем смотреть все\r\nПо самому объекту  - 2 спальни, если попадутся по этой цене 3 спальни будет идеально.\r\nЕсли будет хороший вариант чуть дороже тоже можно будет рассмотреть – постараемся как-нибудь решить этот вопрос. \r\nВообще в идеале конечно же желательно рядом какие-то насаждения с теньком – но это рассматривайте только как пожелание.\r\nМожно так же (если цена позволяет) рассматривать дуплексы.\r\n', 0, '1'),
('8f992434-5e7e-c25a-e39b-4fe464e135ea', '8b6cd141-4abe-80a2-81ea-4fe4644aac90', '2012-01-11 00:00:00', 'Евгения, доброе утро!\r\nМы вчера с мужем посмотрели варианты, из них мы отобрали то, что наиболее заинтересовало и хотелось бы посмотреть. Варианты расположены в порядке убывания интереса, хотя первые четыре позиции приблизительно равнозначны. По первой позиции хотелось бы понять  где это находится и есть ли транспортная доступность до моря.\r\nИ еще один вопрос: документы для кредита нужны к какому времени к нашему отъезду или раньше и их нужно Вам отправить? Если будут еще варианты похожие на эти присылайте, мы тоже их рассмотрим. \r\n\r\n1.	Лот 000010 Таунхаус en Villamartin (Ориуэла Коста - Коста Бланка)\r\n2.	Лот 000008 Дуплекс en Las Torretas (Торревьеха - Коста Бланка)\r\n3.	Лот 000402 Бунгало en Los Altos (Торревьеха - Коста Бланка)\r\n4.	Лот 000097 Бунгало en Playa Flamenca (Ориуэла Коста - Коста Бланка)\r\n5.	Лот 000256 Бунгало en Villamartin (Ориуэла Коста - Коста Бланка)\r\n6.	Лот 000323 Бунгало en Altos de la Bahia (Торревьеха - Коста Бланка)\r\n7.	Лот 000562 Таунхаус en Playa Flamenca (Ориуэла Коста - Коста Бланка)\r\n8.	Лот 000424 Дуплекс en La Mata (Торревьеха - Коста Бланка)\r\n9.	Лот 000110 Бунгало en Aguas Nuevas (Торревьеха - Коста Бланка)\r\n', 0, '1'),
('902aebc8-f457-f791-9641-4fe464e52368', '8b6cd141-4abe-80a2-81ea-4fe4644aac90', '2012-01-18 00:00:00', 'Евгения, добрый день, мы подумали что стоит посмотреть и апартаменты, ранее Вами присланные в Playa Flamenca лот 000101.\r\n\r\nСкажите пожалуйста, что Вы скажете про этот объект? Где он находится (там карты нет)? Это в самом городе Аликанте?\r\n\r\nhttp://www.costaiberia.ru/ru/property/545/\r\n', 0, '1'),
('9038dfde-ae8a-ccb0-af2d-4fe464a25732', '8f2448aa-4b41-8bf2-08ed-4fe464a21c1f', '2011-10-11 00:00:00', 'Татьяна забираться на коста  бланку и коста дель соль не хочет, больше интересует коста  брава,можно квартиру,не обязательно дом, можно меньше 400 тыс,не сейчас покупать.Отправлю лоты 493,147,124,237,449. ', 0, '1'),
