('90d6eeee-9d5e-f76e-af70-4fe46418fa72', '8b6cd141-4abe-80a2-81ea-4fe4644aac90', '2012-01-19 00:00:00', '"Евгения, добрый день, мы подумали с мужем, и решили что объект в Аликанте не стоит смотреть. Думаю стоит посмотреть апартамент который кажется Вы нам ранее предлагали, или я ошибаюсь? \r\nАпартaмент в Playa Flamenca (Ориуэла Коста - Коста Бланка) лот 000007\r\nЕсли не предлагали: стоит ли его смотреть, Вы его видели? И в этом комплексе с 3 спальнями нет апартаментов?"\r\n', 0, '1'),
('9159fe99-068d-ae4a-0bd4-4fe464638587', '8b6cd141-4abe-80a2-81ea-4fe4644aac90', '2012-01-23 00:00:00', '"Евгения, доброе утро, можно посмотреть и тот и другой объект, единственное на дом я не уверена, что хватит у меня денег на первоначальный взнос."\r\n\r\n-Апартамент расположен рядом с комплексом Эль Боске (Пайа Фламенка). \r\nПентхаус с большой террасой, 2 спальни и 2 ванные, кухня, гостиная, парковка на территории комплекса, бассейны. Рядом: торговый центр, магазины, рестораны, банки, пляж 1200м. Стоимость 125.000 евро. \r\n\r\n-Отдельно стоящий дом на участке 250м2, 3 спальни и 2 ванные, кухня, гостиная, 2 террасы, солнечная терраса с барбекю, собственный сад. В комплексе есть бассейны, прогулочные аллеи. Расположение: район Агуас Нуэвас, город Торревьеха,  Коста Бланка.\r\nДо пляжа 1500м. \r\nВ пешей доступности: супермаркеты, магазины, автобусные остановки, аптеки и тд. \r\nСтоимость 190.000 евро. \r\n', 0, '1'),
('91d30be9-1681-f1f1-b6f6-4fe464a09f2f', '90f9f05d-19df-d199-d54a-4fe464d4be4c', '2011-10-27 00:00:00', 'Добрый день, Уважаемые Людмила и Владимир!\r\n\r\nМеня зовут Юрга, я сотрудник компании Костаиберия в Испании. Пишу, чтобы сказать, что 31 октября буду Вас встречать в аэропорту, номер рейса и время Вашего прибытия мне известны. \r\nМой номер мобильного телефона +34 638 74 25 01 (на всякий случай).\r\nДо скорой встречи!\r\n\r\nС уважением\r\nЮрга.\r\n\r\nП.С. Разговаривала по телефону с Владимиром Александровичем. Обсудили детали встречи.', 0, '1'),
