('9daccafa-e951-0f67-5de4-4fe464486379', '8f125163-6588-4fd9-39d5-4fe464d9007b', '2011-06-14 00:00:00', 'Una llamada tlefonica sin contestar. Jurga', 0, '1'),
('9e1048c9-e0a5-3389-c0da-4fe464403b8a', '9b8e060c-9937-5165-ec31-4fe464788014', '2012-02-16 00:00:00', 'АВ в Москве встретился с Михаилом. У него ребенок попал в больницу, он пока не знает, когда поедет. \r\nАВ просил отправить это предложение, но очень подробно расписать все с трех сторон: экономической, юридической, со стороны маркетинга. Каковы должны быть шаги Михаила, если он согласится.\r\n(регистрация компании, сроки; покупка-как производится, на физ лицо или на компанию; про два бизнеса там-что с магазином, как и кому сдавать в аренду, про бензин; какова рентабельность, каков объем продаж и т.д.)\r\n', 0, '1'),
('9e465b1a-c131-f99a-e5f1-4fe464e3d29e', '9cf95b95-d8f8-23d1-6241-4fe46459092a', '2011-10-27 00:00:00', 'ехать в ближайшее время не думают, варианты не смотрела(не знаю, говорит ли правду)', 0, '1'),
('9e526fe1-6110-34b8-11fb-4fe464a0fc90', '8f125163-6588-4fd9-39d5-4fe464d9007b', '2011-06-15 00:00:00', 'Llamada telefonica. He hablado con Sr.Oleg. Me confirmo que ha recibido mis correos; los planos suyos no han cambiedo, tiene previsto venir en otoño. MAnda un saludo a Sr.Antonio. ', 0, '1'),
('9e953af4-2114-f4e7-cf8f-4fe464f8550f', '9b8e060c-9937-5165-ec31-4fe464788014', '2012-02-27 00:00:00', 'Михаил Гилёв летал в Барселону 23-25 февраля смотреть объекты для инвестиций. Михаил работал в том числе и  с нашими партнерами по Коста Брава  :\r\n\r\n"Добрый день, Евгения!\r\n\r\nВ пятницу Михаилу была предложена программа просмотра инвестиционных объектов, с ним весь день работала моя начальница Варвара. Как я поняла, ему все понравилось.  Сказал, что по приезду в Россию все обдумает. Как будут от него какие новости, дам Вам знать.\r\nС уважением,\r\nРита"\r\n', 0, '1'),
('9ea3fb18-a731-2857-cb8f-4fe4643d7205', '9cf95b95-d8f8-23d1-6241-4fe46459092a', '2011-11-10 00:00:00', 'Поездка переносится на весну, сейчас ехать не собираются,будут решать после февраля, будем на связи.', 0, '1'),
('9ed19135-2499-35f2-2dc1-4fe4649b492f', '8f125163-6588-4fd9-39d5-4fe464d9007b', '2011-06-15 00:00:00', '    Здравствуйте, Юрга! \r\n \r\n    Благодарю Вас за проявленное внимание к нашему вопросу. Мне очень приятно, что Г-н Антонио помнит нашу встречу. Г-н Антонио произвел на нас самое благоприятное впечатление, что укрепило наше намерение выбрать для сделки именно Ваше агентство.\r\n    Теперь о сути дела. Для нас остался не выясненным вопрос: возможно ли приобретение недвижимости под 100% кредит. Дело в том, что у нас имеется ряд объектов недвижимости, которые приносят неплохой доход в Москве, не считая нашего семейного бизнеса. Мы готовы предоставить переводы сертификатов оценки недвижимости независимых агентств, чтобы подтверить нашу платежеспособность. Кроме того, мы собираемся продать кое-что из недвижимости, чтобы досрочно погасить кредит в ближайшие 2-3 года. И мы не хотели бы откладывать на это время приобретение объекта в Испании. Дело в том, что мы немного представляем сегодняшнюю ситуацию с недвижимостью в Испании, т.к. есть ряд испанских агентств (с которыми мы также имели контакты на выставке), которые предлагают нам варианты со 100% под 2,5%, но мы попали под обаяние г-на Наварро и хотели бы работать именно с вашим агентством. Если такой вариант возможен, то мы готовы этой осенью ( а может быть и раньше) приехать в Испанию для подбора объекта. Еще раз сообщаю наши пожелания относительно подбора:\r\n \r\n•	желательно отдельный дом\r\n•	не менее 120 кв.м.\r\n•	не менее 3-х спален\r\n•	с участком земли\r\n•	от моря можно не слишком близко (даже и в нескольких километрах)\r\n•	бассейн не важен\r\n•	пригород большого города или небольшой город, но вблизи большого (не дальше 30 км)\r\n•	цена до 250 тыс. Евро\r\n \r\n \r\n    С наилучшими пожеланиями,\r\n \r\n    Элла и Олег Банковы\r\n', 0, '1'),
('9f062c95-8d6c-002a-9419-4fe464f3510f', '9cf95b95-d8f8-23d1-6241-4fe46459092a', '2012-02-13 00:00:00', 'Продолжают ждать выборы в марте, а потом уже предпринимать действия.', 0, '1'),
('9f165aa6-9987-dddb-f029-4fe464139396', '9b8e060c-9937-5165-ec31-4fe464788014', '2012-03-13 00:00:00', 'Михаил съездил по его словам удачно. \r\nМихаил теперь ждет от Варвары информацию по стоянкам, доходным домам и по солнечной энергии, поскольку ему предлагали какие то складские помещения под Валенсией на солнечных батареях. Также он думает и об участке на солнечных батареях. ', 0, '1'),
('9f6b1f24-c00f-e909-f572-4fe4649d3dd2', '8f125163-6588-4fd9-39d5-4fe464d9007b', '2011-06-27 00:00:00', '    Здравствуйте, Юрга!\r\n\r\n    Благодарим Вас за оперативный ответ. Ваше письмо не только не огорчило нас, а наоборот, укрепило наше мнение о вас, как о серьезной компании, которой можно доверять. Именно поэтому мы не стали связываться с "заманчивыми" предложениями других агентств, которые предлагали нереально выгодные условия покупки, что заставило нас задуматься об их надежности. В этой связи мы собираемся работать в этом направлении, однако продажа недвижимости может занять у нас какое-то время. Мы уже считаем себя вашими клиентами, а совершение сделки - лишь вопросом времени.\r\n\r\n    Еще раз благодарим за внимание, проявленное к нашему вопросу.\r\n\r\n    С наилучшими пожеланиями,\r\n\r\n    Элла и Олег Банковы\r\n', 0, '1'),
('9f8f0acc-6855-9b69-63c6-4fe464cd92f9', '8eab065a-b5e5-6a1a-3790-4fe4640a93c8', '2012-04-16 00:00:00', 'Отправила в зоне Педральбес.\r\n\r\nПо словам Риты:  есть объекты в районе площади Бонанова, но это Зона Альта в Барселоне, именно в этом месте за 300.000 ничего не найдется. Можем предложить варианты в других районах, примерно та же зона - Педральбес, есть один очень хороший жилой кромплекс, в нем квартиры с 2 спальнями стоят от 455.000 евро', 0, '1'),
('9fbf24e5-1e8d-bc39-0cbb-4fe464d70103', '9cf95b95-d8f8-23d1-6241-4fe46459092a', '2012-06-18 00:00:00', 'Испания не интересна, вопрос закрыт. ', 0, '1'),
('a1680755-fff4-9234-a742-4fe464e16418', 'a034e7eb-7aff-c5b4-b5bd-4fe464645d90', '2011-11-01 00:00:00', 'Cерьезно займутся вопросом не раньше лета, думает для сдачи покупать,можно прислать недорогие варианты, еще думает про италию и португалию. ', 0, '1'),
('a16a06a3-2364-593b-e4d4-4fe464187d5d', '9fd038e2-3390-c120-f2a6-4fe4648dd1fe', '2012-01-12 00:00:00', '"Добрый вечер,Евгения!\r\nРассмотрели Ваши варианты,к сожалению ничего непонравилось.\r\nинтересуют квартиры в жилых комплексах с бассейном,с 2-3 спальнями от 80 до 130 кв.м.,м\r\nМожно рассмотреть Аликанте."\r\n\r\nПожалуйста, пришлите варианты для Николая!', 0, '1'),
('a1d4f96c-b482-9321-ca86-4fe464d91ab3', 'a034e7eb-7aff-c5b4-b5bd-4fe464645d90', '2012-01-11 00:00:00', 'Рассматривать будет как изначально- был запрос по таунхаусам. \r\nНе раньше лета займутся вопросом.   ', 0, '1'),
