('a2345c56-61d2-2572-b277-4fe4643bae63', 'a034e7eb-7aff-c5b4-b5bd-4fe464645d90', '2012-02-18 00:00:00', 'Anna otpravila: 14,54,83,92,121,213,254,257,269,290,318,342,344,401,402,423,498,503,515,526,527,528,\r\n535,536,552,569,595,598,601,602,609,610. ', 0, '1'),
('a264c486-084d-b75c-e4e4-4fe46424e510', '9fd038e2-3390-c120-f2a6-4fe4648dd1fe', '2012-02-22 00:00:00', '  Варианты апартаментов по Бланке не нравятся, поговорила с женой, она сказала, что хотят, чтобы участок был, отправила им на рассмотрение несколько вариантов дуплексов. \r\n', 0, '1'),
('a2929510-e627-4926-58d6-4fe464349d5c', 'a034e7eb-7aff-c5b4-b5bd-4fe464645d90', '2012-06-14 00:00:00', 'Смотрит, думает, может, какую-то коммерческую недвижимость под сдачу, бюджет 100-200 тыс. ', 0, '1'),
('a2ddb8f6-6edf-aa67-1908-4fe46443fd41', '9fd038e2-3390-c120-f2a6-4fe4648dd1fe', '2012-02-27 00:00:00', 'Добрый вечер,Евгения!\r\nПосмотрели все ваши предложения и пришли к выводу,что Коста-Бланка нам неподходит.\r\nБудем рассматривать Коста-Брава или Коста-Маресме.Если вы занимаетесь этими направлениями,то ждем предложений.\r\nТакие же параметры.\r\nНужна квартира или дуплекс  в хорошем комплексе с хорошим ремонтом и мебелью,или без ремонта и без мебели.\r\n\r\nСпасибо.С уважением,Николай\r\n', 0, '1'),
('a372b676-3fff-23c5-0704-4fe4648ae73a', '9fd038e2-3390-c120-f2a6-4fe4648dd1fe', '2012-02-27 00:00:00', 'Anna otpravila: 91,97,162,169,256,264,294,317,342,401,402,515,526,548,595,596,598,601,602,609,610. ', 0, '1'),
('a3f8272a-fc59-0cad-5649-4fe46461f3de', '9fd038e2-3390-c120-f2a6-4fe4648dd1fe', '2012-02-28 00:00:00', 'Добрый вечер,Анна!\r\nзаинтересовало предложение Бунгало в La Zenia (Ориуэла Коста - Коста Бланка)\r\nЕсть ли там с 3 спальнями.,квартира с 2спальнями это один этаж или два?\r\n\r\nС уважением,Николай\r\n\r\n\r\n27 февраля 2012, 13:44 от anna@nbagroup.es:\r\nДобрый день Николай! \r\n\r\n   Расскажу Вам поподробнее про этот объект недвижимости. \r\nДанный комплекс состоит из бунгало (нижний этаж с полисадником, а верхний этаж  - с солнечной террасой): есть 2 варианта недвижимости – один вариант  - это нижний этаж, все спальни, ванные и гостинная расположены на одном этаже и перед входом есть небольшой полисадник (площадь от 35 кв.м.). Во втором варианте  - 2 этажа, на одном расположены все спальни, ванные, гостиная, кухня, а на втором этаже – соляриум (большая солнечная терраса с видом на бассейн и море, площадью от 40кв.м. до 55 кв.м.). На территории комплекса есть большой бассейн, открытая парковка и подземный гараж. В пешей доступности Вы найдете: детский сад, гос. Школы, частную ангийскую школу - http://www.ellimonarinternational.com/, несколько торговых центров с супермаркетами: Лидл (http://www.lidl.es ), Меркадона, Консум (http://www.consum.es ), киоски,  пивную с собственными сортами баварского пива (http://www.debassus.es ), бары, рестораны с французской, испанской, английской, китайской, немецкой кухнями, адвокатские бюро и нотариальные конторы, аптеки, стоматологическую клинику, банки, автобусные остановки, а также самый крупный торговый центр. В 900 метрах находится песчанный пляж. В продаже есть варианты с 3мя спальнями. \r\n Высылаю Вам дополнительно фотографии образцового варианта дома. \r\nВсегда буду рада ответить на Ваши вопросы. \r\n', 0, '1'),
('a49913f3-42d9-e8e4-c577-4fe4640a0746', '9fd038e2-3390-c120-f2a6-4fe4648dd1fe', '2012-02-28 00:00:00', 'Добрый день Анна какие квартиры есть чуть больше в этом комплексе интересует 2 й этаж\r\n\r\nОтправлено с iPhone, 28.02.2012, в 13:58. \r\n\r\nНа втором этаже: есть вариант с 3мя спальнями, жилая площадь  - 90м2, солнечная терраса  - 38 кв.м., полисадник – 96 кв.м. \r\nА 2 спальневые варианты по площади стандартны до 82 кв.м. \r\n', 0, '1'),
('a4d1026d-5a44-2941-0da8-4fe4640b3126', '8eab065a-b5e5-6a1a-3790-4fe4640a93c8', '2012-05-10 00:00:00', 'Только что вернулись из барсы, пока не известно, берут ли ребенка там в школу, поэтому от этого все зависит с недвижкой.', 0, '1'),
('a518294f-7502-d9b1-021f-4fe464327342', '9fd038e2-3390-c120-f2a6-4fe4648dd1fe', '2012-02-29 00:00:00', 'А есть ли подобная квартира без участка какова ее стоимость и если можно отдельно по комнатам их метраж\r\nОтправлено с iPhone 28.02.2012, в 18:03\r\n\r\nДобрый день, Николай! \r\n3х спальневый вариант идет с участком.  Метраж по комнатам таков: 1 спальня – 12,20кв.м., 2 спальня – 10 кв.м., 3 спальня – 15,70кв.м. \r\nAnna ', 0, '1');
