('a745abc2-94ec-404d-e3f7-4fe4647bd900', 'a59e803a-577b-8116-4169-4fe464d26cf8', '2012-01-27 00:00:00', 'Здравствуйте Ув. Ирина я Юрга!\r\nДумаю, что данная недвижимость соответствует Вашему запросу ( www.costaiberia.ru ):\r\nАпартaмент en Guixols Park (Сант Фелью де Гишолс - Коста Брава)\r\nЛот: 000203 - ЦЕНА: 173.763 € \r\nКОМПЛЕКС “ПАРК ГИШОЛС”                          \r\n \r\nЖилой комплекс люкс с бассейнами и садами, расположенный в Сан Фелью. Роскошные апартменты,  оформленные в современном стиле, с качественной отделкой. Насладитесь неповторимым видом на превосходный морской пейзаж. \r\nПосмотреть недвижимость\r\n \r\n\r\nАпартaмент en Tossa Poble (Тосса де Мар - Коста Брава)\r\nЛот: 000236 - ЦЕНА: 159.700 € \r\nАпартаменты в центре города Tossa de Mar состоят из уютной гостиной, спальной, кухни  в американском стиле и ванной комнаты.  Отличные выбор для тех кто предпочитает отдых на берегу моря .\r\n \r\n \r\n \r\nПосмотреть недвижимость\r\n \r\n\r\nАпартaмент en Girona (Эмпуриабрава - Коста Брава)\r\nЛот: 000239 - ЦЕНА: 149.000 € \r\nАпартаменты находятся в 100 м от моря и вблизи коммерческой зоны.  Одна спальня, гостиная, кухня в американском стиле, ванная комната, небольшая терраса. На территории комплекса есть гараж, бассейн и зеленые зоны отдыха.\r\nПосмотреть недвижимость\r\n \r\n\r\nАпартaмент en Girona (Эмпуриабрава - Коста Брава)\r\nЛот: 000240 - ЦЕНА: 159.000 € \r\n Апартаменты в закрытом комплексе Santa Margarita. Две спальни, ванная комната, гостиная, кухня в американском стиле, терраса с видом на бассейн и сад. На  территории комплекса ведется круглосуточное видеонаблюдение. есть бассейн и зеленые зоны отдыха\r\nПосмотреть недвижимость\r\n \r\n\r\nАпартaмент en Manresa (Понт де Виломара - Коста Брава)\r\nЛот: 000447 - ЦЕНА: 100.500 € \r\nЛюбителям спокойствия и комфорта обязательно понравится объект, расположенный  в Пон-де-Виломара в  самом сердце Каталонии, всего в 7 км от Манреса и 40 км от Барселоны.\r\nЖилой комплекс состоит из апартаментов с 1 и 2 спальнями, а также 3х, 4х спальных  дуплексов с просторными террасами.\r\nВысокое качество отделки с  оригинальным дизайном и  захватывающий  вид  на горы Монтсеррат, делают это  место прекрасным для проживания .\r\nКаждое пространство призвано дать максимум комфорта и насладиться спокойствием  небольшого городка.\r\nПосмотреть недвижимость\r\n \r\n\r\nАпартaмент en Manresa (Понт де Виломара - Коста Брава)\r\nЛот: 000448 - ЦЕНА: 153.500 € \r\nЛюбителям спокойствия и комфорта обязательно понравится объект, расположенный  в Пон-де-Виломара в  самом сердце Каталонии, всего в 7 км от Манреса и 40 км от Барселоны.\r\nЖилой комплекс состоит из апартаментов с 1 и 2 спальнями, а также 3х, 4х спальных  дуплексов с просторными террасами.\r\nВысокое качество отделки с  оригинальным дизайном и  захватывающий  вид  на горы Монтсеррат, делают это  место прекрасным для проживания .\r\nКаждое пространство призвано дать максимум комфорта и насладиться спокойствием  небольшого городка.\r\nПосмотреть недвижимость\r\n \r\n\r\nАпартaмент en Lloret Blau (Лорет де Мар - Коста Брава)\r\nЛот: 000578 - ЦЕНА: 195.100 € \r\nУрбанизация расположена рядом с садами Santa Clotilde, в спокойной зоне между городами Blanes и Lloret.Прекрасное расположение, близость к морю и изумительным пляжам Коста Бравы, с видами на горы и побережье, позволит вам в полной мере насладиться отдыхом на Коста Брава.В приватной зоне резиденции есть бассейн, зелёная зона с парком, детская площадка. Каждая квартира имеет террасу с почти панорамными видами и все удобства, необходимые для комфортного жилья - полностью оборудованную кухню, ванную и салон.\r\nПосмотреть недвижимость\r\n \r\n\r\nАпартaмент en Barcelona Centro (Барселона - Коста Брава)\r\nЛот: 000581 - ЦЕНА: 220.000 € \r\nЖилой комплекс находится в престижном районе Побле Ноу недалеко моря. \r\nВ продаже имеются однокомнатные квартиры стоимостью от 220 000 € и двухкомнатные от 260 000€. Квартиры, расположенные на нижних этажах, имеют выход на просторную терассу, остальные - выход на лоджию. Для отделки использованы материалы высшего качества. Квартиры оснашены полностью экипированной кухней, алюминевыми стеклопакетами. \r\nКомплекс располагает большой приватной зоной с общественным бассейном.\r\nПосмотреть недвижимость\r\n \r\n\r\nАпартaмент en Barcelona Centro (Барселона - Коста Брава)\r\nЛот: 000584 - ЦЕНА: 165.000 € \r\nЖилой комплекс находится в спокойном, тихом районе Форум Литораль,в 15 минутах хотьбы от пляжа. \r\nКвартиры выполнены в современном дизайне, оборудованы всем необходимым - экипированная кухня, встроенные шкафы, панели солнечных батарей , гараж, подсобное помещение. На территории комплекса есть бассейн и тренажёрный зал. Комплекс находится в зоне с удобным транспортным сообщеним - трамваи, автобусы и метро. \r\nК продаже предлагаются однокомнатные, трехкомнатные и четырехкомнатные квартиры с метражем от 55 до 100 метров. Каждая из квартир имеет выход на балкон или террассу.\r\nПосмотреть недвижимость\r\n \r\n\r\nАпартaмент en Barcelona Centro (Барселона - Коста Брава)\r\nЛот: 000585 - ЦЕНА: 226.000 € \r\nЖилой комплекс находится в спокойном, тихом районе Форум Литораль,в 15 минутах хотьбы от пляжа. \r\nКвартиры выполнены в современном дизайне, оборудованы всем необходимым - экипированная кухня, встроенные шкафы, панели солнечных батарей , гараж, подсобное помещение. На территории комплекса есть бассейн и тренажёрный зал. Комплекс находится в зоне с удобным транспортным сообщеним - трамваи, автобусы и метро. \r\nК продаже предлагаются однокомнатные, трехкомнатные и четырехкомнатные квартиры с метражем от 55 до 100 метров. Каждая из квартир имеет выход на балкон или террассу.\r\nПосмотреть недвижимость\r\n \r\n\r\n', 0, '1'),
