('a8030c36-9d27-ef16-f901-4fe4640712a3', 'a5d08cbf-2e42-872a-22ec-4fe464a7266f', '2011-10-31 00:00:00', 'ANDREY: \r\nAcabo de hablar con nuevo Orlov. Va a venir el dia 18. \r\nVa a venir con su amigo (socio) que quiere participar en las reunionas sobre el tema de bicicletas.\r\nDice que no quiere compar nada pero pienso que puede...\r\nEste Orlov es un cliente bastante dificil. Tiene un monton propuestas de los bancos y otras impresas.\r\nNo puedo imaginar como se puede eligir algo con él...\r\n¡Estoy seguro que es un trabajo muy duro!\r\n\r\nAntonio, sus preguntas sobre el negocio de bicicletas:\r\n\r\n1.	Aduana, normas, reglas pagamentos.\r\n2.	Puertas. Que puerto puede recibir los barcos grandes de China.\r\n3.	Operadores de este mercado.\r\n4.	Tiendas...\r\n5.	Ventas en Internet...\r\n', 0, '1'),
('a8806474-abbc-a4c1-6590-4fe4642dd865', 'a5d08cbf-2e42-872a-22ec-4fe464a7266f', '2011-11-08 00:00:00', 'Вячеслав приходил в офис в конце октября. Они с Андреем Владимировичем обсудили, что  первую неделю поездки Вячеслав и его товарищ  хотят посвятить велосипедной теме.(но может быть, они решат посмотреть в эту неделю и какие-нибудь хорошие дорогие  участки и виллы тоже). Затем на второй неделе Вячеслав собирается смотреть недорогие объекты.', 0, '1'),
('a8ff5315-cd77-a35d-e9c5-4fe4640920fe', 'a5d08cbf-2e42-872a-22ec-4fe464a7266f', '2011-11-09 00:00:00', '"Добрый день Евгения!\r\n\r\nОтправляю Вам 2 файла с примерами объектов. Новый около 1000 евро за кв.м , а вторичка около 500 евро за кв.м. Мы хотим что-то подобное новое или вторичка с хорошим ремонтом. Соответственно в хорошем районе города.\r\n\r\n С уважением Елена." 31.10.11\r\nВ файлах :-Просторные апартаменты рядом с пляжем del Cura. 3 спальни, 2 санузла. Жилая площадь 90м2. Рядом с центром. Супер предложение! Только в этом месяце цена всего 59 900€\r\n-Пятиэтажный дом (28 квартир), высшее качество, в самом центре Торревьехи и пяти минутах ходьюы от набережной. 1, 2 и 3 спальни. Установка для кондиционера, меблированная кухня, встроенные шкафы, стеклопакеты. 1 спальня, 47,79 m2 . Цена 63 500 eвро. 2 спальни, от 63 до 74 m2. Цена от 88 500 до 97 500 евро. 3 спальни, от 98 m2. Цена от 109 500 евро. С возмождностью купить подземный гараж и кладовое помещение.\r\n\r\n', 0, '1'),
