('aa504f84-f327-5e08-ca0a-4fe46451be33', 'a8239548-b816-fc1a-6ec9-4fe464a9c47a', '2012-02-03 00:00:00', 'Здравствуйте, Ирина и Александр!\r\n\r\nВ отдельном письме отправила Вам три предложений недвижимости, с очень хорошими характеристиками и максимальной рентабельностью. Так же, существует возможность купить банковскую недвижимость, за минимальную цену, которая стопроцентно подломиться в цене, или же которая находиться в отличном расположении для сдачи ее в аренду, тем самым обеспечивая высокую доходность и быстрый возврат инвестиций. Мы как раз занимаемся переговорами с разными банками по поводу реализации таких объектов. Как только будут результаты, я Вам сообщу. Прогнозы хорошие.. :)\r\n\r\nБольшой привет! С уважением, Юрга.\r\n', 0, '1'),
('aa85fa21-a117-642f-f6fe-4fe464689783', 'a5d08cbf-2e42-872a-22ec-4fe464a7266f', '2011-11-16 00:00:00', 'А можно заранее её купить, чтобы к приезду Вячеслава уже все было?', 0, '1'),
('aad6b37c-0196-f4c7-00ef-4fe464c3322d', 'a8239548-b816-fc1a-6ec9-4fe464a9c47a', '2012-02-08 00:00:00', 'Вчера звонил Марков, сказал, что думает поехать может с 22 по 26 февраля. Я посмотрела для него билеты, он думает.', 0, '1'),
('aaf95591-b2a9-3af1-d6ea-4fe464d5c37d', 'a5d08cbf-2e42-872a-22ec-4fe464a7266f', '2011-11-17 00:00:00', 'Елена звонила, сказала, что Вячеслав возьмет с собой ноутбук.\r\nМожно ли заранее купить модем для него или это может сделать только он или нерезидентам не продадут? \r\n', 0, '1'),
