('ad1cbddb-600e-089f-4dc5-4fe464fcc784', 'ab70454e-5cd1-05aa-1808-4fe464cefbda', '2012-02-10 00:00:00', '"Добрый день !! Евгения ! Спасибо за информацию ! О билетах , попозже , у меня пока нет паспорта и визы. А вот с выбором недвижимости мы хотели бы на 75 процентов определиться до вылета. Поэтому очень рассчитывал на Вашу помошь посмотреть виллы , в диапазоне цен до 550000евр , новую, в районе Алтеи, или Хавеа, или Бенидорма,те на севере Коста Бланка. Есть у вас еще какие- нибудь предложения , кроме того , что мы уже обсуждали. Спасибо . Буду ждать."\r\nЯ у нее спросила, будет ли она и апартаменты и виллы смотреть.', 0, '1'),
('ada34c38-ee0f-afcc-12cf-4fe4646c76a0', 'ab70454e-5cd1-05aa-1808-4fe464cefbda', '2012-02-10 00:00:00', '"Евгения , еще раз добрый день! Сейчас мы определяемся по выбору апартаментов или виллы . Конечно, на месте было бы лучше определить. На следующей неделе мы будем в Санкт - Петербурге , зайдем к вам в офис , для того чтобы окончательно поговорить по подготовке к просмотру недвижимости . НО очень хотелось бы  заранее выбрать для просмотра несколько вилл .Надеюсь на Вашу помощь. Ждем"', 0, '1'),
('ade482bb-b842-bd89-c82c-4fe4644f4f41', '9ff667a9-9fd9-ffca-8185-4fe46423a37d', '2011-07-18 00:00:00', 'Ездила, но пока не купила, так как хочет посмотреть еще Австрию и Германию. Наталье понравилось residencial Azul Beach, Playa de la Mata. ', 0, '1'),
('ae1f7f0b-0a48-a262-2db0-4fe464204415', 'ab70454e-5cd1-05aa-1808-4fe464cefbda', '2012-02-10 00:00:00', 'Женя, кроме того, что Татьяне уже понравилось, можно предложить виллы лот 90, 551 - это расположено в Бенидорме. В комплекса Sierra Cortina. Это респектабельное место, элитные комплексы и услуги. Ты на их особа на виллы не дави, пусть рассматривают разные варианты, в том числе и апартаменты. Таким образом у нас будет больше возможностей на продажу. Так как в их бюджете есть очень привлекательных вещей в продаже.\r\nЮ.', 0, '1'),
