('aeccd73f-92b6-a1dd-2c37-4fe464332e04', '9ff667a9-9fd9-ffca-8185-4fe46423a37d', '2011-07-19 00:00:00', 'Здравствуйте, Элина!\r\nПишу Вам по поводу Яриной Наталии. \r\nС этой клиенткой работала Анна, так как я была в это время в отпуске. После Испании Наталия поехела на просмотр недвижимости в Австрии и Германии. Так как они пока еще не знают в какой стране хотять приобретать. \r\nУ нас ей понравилась новостройка от ТМ на пляже Ла Мата.\r\nВ начале августа, после окончания ее путешествий по Европе, будем  связываться с Наталией.\r\nС уважением,\r\nJurga \r\n', 0, '1'),
('af4a6eca-ef22-5d59-772f-4fe464d941ca', '9ff667a9-9fd9-ffca-8185-4fe46423a37d', '2011-08-15 00:00:00', 'Внесли залог за дом в Австрии, но идею покупки в Испании не оставили,  следующим летом поедут в Испанию. \r\nИнтересуют бунгало, такие как  residencial Azul Beach, Playa de la Mata. Будем на связи, можно присылать подобные варианты. ', 0, '1'),
('afc4fea4-dbb5-1337-0a67-4fe464096946', '9ff667a9-9fd9-ffca-8185-4fe46423a37d', '2011-08-15 00:00:00', 'Добрый день, Евгения!\r\nСпасибо за информацию, все просмотрели. В настоящее время мы занимаемся другой страной и, только летом следующего года вернемся к недвижимости Испании. Думаю, тогда и объекты и цены будут другими. Держите нас в курсе изменений на рынке Испании. \r\nС уважением,  Наталья и Сергей. \r\n', 0, '1'),
