('b0ac7c78-4359-8096-d861-4fe46461d231', 'af25280b-57a5-6dce-f9f6-4fe464476a7d', '2012-05-23 00:00:00', 'АВ сегодня созванивался с Елизаветой Бариновой, все хорошо, все планы в силе.\r\nСегодня вечером они договорились еще созвониться!\r\n', 0, '1'),
