('b52a49db-c0dc-294b-3988-4fe464052242', 'b1d05675-8467-4d69-57f0-4fe464101b13', '2011-07-26 00:00:00', 'На следующей неделе (с 1 августа) Наталья собирается  сходить к Элине Сиванковой в офис на встречу в Москве.\r\nПланы по поездке в октябре в силе, среди отправляемых вариантов есть интересные.', 0, '1'),
('b56a0ddf-68f9-c477-a112-4fe464745e64', 'b1d05675-8467-4d69-57f0-4fe464101b13', '2011-08-10 00:00:00', 'Пока не известно,ходила ли Наталья на встречу к Элине Сиванковой, так как больше недели не отвечает на звонки.', 0, '1'),
('b5ad3bd3-c301-2f7c-e3ac-4fe464c0e99a', 'b1d05675-8467-4d69-57f0-4fe464101b13', '2011-10-10 00:00:00', 'Наконец удалось поговорить с Натальей.Они с мужем  решили отказаться от идеи покупки недвижимости за рубежом. Вопрос закрыт.', 0, '1'),
('b6ed5fe9-5444-38db-efc5-4fe46468d4bb', 'b5f0d87b-724f-6190-b32a-4fe4648d0148', '2011-06-21 00:00:00', 'Llamada telefonica a Olga. Comenta que estan de mudanca, y por el trabajo cada dos semanas, dos semanas se va a Kiev. Toda via no tiene claro la fecha de vieje a España. Necesita para el visado la invitacion. Jurga', 0, '1'),
('b732ce25-3dd8-ac44-a793-4fe464c8a487', 'b5723d92-ac4f-da69-7e23-4fe46426d7df', '2011-10-27 00:00:00', '"Женя привет.\r\nИнна показала нам 6 объектов, несмотря на свое болезненное состояние (она простыла накануне).\r\nЯ очень опасался, что она может невольно заразить Настю, что крайне не желательно во время беременности, но все обошлось.\r\nС Инной мы проговорили наше движение 05/11/2011 и решили, что она покажет в этот день еще несколько объектов в Барсе и около нее и посадит нас на поезд не позднее 16-00, стем, чтобы мы прибыли в Аликанте около 20-30. проинформируйте встречающих. Кстати, я так и не определился с отелем проживания в К-Бланке со 02 по 10/11/2011???\r\nСегодня ее коллега покажет нам 2 объекта в Ллорете и все. То есть мы будем свободны уже в 13-00. Маловато для активного поиска недвижимости.  Тут 4 дня будут идти дожди."\r\n\r\nЯ ему написала, уточнила все-таки 2/11 он собирается на бланку как мы и договаривались или нет. Возможно он просто ошибся, написав в начале 5/11.\r\nЕще раз посоветовала ему Cabo Cervera\r\n', 0, '1'),
('b764b819-5781-6741-c680-4fe46446c124', 'b5f0d87b-724f-6190-b32a-4fe4648d0148', '2011-06-30 00:00:00', 'Приветствую, Ольга!\r\n\r\nНа прошлой неделе мы договорились, что Вы отправите свои личные данные и примерную дату приезда в Испанию, чтобы я Вам могла отправить приглашение . Как сможете, отправляйте – жду.\r\nНовых дешевых объектов недвижимости в Бенидорме пока не появились. \r\n\r\nС уважением,\r\n\r\nJurga Cvetkova\r\nDpto. Venta \r\n', 0, '1'),
('b78003d5-2510-7dc8-885d-4fe4648debaa', 'a3300d7c-32bb-9802-d059-4fe4644ce3f4', '2011-11-10 00:00:00', 'АННА ОТПРАВИЛА: 26,531,545,547,548. ', 0, '1'),
('b7b4b57b-7f1a-1f8d-6730-4fe46437330f', 'b5723d92-ac4f-da69-7e23-4fe46426d7df', '2011-11-07 00:00:00', 'Посмотрели с Дмитрием  3 ноября недвижимость. Знаю, что смотрел на Коста Бланка с luxinvest и еще скем-то. Вроде бы проявляет доверие к нашей компании. В субботу написал мне письмо, сказал, что его интересует объект КУМБРЕ ДЕ ЛАС ХАРРАС В ГОРОДЕ ПОЛОП, просил, предоставить ему как можно больше информации по этому объекту. \r\nСейчас в Португалии, но сказал, что будем на связи! \r\n', 0, '1'),
('b7c53134-3f2c-7254-3d16-4fe464a73917', 'b5f0d87b-724f-6190-b32a-4fe4648d0148', '2011-07-19 00:00:00', '  Ольга хотела бы приехать в Испанию в ближайшее время на неделю или две недели.По датам сейчас еще не известно, так как сегодня её опять вызвали в Киев по работе.Она хочет ехать в Испанию по горящим билетам.У Ольги есть друзья в Торревьехе, и, возможно, она остановится у них, а может, в апартаментах,которые мы ей предложим.Вообще она думала проживать в односпальных апартаментах.\r\n   Пожелания по покупке:отдельные коттеджи (но можно рассмотреть и таунхаусы) с бассейном не далее 10 км от побережья и Бенидорма,  не дороже 200 тыс; и апартаменты тоже на севере от 50тыс до 100тыс.  Нравится la nucia.\r\n   Ольга сказала, что если что-то заинтересует, то могут купить, а если нет, то посмотрят места.\r\n   По поводу кредита:если купят что -то в бюджете до 100тыс, то кредит не нужен; а если бюджет будет больше, то с кредитом. Отправлю ей документы, необходимые для оформления кредита, так как она просила прислать. \r\n   Мы договорились, что она сообщит мне как только будет известно по билетам.', 0, '1'),
('b805d529-f157-2a79-504f-4fe46423fb7e', 'b5f0d87b-724f-6190-b32a-4fe4648d0148', '2011-07-27 00:00:00', 'Сегодня созванивались с Ольгой, она сказала, что с большой долей вероятности может полететь в субботу 30 июля. Пока точно не известно, приедет ли она на 1 или 2 недели, зависит от билетов. Первую неделю будет жить у знакомых в квартире в Торревьехе. А если останется и на вторую неделю, нужно предложить ей односпальневые апартаменты. Она хочет  детальнее все обсудить. Я сказала, что Юрга ей позвонит. Телефон Ольги 8 916 88 99 657.', 0, '1'),
('b85d4140-3213-e03d-4eb0-4fe46436cfd3', 'b5f0d87b-724f-6190-b32a-4fe4648d0148', '2011-07-28 00:00:00', 'Ольга взяла билеты на 30 июля.Летит до Барселоны, а там берет машину и едет в Торревьеху.', 0, '1'),
('b877920e-423f-0ba0-b02b-4fe46471085d', 'b5723d92-ac4f-da69-7e23-4fe46426d7df', '2011-11-16 00:00:00', 'На мое письмо ответил: Добрый день,Анна. Очень рады вас слышать. Осмотры заканчиваем в пятницу.Определится не удалось.В субботу возвращаемся в Москву, и будем решать вопрос по пиобретению в конце января, когда приедем рожать.Очень приятно, что вы о нас помните. У нас о вас остались самые лучшие впечатления.Было приятно  с вами работать. Если все же оределимся. что это Испания, то скорее это будет северная зона от Алеканте обязательно обратимся к вам.\r\nС уважением, Дмитрий.\r\n', 0, '1'),
('b8a55da6-59a1-16d8-7b07-4fe4642c57e2', 'b5f0d87b-724f-6190-b32a-4fe4648d0148', '2011-08-09 00:00:00', 'Olga trabaja con varias inmobiliarias, una de las que sabemos Mehersol. En benidoems le habia gustado mucho la promocion de Jardin del Benidorm, precio 128.000. Mahersol le hecho una oferta de 125.000, pero a Olga le parecido poco. Yo le llamado para ofrecer una cita en la ofinina de Mahersol, hablar del precio y si llegamos a un acuerdo cerrar el trato, pero Olga a dicgo que no esta dispuesta de decidirce ahorra. Va volver a Moscu y sigira vienddo las ofertas que se se van enviando las inmobiliarias. Tiene claro que lo que le gusta: o es apartamento en Benidorm de 100.000 con residencial completo (tipo Jardin del Benidorm), o una villa con vistas de 200.000.', 0, '1'),
('b8e70e2d-c380-3d3e-c475-4fe464b63857', 'b5f0d87b-724f-6190-b32a-4fe4648d0148', '2011-08-17 00:00:00', '   Юрга, добрый день!\r\nЯ общалась с Ольгой Афалиной, она собиралась Вам написать и  попросила  меня тоже Вам написать. Пришлите, пожалуйста, Ольге  планы понравившихся ей квартиры и дома, а также точный метраж комнат.\r\n', 0, '1'),
('b8f124bf-01ec-1f95-ae1d-4fe4640457c3', 'b5723d92-ac4f-da69-7e23-4fe46426d7df', '2012-01-18 00:00:00', 'Дмитрий Черепнев говорил, что будут решать вопрос с покупкой в конце января.\r\nМожет, отправить ему сейчас что-нибудь стоящее, чтобы он и о нас не забывал и вообще подумал.\r\n', 0, '1'),
('b922ee4c-78d5-9b08-3540-4fe4642d0b5c', 'b5f0d87b-724f-6190-b32a-4fe4648d0148', '2011-08-23 00:00:00', 'Estan enviados a Olga los planos de la vivienda de Jardin del Benidorm (mahersol) y chalet en Buenavista (Benissa, Celenia). Tambien se le comento, que el IVA ha bajado a 4% si compra nueva vivienda hasta 31 de diciembre 2011.', 0, '1'),
('b969ee70-37a8-4995-cd23-4fe46423788d', 'b5f0d87b-724f-6190-b32a-4fe4648d0148', '2011-08-23 00:00:00', 'Спасибо, Юрга!\r\nМы напряженно думаем над этим вопросом.. Но... Пока меня "подвесили" по моей работе - и я до сих пор не знаю, есть ли она у меня, или нет, расчитывать ли на зарплату или нет...  От этого будет зависеть вопрос с кредитом...\r\n\r\nОля\r\n', 0, '1'),
