('b9b3f6a1-b16f-247e-23d2-4fe464d49b8d', 'b5f0d87b-724f-6190-b32a-4fe4648d0148', '2011-11-01 00:00:00', 'Ольга сейчас пока опять не определена, если у неё продастся дом в подмосковье, то она сможет смотреть дом в испании. Она обещала сообщить, если что то прояснится.', 0, '1'),
('b9fdfbf4-f820-6c05-4e62-4fe4645b8c2e', 'b5f0d87b-724f-6190-b32a-4fe4648d0148', '2011-12-16 00:00:00', 'Ольга говорила, что пока подвешенное состояние, скорее всего после НГ могут поехать, но вдруг если будут какие то супер билеты, может и до ,но это вряд ли. Думает, что возможно дальнейшее снижение цен, курс евро смущает  и т.д. \r\nОна говорит, что в любом случае мимо нас поездка не получится, она сообщит.', 0, '1'),
('ba478fd8-12c0-c515-9787-4fe4640c7b40', 'b5f0d87b-724f-6190-b32a-4fe4648d0148', '2011-12-27 00:00:00', 'Спасибо большое, Юрга!!!\r\nТебя также с Наступающим Новым Годом!\r\n\r\nНадеюсь увидеться в следующем году!\r\n\r\n\r\n\r\nОля, Сережа\r\n', 0, '1'),
('bb686639-0b8f-72a8-1493-4fe4646b4c9d', 'ba8b7655-a7fb-d387-1c78-4fe46486abc8', '2011-09-26 00:00:00', 'Наконец удалось дозвониться до Виктории. Она побывала в Испании на коста бланке,коста браве и коста дель соль. Общее впечатление у неё не слишком хорошее, она собирается смотреть и в Италии тоже. \r\nПо Испании все-таки больше заинтересовала Коста Брава.\r\nВиктория просила отправить ей варианты.\r\nПришлите мне, пожалуйста,варианты для нее по Браве. Апартаменты,2 спальни,150 тыс.', 0, '1'),
