('bcd4bbcf-c724-bf4f-7ab4-4fe46470a5e0', 'bb20fa6b-c105-e88f-b42b-4fe464c65318', '2011-12-19 00:00:00', 'Владимир просил перезвонить 21 или 22 декабря, он согласует даты.\r\nОн вообще сказал, что хочет дождаться какого-нибудь перелета со скидкой, горящего.', 0, '1'),
('bd09357c-f482-016c-cef1-4fe464592527', 'bbadfb41-99ac-696a-ad50-4fe464a57bc2', '2011-07-29 00:00:00', 'Комментарии Юлии по отправляемым ей вариантам:\r\n-нет карты.Ей нужно четко понимать месторасположение.Для неё это очень важно.\r\n-каков не только общий метраж,но и метраж комнат. Общий метраж интересует от 120кв. метров.\r\n-какой этаж(первый этаж не рассматривает)\r\n-не понравились фото. Фото внутри недвижимости не очень удачные и не очень понятные, на её взгляд. Ей необходимы не только хорошие фото квартиры,но и фото комплекса, ей важно,чтобы он был красивый.\r\nПока Юлия еще не брала билеты. Если она решит работать с нами, то при поездке, свяжется, чтобы посмотреть на месте.', 0, '1'),
