('c89f7574-c731-847d-4e32-4fe464f30309', 'c7d6c478-9f65-b0c9-37c0-4fe46428af51', '2011-08-19 00:00:00', 'Пока есть проблемы в бизнесе,но как только появится ясность,готовы ехать смотреть на месте, продолжаем быть на связи.', 0, '1'),
