('c8fde255-c4fb-091b-3161-4fe464b9ae52', 'c80ae2d6-694b-1139-865a-4fe4644b3aae', '2012-03-05 00:00:00', 'Anna otpravila: 616,526,522,7,8,87,162,278,495,562.', 0, '1'),
('c93e5043-4003-91ff-044d-4fe4646c7599', 'c80ae2d6-694b-1139-865a-4fe4644b3aae', '2012-03-06 00:00:00', 'Высылаем билеты на разные даты. ', 0, '1'),
('c99edb48-3cd4-3fab-b2fc-4fe4642ee5ae', 'c80ae2d6-694b-1139-865a-4fe4644b3aae', '2012-03-07 00:00:00', 'позвонила жена Сычева Владимира Александровича с посл. Питер. выставки-Ольга Федоровна.\r\nУ них уже есть билеты 9-21 апреля. Они работают с леангой, пока не говорят им, что хотят еще с др. агентствами посмотреть. Она просила прислать варианты по проживанию, нужна 1 спальня.\r\nИм главное-максимальная рентабельность объекта, потом через года 1,5 может купят для себя.\r\n', 0, '1'),
('c9a60d6b-e252-c33c-5e1d-4fe46481e14c', 'b54d0eac-7ff8-7d49-ddb8-4fe46458ae47', '2011-07-19 00:00:00', 'Отправила варианты: 379,451,452,453,454. Анна ', 0, '1'),
('c9e4e8b3-40e1-4cb4-7fa7-4fe464242259', 'c80ae2d6-694b-1139-865a-4fe4644b3aae', '2012-03-19 00:00:00', 'Созвонилась с Ольгой Федоровной(женой). ей на пятницу назначен прием у врача, пока не известно, что с гипсом, что делать будут вообще.\r\nБудем еще созваниваться. \r\n\r\nЯ у Маши узнала-Леанга сообщила, что принесет двоих на визы, Сычевы, это точно  значит. Буду с Ольгой Федоровной  на связи.  ', 0, '1'),
('ca071ec8-613c-8e39-43a4-4fe46462eb77', 'c8e523b2-0fc2-8cdb-edbf-4fe464d91c3c', '2011-11-29 00:00:00', 'Приветствую, Уважаемые Юрий и Люба!\r\n\r\nМоя коллега Евгения сообщила хорошую новость – Вы приезжаете 3-го декабря! После приятного знакомства в Москве, теперь уже увидимся на испанской земле .\r\nХотела бы Вам предложить встречу в аэропорту. Вы уже решили где будете проживать? Может Вам нужна помощь в резервирование гостиницы или же можем предложить для проживание квартиру? \r\n\r\nЮрий, я предполагаю, что Вы готовы работать с разными агентствами... но, пожалуйста, имейте в виду, что компания Costaiberia – это не просто агентство по продажи недвижимости, а компания которая работает на рынке более 15 лет, предлогая своим клиентом разные виды услуг, т.к. юридические, экономические и пост продажное обслуживание, которые Вам понадобятся и до, и после приобретения жилья.  Наша компании гарантирует Вам чистоту сделки и банковскую поддержку.  Также своим клиентам компенсируем расходы за перелет. \r\nВ ожидании Вашего ответа \r\n\r\nС уважением, Юрга.\r\nTel.+34 638 742 501\r\nDpto. Venta\r\n', 0, '1'),
('ca2a8021-c3a5-61fc-220e-4fe46498835e', 'c80ae2d6-694b-1139-865a-4fe4644b3aae', '2012-03-22 00:00:00', 'Леанга принесла визы на сычевых, 8-22 апреля. по документам они будут жить в recidencial Liisa ,calle Gandi № 31, Torrevieja', 0, '1'),
('ca713d6a-bddf-4b0b-ba76-4fe464192236', 'c8e523b2-0fc2-8cdb-edbf-4fe464d91c3c', '2011-11-30 00:00:00', 'Здравствуйте Юрга!\r\nПолучил Ваше письмо . Спасибо что не забываете о нас. Нас встретят в Аликанте,а жить мы будем в Кампаморе в квартире.\r\nМы долго искали компанию,которая сняла бы нам жилье по нормальной цене,так как мы приежаем на месяц.\r\nВсе предлагают отели,а там проживание такое время будет стоить дорого.\r\nПервые дни нашего прибывания в Испании варианты жилья нам будет показывать компания которая нас пригласила.\r\nНо все равно,покупать мы будем там где нам больше понравятся условия покупки,расположение жилья,его состояние\r\nи еще много чего. Так что мы с Вам обязательно свяжимся, у нас все Ваши телефоны есть.\r\nНас интересует в большей степени новое жилье,но также можем посмотреть и хорошую вторичку.\r\nДо встречи. С ув. Юрий и Люба!\r\n', 0, '1'),
('ca810a63-49ee-d534-98d3-4fe46409467b', 'c80ae2d6-694b-1139-865a-4fe4644b3aae', '2012-03-26 00:00:00', 'Сычевы согласны смотреть с нами 9 или 10 апреля. Мы с Ольгой Федоровной созваниваемся 2 апреля, она поточнее скажет. Она спрашивает, можно ли оба дня по полдня смотреть?\r\n\r\nЛеанга предоставляет им проживание. Вообще они познакомились  с Леангой уже полгода назад.\r\n8-15 апреля живут на юге, затем на севере.\r\n\r\nСмотреть хотят с леангой и нами, Владимир Александрович говорит, что есть еще какое- то агентство, но не известно, будут ли они с ним смотреть.\r\n\r\nОни хотят купить недвижимость под сдачу в аренду, первые 1,5 года будут сдавать, а сами приезжать пару раз в году. Думают, или близко к морю илии рядом со спа, гольфом или солеными озерами. Просят, чтобы коллеги посоветовали, что будет сдаваться точно.\r\n\r\nРентабельные, ликвидные апартаменты 1-2 спальни, (но главное, чтобы комнаты не были слишком маленькими, чтобы хотя бы одна из спален была не меньше 13 кв.м.) , не студия, метраж от 55 м (60-80 кв.м ), если дальше 700 м от моря, то с гаражом. Можно залоговую недвижимость.\r\n\r\nБюджет: юг до 110 тыс, север до 125 тыс.\r\nесли бюджет до 90 тыс, то хотят 60% ипотеки, если больше 90 тыс., то от 70 % ипотека.\r\n\r\nИм нравится наш лот 204, но они бы хотели поторговаться по нему до 110- 112 тыс за 2 спальни.\r\nЕще им нравятся: 432,167,616,617,7,113.\r\n\r\nТакже от какого то евродомика им нравится6 363,356,258.\r\n\r\n\r\n\r\n\r\n', 0, '1'),
('cab7e6ce-b693-14f8-9af4-4fe46452c320', 'c9f9aa64-728c-1d45-bb81-4fe4641d6ac7', '2011-07-19 00:00:00', 'otpravila: 124,126,137,147,168,195,229,232,235,450. Anna', 0, '1'),
('cae2a89e-9324-3af0-14eb-4fe46491e98e', 'c80ae2d6-694b-1139-865a-4fe4644b3aae', '2012-04-18 00:00:00', 'Sychevy smotreli s nami 3 dnya nedvizhimost, im ponravilos 2 varianta. Segodnya oni dali nam dokumenty na kredit. Zhdem ix resheniya naschet odnogo varianta, kotoryi im podxodit po stoimosti. Zavtra posmotrim etot variant eshe raz.  ', 0, '1'),
('caed2fa2-ab79-0ac5-d2f8-4fe4646d4517', 'c9f9aa64-728c-1d45-bb81-4fe4641d6ac7', '2011-08-01 00:00:00', 'Андрей Юрьевич собирался ехать в августе, но в силу обстоятельств личного характера пока не известно, когда может состояться поездка.', 0, '1'),
('cb2a2d3d-1f66-f86b-7e8b-4fe464880aa6', 'c9f9aa64-728c-1d45-bb81-4fe4641d6ac7', '2011-11-16 00:00:00', 'Пока ничего не известно, до НГ вряд ли будет решать вопрос с покупкой. Не очень определен, собирается и на другие выставки по недвижимости.  ', 0, '1'),
