('ccf4a732-4bcd-e740-b14a-4fe46418183c', 'cbfdc2be-0fef-2fc0-2f62-4fe464c0b75b', '2012-04-19 00:00:00', 'Алексей приходил на встречу в офис по ВНЖ! сказал, что по покупке хочет со знакомыми англичанами работать, больше им доверяет, но АВ  сказал, если будет  какое то предложение в хавее, которое предлагаем только мы, а не все подряд, можно ему отправить!\r\n\r\nПришлите, пожалуйста, если есть что-то стоящее и интересное. ', 0, '1'),
('ce1698e8-4dcb-b346-5c99-4fe4645e5374', 'cd3b2bfd-e0a1-6791-a635-4fe4640a14c8', '2012-04-13 00:00:00', 'Смотрел с нами, а также с несколькими другими агентствами, врал, так ничего и не купил.\r\nСказал в последний день, что в офис не будет приходить, что он себя плохо чувствует! что как в Москву вернется, будем с ним на связи по скайпу и по почте. ', 0, '1'),
('cf17eb49-0c32-c19b-68cc-4fe4644d0803', 'cdd3c4e3-256c-afae-0a3d-4fe4646475b8', '2011-09-05 00:00:00', 'Сергей Васильевич в течение ближайшего времени скорее всего определится с возможной датой поездки в октябре. ', 0, '1'),
('cf3a3819-568f-163d-9409-4fe464ae48bf', 'ce5c4836-2c44-2b10-dbcf-4fe464d6e05f', '2012-03-28 00:00:00', 'Марина  думает зайти к нам в офис примерно в середине апреля.\r\nПришлите, пожалуйста, для неё возможные недорогие варианты 50-60 тыс. не из базы.\r\nНомер рейса сообщит ближе к поездке. ', 0, '1'),
('cf577584-d240-c40c-9066-4fe4649736b2', 'cdd3c4e3-256c-afae-0a3d-4fe4646475b8', '2011-09-16 00:00:00', 'Здравствуйте!\r\nСергей собирается поехать в Испанию в начале октября на 10 дней.Сейчас смотрим билеты. Он поедет еще с одним человеком, жить думает в односпальневых апартаментах.\r\nСкажите, пожалуйста, какая будет стоимость аренды лота 243 на 10 дней в октябре?\r\nЕсть ли еще односпальневые апартаменты, которые можно ему предложить?', 0, '1'),
('cf94cf1f-abb2-0b43-cae5-4fe464094253', 'cdd3c4e3-256c-afae-0a3d-4fe4646475b8', '2011-09-28 00:00:00', 'Добрый день! \r\nСергей Глядяев с супругой поедут в Испанию с 6 по 16 октября, но они едут в Салоу,они готовы приехать на Коста Бланку на 2-3 дня.\r\nПока они точно не знают, будут ли брать машину в аренду или прибегнут к вашей помощи, и их нужно будет забрать.\r\nДумают посмотреть местность и недорогую недвижимость(50 тыс.), так как хотят купить на время  жилье с основной целью начать процедуру ПМЖ.\r\nСозваниваемся 3 октября.', 0, '1'),
('cfcd9f8f-42b9-79ad-8883-4fe464105f82', 'ce5c4836-2c44-2b10-dbcf-4fe464d6e05f', '2012-04-18 00:00:00', 'Номер рейса в базе.', 0, '1'),
('cfd57fd2-2f3f-ad24-3a36-4fe4644c1cba', 'cdd3c4e3-256c-afae-0a3d-4fe4646475b8', '2011-10-03 00:00:00', 'Евгения, если не ошибаюсь, Вы сегодня будуте созваниваться с Сергеем. По поводу визита на Коста Бланку передайте, пожалуйста, что нам было бы удобнее паработать с ним с 10-го по 13-е. С Салой в Аликанте, лучее всего приехать поездом,это будет наиболее удобным, отправляю Вам ссыйлку на сайт: https://venta.renfe.com.', 0, '1'),
('cfedf7f0-0ebd-f158-67c7-4fe464d549c4', 'e5cb9ab3-6a93-3cb1-6d1c-4fe464141416', '2012-06-07 00:00:00', 'Последнее время Игорь не выходит на связь. ', 0, '1'),
('d00f8359-709c-6d0d-6eac-4fe464a2217b', 'ce5c4836-2c44-2b10-dbcf-4fe464d6e05f', '2012-05-12 00:00:00', 'Ahora hablaba con nuestro cliente Marina Ptitsyna.  Marina es el agente inmobiliario en Rusia por la experiencia del trabajo  16 años.\r\nEs muy descontenta como ha ido a Espana . Hablábamos de 40 minutos, y todo esto  tiempo expresaba el descontento.\r\nAquí básico que no la gusta:\r\n\r\n- no han dado los materiales y la información sobre cada objeto mostrado\r\n- no han caído en algunos objetos, puesto que no podían abrir la puerta\r\n- eran apuntados solamente a las demostraciones, simplemente mostrar, sin alejar al gráfico, a pesar del interés de la cliente\r\n- no han preguntado los documentos para el prestamo, aunque los ha traído consigo\r\n- no han llevado gratis en el aeropuerto atrás, han invitado a llevar por 90 euros. Aunque le prometíamos que la conducirán hasta el aeropuerto y se preocuparán sobre ella.\r\nNaturalmente es el punto final del descontento de Marina, después de que a ella se ha fortalecido  la impression malo  sobre nosotros. \r\n', 0, '1'),
('d0130b42-7a96-ca99-f9cd-4fe4644fe706', 'c0be0284-aa52-b890-590d-4fe464996ba4', '2012-04-18 00:00:00', 'Говорит, просто линейку цен не надо, надо показать глубину, различные варианты от 90 до 200 тыс, не город лучше, а места потише.\r\n', 0, '1'),
('d0142967-8793-b107-d790-4fe464552bd2', 'cdd3c4e3-256c-afae-0a3d-4fe4646475b8', '2011-10-03 00:00:00', 'Юрга и Анна,добрый вечер!\r\nПоговорили с Сергеем.\r\nОн думал поехать на Коста Бланка 9 или 10 окт, я передала, что как раз с 10 окт  будет взаимно удобно работать.Он вообще хотел поехать на день,но я предложила на 2-3 дня.\r\nСергей все-таки хочет добираться на машине(брать её в Салоу и возвращать туда же).Подскажите,пожалуйста, что передать Сергею по поводу аренды машины?\r\nПроживание: можно предложить ему апартаменты на время пребывания-какой все таки лот 243 или 246?\r\nСмотреть Сергей с супругой думают недорогую недвижимость за 50 тыс евро, а также объекты за 300 тыс для сдачи(предпочтительно дом, но может в принципе и таунхаус рассмотреть).\r\nБуду ждать от Вас уточнений, чтобы связаться с Сергеем.\r\n\r\n', 0, '1'),
('d053aaed-7ba6-864f-898d-4fe464c0c43d', 'cdd3c4e3-256c-afae-0a3d-4fe4646475b8', '2011-10-04 00:00:00', 'Добрый день, Женя!\r\n\r\nПередайте клиенту, что его будем ждать в понедельник 10-го. Для аренды машины он может воспользоватся услугами компаний: EUROPCAR, GOLDCAR.. Для проживания порекомендуйте гостиницу (я ее закажу, просто спросите сколько звезд они предпочитают), так как на 1-2 сдавать квартиры получается очень дорого (так как нужно после их убирать стирать и т.д.).\r\nЖеня обязательно передайте мой номер телефона для связи и спросите будет ли у них телефон, по которому можно будет связаться.', 0, '1'),
('d09307c0-70c3-c714-bfa2-4fe4649d8396', 'cdd3c4e3-256c-afae-0a3d-4fe4646475b8', '2011-10-04 00:00:00', 'Сергей с женой сказали, что будет достаточно трехзвездочной гостиницы. С 10 октября по 12 октября.(но как я поняла,вряд ли они планируют 12ого оставаться на весь день, скорее всего уедут утром или в первой половине дня). \r\nЕще раз его телефон: 7 921 887 35 81.Он сказал, что другого телефона не будет, только этот.\r\nУ него есть контакты Юрги и Ани. ', 0, '1'),
