('d38c5355-0709-f6ac-68bd-4fe4641962d2', 'd2845faa-ee98-22cf-523f-4fe464fed293', '2011-07-22 00:00:00', 'Larisa y Liubov:\r\n•	Quieren comprar la vivienda como una inversión, por lo tanto debe ser sencillo alquilarlo mas tarde.\r\n•	También contemplan la posibilidad de comprar un terreno y construir en él una vivienda, pero igualmente como inversión.\r\n•	No tiene presupuesto concreto, puede invertir 100.000 €, pero también si es muy interesante, podría llegar hasta un millón de euros o quizás mas.\r\n•	Ahora piensa sobre el País en el que quiere invertir:\r\no	Ha decidido que en los países Árabes, no son seguros.\r\no	Quiere que sea un país con litoral porque le gusta el Mar.\r\no	Quiere que sea una vivienda moderna, cerca del Mar con acceso fácil a Internet, ya que ella trabaja en la Bolsa desde su domicilio.\r\no	Le gusta mucho el Mar, y quiere bañarse cada mañana, cuando esté en España.\r\n', 0, '1'),
