('d9667952-a8be-4721-b08f-4fe4644c5ea1', 'd62168ec-2b92-4fad-9ce5-4fe464dc1c7e', '2011-11-29 00:00:00', 'Здравствуйте Ув. Андрей!\r\n\r\nКак и обещала отправляю Вам свои контактные данные: тел. (+34) 638 742 501, а также моей коллеги Анны (на всякий случай) (+34) 620 128 502.\r\nАндрей, Вы вчера сказали, что будете работать с несколькими агентств... но, пожалуйста, имейте в виду, что компания Costaiberia – это не просто агентство по продажи недвижимости, а компания которая работает на рынке более 15 лет, предлогая своим клиентом разные виды услуг, т.к. юридические, экономические и пост продажное обслуживание,получение ВНЖ, которые Вам понадобятся и до, и после приобретения жилья.  Наша компании гарантирует Вам чистоту сделки и банковскую поддержку. Также своим клиентам компенсируем расходы за перелет. \r\nЖду от Вас письмо с номером Вашего телефона для связи в Испании .\r\n\r\nС уважением, \r\nЮрга.\r\n', 0, '1'),
