('db86248b-8bba-fe1b-059d-4fe4642a8bc5', 'd62168ec-2b92-4fad-9ce5-4fe464dc1c7e', '2011-12-26 00:00:00', 'Созвонились с Андреем, он только вчера вернулся в Россию, еще ничего конкретного сказать не может, до НГ точно еще ничего не известно, но говорит, что места понравились.  \r\nЯ позвоню ему после НГ.', 0, '1'),
('db990dbe-5330-c0fc-188f-4fe464c4a72d', 'c6800417-cfdc-e56a-bf92-4fe4648ba738', '2011-11-07 00:00:00', 'Поедет весной 2012, будем на связи.', 0, '1'),
('dbe31d61-742e-5d54-2f39-4fe4641bc77d', 'd62168ec-2b92-4fad-9ce5-4fe464dc1c7e', '2012-01-17 00:00:00', 'Андрей сказал, что они внесли залог в другом агентстве. По его словам , жене понравился объект, он спокоен к нему. \r\nОбещал сам написать Юрге.', 0, '1'),
('dc2e18e0-d506-6cf4-eb75-4fe4641395f4', 'd62168ec-2b92-4fad-9ce5-4fe464dc1c7e', '2012-02-27 00:00:00', 'Здравствуйте Юрга!\r\n\r\nПишу по итогам процесса выбора недвижимости в Испании.\r\nМы остановились на небольшом домике - шале в Orihuela Costa на вторичном рынке за 165 т. \r\nЭтот домик, как-то сразу приглянулся жене. \r\nМожет быть не все учли, но в феврале внесли за него залог. Сейчас ведем подготовку к сделке.\r\nВ любом случае, Вам спасибо за потраченное на нас время.\r\nВаши контакты сохраню, возможно кто-то из знакомых  будет тоже интересоваться испанской недвижимостью.\r\n\r\nС наилучшими пожеланиями,\r\nАндрей Ходатаев\r\n', 0, '1'),
('dc8134df-3d0f-fb8c-d9e6-4fe46450da8d', 'db89fdf8-062e-de61-5808-4fe464d74f71', '2011-07-12 00:00:00', 'Вопрос с Испанией закрыт.', 0, '1'),
('ddc91bb9-6312-7ba4-7fbf-4fe464cb0f50', 'dcfd1ee5-fd6f-fdf1-2d4d-4fe464ee093b', '2012-03-17 00:00:00', 'Анна, добрый день!\r\nНас заинтересовали аппартаменты  Лот: 000548. Пришлите, пожалуйста детальную информацию по цене и площадям помещений аппартаментов с одной и двумя спальнями, которые есть в наличии. Какова жилая и общая площадь, какова площадь террасы? Кухня в аппартаментах отдельная или "американская", находящаяся в комнате? Как оборудована кухня, какова площадь кладовки, наличие и стоимость гаража/машиноместа.\r\nЕще вопрос. Недалеко от этого дома на углу улиц Poligon Cales Atalayes и Calle Gregal продаются аппартаменты\r\nс двумя спальнями по цене значительно выше, чем у Вас - 211.000-218.000 евро против Ваших 160.000 евро. Это связано с неудачным расположением дома, с использованием других материалов при строительстве или с чем-то еще?\r\nИ последний вопрос. Квартиру хотим покупать с мужем на двоих, основным плательщиком (по размеру официальной зарплаты) буду я, хотя оплата будет идти со счета мужа. У меня на работе ужесточили выезд сотрудников за границу, разрешение на выезд оформляется не менее 2-х - 2,5 месяцев. Может ли муж самостоятельно приехать и оформить все необходимые документы, каким-либо образом подтвердив мое намерение участвовать в этой сделке (например, нотариально заверенная доверенность или что-либо еще)? Или же внеся определенный залог забронировать понравившиеся аппартаменты на более длительный срок, чем обычно (например, на 3 месяца), чтобы я могла позже приехать и лично подписать необходимые документы?\r\nС уважением,\r\nСветлана\r\n \r\n14.03.2012, 12:45, "Anna Deryusheva" <anna@nbagroup.es>:\r\n', 0, '1'),
('ddf9fd89-df55-bde6-bcd4-4fe4640b6d74', 'dce6a29b-8236-ab6d-7526-4fe464930883', '2011-07-18 00:00:00', '   Светлане и Сергею необходимо присылать варианты недвижимости в Аликанте, Сан Висенте,Эльче,Мурсии, квартира, 2 спальни, бюджет 100 тыс. либо чуть дороже(если с кредитом). Они были на встрече с Антонио, он записал их пожелания.', 0, '1'),
('de13802d-49e1-a7ad-8853-4fe464373016', 'dcfd1ee5-fd6f-fdf1-2d4d-4fe464ee093b', '2012-03-23 00:00:00', '!!!  Дмитрий и Светлана едут 8-12 апреля , готовы с нами посмотреть прямо в воскресенье. Не против встречи в аэропорту. Инфо по рейсу и проживанию  написала.\r\n\r\nОни поняли, что хотят смотреть именно Бенидорм. Хотят посмотреть лот 548.\r\nКроме того, у другого агентства понравились угловой дом с синими балконами и дом за гольф полями(2 башни).\r\nОн прислал ссылки на них(отправила вам на почту) . Спрашивает, почему лот 548 дороже синих балконов.\r\n\r\nМогут рассмотреть еще подходящие варианты.\r\n\r\nОни хотят банковскую недвижимость, 90% ипотеки.  Недвижимость для проживания дедушки, бабушки и ребенка. ', 0, '1'),
('de5c08fd-1d52-43fb-8651-4fe464f9c1cf', 'dce6a29b-8236-ab6d-7526-4fe464930883', '2011-07-22 00:00:00', '•	Desean comprar una vivienda, vivir en España y montar un negocio, para ganarse la vida. El hotel, es el negocio que han pensado pueden iniciar.\r\n•	Han pensado en la zona interior de España, como por ejemplo en la Cataluña interior o en Aragón.\r\n•	En septiembre del año 2010, han conocido Toledo, Madrid, Cartagena, Torrevieja y le gusta mucho mas el interior de España.\r\no	Les he dicho que en la Costa mediterránea, es mas sencillo vivir y montar un negocio para un extranjero, ya que en el interior de España, no están tan acostumbrados para recibir a los extranjeros.\r\n•	No saben bien, que negocio sería posible para ellos y están pensando en ello. En este momento, les gusta la idea de montar un pequeño hotel para gestionarlo directamente.\r\n•	 Han preguntado sobre la financiación:\r\no	Hemos puesto el ejemplo de 60.000 € de préstamo.\r\no	Hemos dicho que pagarán alrededor de 300 €/mes de cuota, durante 30 años.\r\no	Hemos dicho que deberán demostrar unos ingresos de al menos 900 €/mes.\r\no	Los intereses serán de al menos 4,5%, para el primer año y los años sucesivos.\r\n•	Les gusta vivir en una ciudad grande con infraestructura, colegios para su hija, centros comerciales, etc. También puede ser cerca de ciudades que tengan estos servicios buenos. Para ellos, es muy importante que el lugar tenga servicios, mucha infraestructura.\r\n•	 El presupuesto, puede ser de 100.000 € para un apartamento. \r\n•	Hemos hablado que vamos a proponerles y enviarles por Emails apartamentos de su presupuesto, que haya como ejemplos de Elche, de Alicante, San Vicente del Raspeig y de Murcia, que les interesa también de una ciudad grande del interior. Quieren también recibir, ejemplos de valencia o de ciudades muy próximas a Valencia, ya que les ha gustado la ciudad en su visita a España.\r\n•	Creen que para la 1ª quincena de enero, cuando son fiestas en SPB, puede ser buen momento para venir a España.\r\n', 0, '1'),
('de64b4ae-fba4-ac79-0d12-4fe464eaa6dd', 'dcfd1ee5-fd6f-fdf1-2d4d-4fe464ee093b', '2012-05-16 00:00:00', 'Телефон не отвечает. \r\n8-12 апреля, бенидорм-смотрели с Юргой один объект.\r\nВторой раз были в мае-смотрели с Аней.', 0, '1'),
