('e38a1327-7a15-a4c2-5f5b-4fe4642ca6d5', 'e2a50aec-4771-7f0a-2125-4fe464e834fb', '2012-05-11 00:00:00', 'Евгений едет не только с нами с 13 мая на десять дней на Бланку, я отправила ему контакты Ани и Тани.\r\n\r\nОн просил позвонить ему вечером 13 мая, узнать где он в итоге остановится (Аликанте или Бенидорм).\r\n', 0, '1'),
