('e3fc35b3-af14-dba5-fc66-4fe464b6457c', 'e1fd2429-06f1-bc92-0391-4fe464d11031', '2012-02-13 00:00:00', 'У Анастасии идея покупки сохраняется, но это планы не на "завтрашний" день, договорились созвониться в период с 15 по 25 апреля, возможно к лету съездит посмотрит в Испанию. ', 0, '1'),
