('e44f77a9-0c85-fd81-3c3e-4fe4640646a6', 'e1fd2429-06f1-bc92-0391-4fe464d11031', '2012-03-07 00:00:00', ' Анастасия Могучая сегодня позвонила даже сама, хотя договаривались созвониться в апреле:\r\nОна думает поехать посмотреть в мае, отправлю ей билеты.\r\nОна просила прислать варианты по недвижимости для неё, но не с сайта, а что-нибудь еще(2 спальни, квартиры, бунгало, природа красивая, море недалеко, 60-100 тыс евроя).\r\nБуду ждать!\r\n', 0, '1'),
