('e49ce4e4-5434-4e16-49eb-4fe46425c3ed', 'e1fd2429-06f1-bc92-0391-4fe464d11031', '2012-03-13 00:00:00', '"Я сейчас занимаюсь вопросом визы - пытаюсь сделать бизнес на год.Как будет ясность и поданы документы в посольство - будем бронировать 14-18 апреля\r\nСпасибо\r\nПС\r\n я бы все таки сейчас посмотрела дополнительные малобюджетные (60-70 тыс евро) варианты не с сайта\r\nМожете прислать?"\r\n', 0, '1'),
