('e5de0b9d-eaee-11ce-5a49-4fe4643da8fd', 'd08e0351-0931-89ce-a21f-4fe464e17a82', '2011-07-22 00:00:00', '•	Conoce la Costa de Almería, y se ha interesado por cosas allí.\r\n•	Conoce también Cataluña, y le ha gustado mucho también.\r\n•	Por tanto, ha decidido España para vivir y comprar una casa.\r\n•	Su presupuesto es de 150.000 €. y prefiere un duplex a otra opción. No le importa que el duplex, si es muy buena oportunidad esté a 2 kms del Mar. \r\n•	Le hemos explicado que en Costaiberia, ahora tenemos oficina en SPB y a partir de Octubre, tendremos oficina en Moscú. Que NBA, es una empresa jurídica en Alicante (España).\r\n•	Desea venir a España en noviembre.\r\n•	Antes de este mes, le vamos a enviar muchos ejemplos de Duplex, en Costablanca Norte y Sur, también de la Costa Almería\r\n', 0, '1'),
