('e6c4dcf1-c9c9-01ab-66dd-4fe464464874', 'e5cb9ab3-6a93-3cb1-6d1c-4fe464141416', '2012-05-11 00:00:00', 'Игорь едет в июне, но с другим агентством, сначала в барсу, потом в Аликанте.\r\nЯ ему дала контакты Ани, Тани и Риты(вдруг он позвонит)', 0, '1'),
('e6e0e0d1-51af-2d2a-fe7a-4fe464880d6a', 'e5c1adae-8e0a-faa2-c315-4fe464971993', '2011-07-21 00:00:00', 'Представитель Андрея Голунова - Лейла +79219198601.\r\nСозваниваемся с Андреем 8 августа.\r\n', 0, '1'),
('e70c7b50-8171-3b2a-e028-4fe46422246a', 'e5cb9ab3-6a93-3cb1-6d1c-4fe464141416', '2012-05-15 00:00:00', '"Здравствуйте Евгения,\r\nПросьба посоветуйте как лучше разместиться в Аликанте с 1 по 8 июля 4 чел. (2 взр.+2 детей). Аппартаменты или отель с бассейном, недалеко от пляжа (пешком), по разумной цене. Хочется сочетать просмотр и отдых.\r\nС уважением,\r\nИгорь"\r\n\r\nЯ узнаю, подходит ли им не только Аликанте, а и близлежащие городки и напишу .\r\nНадо им помочь с проживанием, мы  с ним  нормально общаемся.\r\n \r\n\r\n', 0, '1'),
('e72ae92b-fddd-13ab-9058-4fe464bba6b5', 'e5c1adae-8e0a-faa2-c315-4fe464971993', '2011-08-08 00:00:00', 'Планы в силе,покупать думает в 2012г, но слетать посмотреть м.б. получится и раньше(в октябре- ноябре). ', 0, '1'),
('e75028c9-5b25-059a-ea34-4fe46458c4a7', 'e5cb9ab3-6a93-3cb1-6d1c-4fe464141416', '2012-05-16 00:00:00', '  "Мы хотим посмотреть объекты на севере и на юге, поэтому нам кажется Аликанте удобнее, хотя может быть не так. Посоветуйте. Нужно ли брать машину?"   \r\n', 0, '1'),
('e78a8fcd-a523-7af1-5e66-4fe4649034cc', 'e5cb9ab3-6a93-3cb1-6d1c-4fe464141416', '2012-05-22 00:00:00', 'Созвон 28  мая.\r\nОпределяется  с проживанием на бланке, думает, хотел пожить 3-4 дня на севере, потом на юге. Я посоветовала сразу в одном месте остановиться, чтобы типа не уставать от переездов.', 0, '1'),
('e78c653f-dcb3-5edf-2efa-4fe464861965', 'e5c1adae-8e0a-faa2-c315-4fe464971993', '2011-11-11 00:00:00', '                 Добрый день!\r\n\r\nЕще с выставки в Петербурге с марта этого года я общаюсь с клиентом Андреем Голуновым.\r\nВчера он наконец то приходил в офис.\r\nЭто  очень серьезный и важный клиент для нас, если хорошо по нему отработать, думаю, за ним потянутся и другие подобные клиенты. \r\nБюджет Андрея до 1.5 млн евро с кредитом.\r\n\r\nТребования к недвижимости:\r\nСевер Коста Бланка, обязательно с красивым панорамным видом( море и горы). Если вдруг будет какое то предложение по югу коста бланки, то можно прислать, указав, что это юг, но только если там действительно хороший вид. До моря не обязательно пешком.\r\n-250-350 кв. м. , не  принципиально одноэтажная или двухэтажная постройка.\r\n-не менее 4 спален и 4 сан. Узлов\r\n-оборудованная кухня\r\n-зона столовой и отдыха\r\n-терраса\r\n-хозяйственная зона\r\n-камин\r\n-отопление\r\n-кондиционирование\r\n-теплый пол\r\n-спутниковое ТВ\r\n-интернет\r\n\r\nСад, газон, авто-полив по участку, бассейн с подогревом, паркинг или гараж на 2 машины, возможна зона барбекю.\r\nОбязательно вся инфраструктура рядом и обязательно сигнализация, желательно охрана. Безопасность очень важна!\r\nПри просмотре Андрей( и сам строитель кстати)  возьмет с собой строителя, чтобы смотреть на качество и все остальное.\r\n\r\nНужно только первичное жилье, никакого строительства, уже готовый объект. Надо присылать фото действительных домов, а не просто рисунки построенных  в будущем.\r\nУчасток максимум 10 соток, слишком большой не надо.\r\nУ Андрея двое детей: старшему ребенку 22 года, младшему 1,5 года.\r\nЕму нужно обязательно понимать, что сможет там  делать его супруга с маленьким ребенком, то есть чтобы было не просто предложение по различным виллам, а и предложение что делать маленькому ребенку, что- то для него, это важный момент! \r\nТо есть нужен не только дом, а нужно, чтобы у него в голове сложилась полная картинка, что его семье там будет действительно хорошо, и будет что то для ребенка.\r\n\r\nПожалуйста, пришлите мне, варианты. Буду ждать. Спасибо)\r\n_________________________      \r\nС уважением, Евгения Драмбозова\r\nМенеджер по работе с клиентами\r\nКомпания «Costa Iberia»\r\n\r\nТел.: +7 (812) 5794071\r\nМоб.: +7 (921) 5512158\r\nE-mail: drambozova@costaiberia.ru\r\nWeb: www.costaiberia.ru   \r\n', 0, '1'),
