('e7f2caf7-740d-5117-ca07-4fe464d8b8ec', 'e5cb9ab3-6a93-3cb1-6d1c-4fe464141416', '2012-05-24 00:00:00', 'Здравствуйте Евгения,\r\nМы решили остановиться на севере Коста Бланки. Нет ли у вас вариантов апартаментов в районе Бенидорма, Кальпе, Алтеа в тот же период с 01.07. по 08.07.12.\r\n\r\nС уважением,\r\nИгорь\r\n', 0, '1'),
