('e84265b1-a319-ee20-9c25-4fe464639ab4', 'e5c1adae-8e0a-faa2-c315-4fe464971993', '2011-11-21 00:00:00', 'По бюджету отправленные варианты дорого(высылала за 1,9 млн).\r\nЛучше прислать за 1,2 млн. в современном стиле.\r\nБуду ждать варианты.Спасибо.', 0, '1'),
