('e877c8e3-852f-9976-9c29-4fe464dbf5d4', 'e5cb9ab3-6a93-3cb1-6d1c-4fe464141416', '2012-05-29 00:00:00', 'Добрый день, Евгения\r\nВариант проживания в Кальпе с 01 по 08 июля нас устраивает. Просьба забронировать.\r\nСообщите какие действия от нас необходимы, как добираться, оплачивать и пр.\r\n\r\nС уважением,\r\nИгорь\r\n_________________\r\n\r\n\r\nВариант №2.      Кальпе, цена 487,08€/неделя, 600 метров до моря, с бассейном и рядом со всеми удобствами. \r\n\r\nПока план такой: мы прилетаем в Барселону 24.06., и в а/п берем автомобиль на весь срок. 01.07. выезжаем из Барселоны в Кальпе. Необходимо понимать куда ехать, контакты для связи в Испании и пр.\r\n\r\nС уважением,\r\nИгорь\r\n', 0, '1'),
('e88cd98d-4082-ec2a-578c-4fe464916c84', 'e5c1adae-8e0a-faa2-c315-4fe464971993', '2011-12-02 00:00:00', 'Наконец ему понравились виллы в хавее 1160 000 евро,бениссе 1550 000 евро  и бенидорме 1200 000 евро! \r\nМожно двигаться в этом направлении и подбирать подобные варианты.\r\nНо его интересует вопрос – почему цена на хорошую виллу в Бенидорме была так снижена, нет ли каких-либо обременений и подводных камней или проблем с ней.\r\nЯ сказала, что такое вряд ли возможно, наша компания не стала бы работать с подобными продавцами.\r\nЯ ему сказала, что попрошу коллег пообщаться с продавцом, возможно, они получат от него какую то информацию и пояснения.\r\n\r\nОбъяснила  Андрею про виллу в Бенидорме.\r\n\r\n\r\n', 0, '1'),
