('ebf92e48-ed80-b7f8-2dae-4fe4641d8af5', 'ea9a3680-541c-6a60-2ad3-4fe4648ae4ab', '2011-09-27 00:00:00', 'Добрый день, Ув. Владимир!\r\n\r\nМеня зовут Юрга, я работаю в офисе Г-а Антонио Наварро, с которым Вы весной этого года познакомились в Санкт-Петербурге . Г-н Антонио Вам передает огромный привет, и спрашивает может быть Вы уже спланировали визит в Испанию, так как желали с сыном приехать осмотреться. Будем рады встретить Вас и организовать просмотр как жилой, так и коммерческой  недвижимости.\r\n\r\nС уважением,\r\nЮрга Цветкова\r\nКомпания costaiberia.\r\n', 0, '1'),
