('ec4b6edc-cdc7-72d6-c698-4fe4640c4622', 'e5cb9ab3-6a93-3cb1-6d1c-4fe464141416', '2012-06-08 00:00:00', 'Сегодня жена Игоря(Наталья) принесла в московский офис 240 евро в качестве предоплаты апартаментов в Кальпе 1-8 июля на время просмотра недвижимости.\r\nВообще должны были 244 евро, но не было 4 евро.\r\nОни ждут адрес и название апартаментов.\r\nОтправила на почту вам их паспортные данные и фио.\r\n\r\nНужно будет их встретить, передать ключи и проводить до квартиры.\r\nОни на машине из Барсы поедут на Бланку. ', 0, '1'),
