('ef31e21b-b394-9fbc-d382-4fe4649a3c8e', 'ee1f32eb-6190-de7e-a49b-4fe4640e5f4c', '2012-05-12 00:00:00', 'Анатолий в Москве как то встречался с Антонио и АВ.\r\nЕго жена Нина Константиновна и сын едут на бланку 16-25 мая смотреть недвижимость. Цена 70 тыс евро, по типу не знают-апартаменты или таунхаус.\r\nАнатолий Павлович сказал, что у жены еще не все расписано, и можно с нами тоже посмотреть.\r\n\r\nЕё телефон +7916 731 10 79\r\n\r\nПозвоните её обязательно!\r\nЭто тот самый Анатолий, у которого директор хочет виллу снять, мы ему отправляли дорогущую виллу в кабо роиг для аренды. Он сказал, что директор пока думает, выбирает между Испанией, Италией и Грецией.\r\n', 0, '1'),
