('f262f360-20c7-853e-9b6f-4fe464d062f4', 'f142ac32-7cb6-0b13-3c03-4fe4644abe2d', '2012-06-09 00:00:00', 'Даты приезда семьи Снегиревых несколько поменялись из-за того, что у няни нарушение по финской визе, поэтому больше 60 дней ей нельзя быть в Шенгене.\r\nВ итоге андрей снегирев летит на неделю без изменения.\r\nа все остальные(жена, дети, няня) остаются только до 24 августа.', 0, '1'),
('f35c1e2a-0936-0f62-5a80-4fe4648d703f', 'f252b3bf-03be-0a4e-e185-4fe4646902af', '2011-08-09 00:00:00', 'Думали поехать в сентябре отдыхать на коста брава и совместить отдых и просмотр недвижимости, но пока не получается, не известно,когда смогут поехать.', 0, '1'),
('f3d62aaa-c0cf-4832-721a-4fe464893b8e', 'f2bab7d6-38c6-8632-3d4f-4fe4641c656a', '2012-04-18 00:00:00', 'Бланку не надо.\r\nВсе-таки интересно только от Барселоны до Салоу.\r\nБюджет 250 тыс.\r\nОтправила лот 168, а также варианты по Барселоне от партнеров.(за 238,226,260 тыс)  \r\n', 0, '1'),
('f3e58eb6-a0bd-db94-ecb0-4fe46443cd47', 'f2cb52de-a595-215c-f8c1-4fe464084f74', '2011-11-07 00:00:00', 'Cначала после выставки нормально созвонились, теперь на телефоне все время короткие гудки, и письма не отправляются,хотя адрес написан в анкете разборчиво.', 0, '1'),
('f41875f7-16ca-2e6d-af9a-4fe4644c70d0', 'f2bab7d6-38c6-8632-3d4f-4fe4641c656a', '2012-05-15 00:00:00', 'Анатолий приходил на встречу к АВ.\r\nАВ говорит, договорились на сентябрь. Пока не успела поговорить подробно-куда едет бланка или брава. ', 0, '1'),
('f63f0e7d-3494-e969-4c00-4fe4645712b9', 'd8e808e4-568e-5d8e-30e3-4fe4642464bc', '2012-06-04 00:00:00', 'Планы не изменились, продолжают рассматривать, нормально общаются, когда будут промежуточные решения, сообщат, на связи. Думают север или юг Бланки.', 0, '1'),
('f74c05dc-b284-03c6-952c-4fe464eebdc6', 'd08e0351-0931-89ce-a21f-4fe464e17a82', '2011-11-14 00:00:00', 'Анна отправила: 8,10,15,16,17,25,31,38,50,83,92,97,138,156,162,253,254,264,270,311,317,318,336,337,342,401,402,424,526,535,552.', 0, '1'),
('fe180d25-f77e-ab6c-a548-4fe4643fb43f', 'd08e0351-0931-89ce-a21f-4fe464e17a82', '2011-11-24 00:00:00', 'Анна отправила: 66,256,538,539,563,564,568,569,570. ', 0, '1');
