('fc570d07-38ed-8f5a-f266-4fe2e60a8301', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'Vistavka «Inforeal» 9/2010\r\n  Олег Седунов с сентябрьской  выставки «Инфореал» приедет посмотреть недвижимость  сначала в Малагу 25 апреля, а  примерно через пять дней он поедет смотреть на Коста Бланку.\r\n   Он отказывается сказать номер рейса, говорит, что сам доберется до офиса. Скажите, пожалуйста, адрес офиса и номер телефона партнеров в Малаге.\r\n   Я ему отправляла все Ваши координаты.\r\n   Также сначала он отказывался рассмотреть наши предложения по проживанию, но сегодня  решил все таки рассмотреть.\r\n  Пришлите, пожалуйста, варианты по проживанию в Малаге и на Коста Бланке.\r\n  Координаты Олега:  +79817209892, o.sedunov@mail.ru \r\n  Пожелания к покупке: \r\nКвартира 1-2 спальни, удаленность от моря не важна, бюджет до 100 тыс.\r\nАндрей Владимирович возьмет с собой ноутбук в Москву, можно будет писать ему на почту.\r\n', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russia', 'San Petersburgo', 'San Petersburgo'),
