('75934ce4-6f30-b5a0-5d11-4fe2e61e25bb', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'тишинка апр 2012\r\n\r\nЛлорет де мар и окрестности, апартаменты, 75-100 м кв,  2-3 спальни\r\nИнтересует то, что потеряло в цене', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('75ed9831-38c0-775b-197e-4fe2e6a4a43e', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'тишинка апр 2012\r\n\r\nКоста бланка, 2 спальни, рядом с морем, обязательно рядом школа, собираются жить бабушка с ребенком\r\nдо 100 тыс', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('764d2cce-5f4f-a7b9-c82a-4fe2e61a73f0', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'тишинка апр 2012\r\n\r\nКоста дель соль, коста бланка - можно пробовать, гранада, где близко до горнолыжных курортов, апартаменты, таунхаус, 2 спальни\r\n200 тыс', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('76bc1a71-4a79-c453-0863-4fe2e6aa1b40', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, ' тишинка апр 2012\r\n\r\nКоста бланка, апартаменты, 3 спальни,  1-2 линия,дети 7-19, боизость к школе, колледжу, терасса,инфраструктура\r\n\r\n160-300 тыс', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('7743adbb-0511-0341-bea5-4fe2e643098e', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'тишинка апр 2012\r\n\r\nПокупка: закр. терраса, вилла или таунхаус, 300-400 тыс, 2 спальни, коста бланка, коста дель соль\r\nАренда: 15 июля -15 августа, вилла или таунхаус, 2 спальни, пешком до моря, 1500-2000 в неделю, аренды машины, малага, коста бланка, 4 человека\r\n', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('77c002d6-1e2a-f926-c2e6-4fe2e6653a03', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'тишинка апр 2012\r\n\r\nКоста брава, апартаменты, таунхаус, до 2 спален, море - до часа езды, \r\n250 тыс, возможен кредит,  ', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('783a2212-8e71-9a1f-bace-4fe2e62f0a34', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'тишинка апр 2012\r\n\r\nКоста брава, побережье, апартаменты, 1 спальня\r\n100 тыс', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('78b1d63a-3702-a6c1-744c-4fe2e6ea6f4e', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'тишинка апр 2012\r\n\r\nКоста брава, поближе к барселоне, квартира, 1–2 спальни, до 150 тыс', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('792efb0a-e82d-44c5-2cf1-4fe2e6c0ae2f', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'тишинка апр 2012\r\n\r\nКоста бланка, апартаменты, таунхаус, от 2 спален, от моря пешком. Купить и сдавать\r\n\r\nдо 180 тыс., кредит ( первый взнос 50 тыс.), ', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('79b9c9f0-9b88-1643-a3b5-4fe2e6f1d571', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'тишинка апр 2012\r\n\r\nКоста бланка, торревьеха, квартира, 1-2 спальни\r\n70-85 тыс евро, ', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('7b35493c-aeba-9611-2d74-4fe2e6ffe437', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'тиишнка апр 2012\r\n\r\nРегион - Брава Марезме, видовая квартира в урбанизации с 2-мя спальнями. Не первая линия, но в пешеходной доступности до моря. Обязательно бассейн, парковка и близость с ж/д сообщением. Квартира под сдачу.  \r\n\r\n200 тыс.€, кредит на 3-5 лет.  ', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russa', 'Moscu', 'Moscu'),
('7bce768e-951e-0725-1e3f-4fe2e6ea9bb9', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'Партнер по медицинскому проекту.\r\n\r\nЕдет в Испанию смотреть госпитали и пару дней может посмотреть недвижимость.\r\n\r\nДумает квартиру или дом, 200-250 тыс, пока точно не знает, что, для семьи из 3 человек.', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russia', 'San Petersburgo', 'San Petersburgo'),
('7c677c79-30fc-0a5a-bda2-4fe2e674d746', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'Ленэкспо 03/2012\r\n\r\nбланка, таунхаус, квартира, мин 2 спальни, лучше 3; до 1 км от моря, 150-200 тыс.', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russia', 'San Petersburgo', 'San Petersburgo'),
('7d05a5f6-39cf-c278-afaa-4fe2e60d29de', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'Была встреча  с АВ и Антонио в Тольятти.( не помню точно, когда, вроде в 2010 или 2011 году).\r\n\r\nНужно один или два объекта на двоих владельцев.\r\n\r\nДеньги будут в июне, так как пока продают квартиру в Москве.\r\n\r\n\r\n', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russia', 'Togliatti', 'Togliatti'),
