('80dd2b26-e227-caab-8c7f-4fe2e60b9837', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'quiere la residencia para Él, su mujer y su niño (7 años). El tiempo de la recepción de la residencia es verano del año siguiente.\r\n\r\nArtem quiere comprar el apartamento (o villa) en Costa Valencia (Un ciudad pequeño donde viven su amigos. No sé qué). Puede comprar los inmuebles con nosotros. Va a hacerlo en invierno (porque en verano él trabaja mucho, y en invierno no).\r\nHay que recordar que en primer lugar su interés es la residencia. Por eso tenemos que buscar el apartamento cerca de escuela buena para su hijo. \r\n', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russia', 'San Petersburgo', 'San Petersburgo, Smolensk'),
('816dd5fa-43ce-c121-7a99-4fe2e6512960', 'individual', 'permanent', NULL, NULL, NULL, NULL, NULL, 'У Андрея Владимировича есть давний хороший знакомый, отношения у них очень хорошие. Человек этот для АВ важен. Просто впаривать  ему ничего не надо, АВ полетит с ним и , если, например,  АВ  какой то объект не понравится, он посоветует его не покупать. \r\n\r\nЗнакомого зовут Александр.\r\nЕму нужен хороший объект! \r\nУ Александра на покупку есть бюджет 1 млн долларов.\r\nАВ говорит, что скорее всего ему подходит север Аликанте, а также Барселона., Отдельный дом в закрытом комплексе, 4 спальни.\r\nАлександр готов снять что-то на пару недель и поехать посмотреть. \r\n', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Russia', NULL, ''),
