('61ca2e03-bf7f-7f53-e095-4fe1d017c53e', 'Пентхаус в Эстепоне в урбанизации El Campanario', '2012-02-27 14:26:39', '2012-06-20 17:29:54', '1', '1', 'Комментарий.:Здравствуйте,меня зовут Ирина,я из Санкт-Петербурга.\r\nСпасибо за письмо.\r\n     Продается пентхаус в Эстепоне в урбанизации El Campanario.  \r\nПервый этаж: две спальни (16,3 кв. м + 13,0 кв. м), гостиная 37,0 кв. м, два санузла, терраса 17 кв. м. Второй этаж: спальня 16,0 кв. м, большая гардеробная, большой санузел. Роскошная терраса с видом на море, горы, африканский континент и Гибралтар 120 кв. м, барбекю, джакузи с гидромассажем.Пентхаус отремонтирован и полностью укомплектован новой мебелью и техникой. Интернет, WI-FI, русское TV. В комплексе тропический сад с водопадами и тремя бассейнами. Спорт-центр, ресторан. Охрана 24 часа в сутки, два гаражных места и кладовка в подземном паркинге. \r\n     Телефоны для связи: +34 693453551 Екатерина -это моя дочь,она учится в Марбелии в Les Roches.С ней можно связываться по поводу просмотра пентхауса.Она учится до 16 часов, может показывать в любое время после 16 00 ,в выходные она свободна.По всем вопросам обращайтесь пожалуйста ко мне .Мой Питерский номер +7 921 957 0505 Ирина.Я на связи всегда.Посылаю вам фотографии.Цена 650 000 евро. \r\nСпасибо.\r\nС уважением Ирина  \r\n ', 0, '1', 'Spain', 'Costa del Sol/Коста Дель Соль, Estepona/Эстепона, Estepona', NULL, NULL, 'penthouse', NULL, NULL, NULL, NULL, '623', 'mortgage', '', NULL, NULL),
